strong> 10.15 – 11.00</strong>  &#160;&#160; Ponencias <br /> <strong> 11.00 - 11.30</strong>  &#160; &#160;   Pausa café<br /> <strong> 11.30 – 12.15</strong>  &#160; &#160;   Ortopedia Maxilar y Vías Aéreas Superiores<br /> <strong> 12.15 - 13.00</strong>  &#160; &#160;     Mesa Redonda</p> <p>&#160;<strong><br /> </strong></p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:34',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(10,478,'iii-encuentro-multidisciplinar-de-ondontologia-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria',1,1,'III Encuentro Multidisciplinar de Ondontología Integrada y Pediatría Extrahospitalaria y Atención Primaria',NULL,NULL,NULL,NULL,NULL,'<p><img src=\"resources/upload/image/78-iii-encuentro/III-Encuentro-Multidisciplinar.jpg\" class=\"left bordered\" style=\"width: 303px; height: 422px;\" alt=\"\" />El pasado 6 de Mayo, ha tenido lugar en Sevilla, el ya clásico y anual encuentro multidisciplinar e interprofesional  de la Sociedad Española de Odontología Infantil integrada (SEOII) – Sociedad Española de Pediatría Extrahospitalaria y Atención primaria (SEPEAP); un Encuentro Multidisciplinar que, como en años anteriores, volvió a constituir un verdadero éxito de asistencia y participación.</p> <p>Dada a las numerosas inscripciones registradas y al limitado aforo del salón de actos de la Real Academia de Medicina y Cirugía de Sevilla (lugar habitual de celebración de estos encuentros), este año, las diferentes mesas redondas y conferencias tuvieron lugar en los salones del Centro Cultura El Monte, los cuales fueron cedidos desinteresadamente por dicha prestigiosa Institución Sevillana.</p> <p>El acto, inaugurado por el Dr. D. José Luis Bonal Villanueva (Presidente de la SEPEAP) el Dr. del Pozo Machuca (Dtor. de Pediatría Integral) los Drs. Barbería Leache y Cabrera Suárez (asesores científicos de la SEOII) comenzó con una palabras a cargo de la Dra. Domínguez Reyes, Presidente de la SEOII, “In Memoriam” del prestigioso pediatra Prof. D. Antonio González- Meneses González-Meneses, presidente, hasta Marzo, de la Real Academia de Medicina y Cirugía de Sevilla. En sus palabras, la Dra. Domínguez no solo glosó los muchos méritos de esta figura de la Pediatría Española y Sevillana, sino que, expuso, además, la preocupación que este pediatra había manifestado siempre, por una asistencia al niño con verdadero perfil bio-psico-social.</p> <p>La Conferencia inaugural corrió a cargo de la Prfa. Dª Elena Barbería Leache, Catedrático de Odontopediatría en la Facultad de Odontología de la U.  Complutense de Madrid, la cual expuso su visión de la <b>Odontología Infantil Integrada como ciencia y arte.</b> Una visión que afianza la necesidad de una atención odontológica específica en el niño con carácter multidisciplinar e interprofesional.</p> <p>La primera mesa redonda (<b>Enfermedades Oncológicas</b>) moderada por el Dr. Cabrera Suárez, tuvo como ponentes a los Drs. D Francisco Vela Casas, Prof. Adjunto de la Unidad Hemato-Oncológica de Pediatría en el Hospital Virgen Macarena, y al Dr. Galán González Prf. Asociado de la Facultad de Odontología de la U. de Sevilla. Ambos ponentes expusieron, respectivamente, las complicaciones oro-faciales de cáncer infantil y sus tratamientos, y las pautas odontológicas preventivas y paliativas a seguir en niños con problemas oncológicos.</p> <p>En la segunda mesa redonda (<b>Erupción dentaria</b>) moderada por la Dra. Elena Barbería, los ponentes Dr. D. Antonio González-Meneses López (Pediatra Especialista en Dismorfología y Genética clínica) y el Dr. D. José Mª Ustrell i Torrent ( Prof. Titular de Ortodoncia de  la Facultad de Odontología de la U. de Barcelona), analizaron no solo la erupción dentaria normal y patológica, sino las enfermedades infantiles que podían incidir de alguna forma sobre  la dicha erupción.</p> <p>La tercera mesa redonda <b>Manejo del niño con alteraciones de la conducta</b>), moderada por la Dra. Domínguez Reyes, estuvo a cargo de los  Profs. Ignacio Gómez de erreros (Prof. Titular de Pediatría y Jefe de Servicio de Pediatría en el Hospital Virgen del Rocío) y el Dr. D. Joaquín de Nova, Prof. Titular de la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p></p> <p>El Prof. Gómez de Terreros habló sobre las Conductas disociales y las bases neurobiológicas de la violencia y el Dr. de Nova sobre el Comportamiento como factor determinante de la atención dental infantil.</p> <p>Todas las mesas redondas, expuestas con gran brillantez por sus participantes, tuvieron como colofón, interesantes y muy animados coloquios en los que una vez más se puso de manifiesto el interés que tanto Pediatras como Odontólogos (jóvenes y menos jóvenes) muestran por estos temas que la sociedad detecta como importantes y gran actualidad.</p> <p>Tras el altísimo nivel de las Mesas Redondas y sus ponentes, en el capítulo de conferencias, los Drs. Elías Casals (Prof. Asociado de Odontología Preventiva y Comunitaria de la U. de Barcelona)  y el Dr. D. Emilio Lledó (Coordinador del PADA en Sevilla), y con el mismo nivel, expusieron con sistemática claridad los problemas de la Higiene dental y su prevención, así como la Realidad de la Odontología en el Plan Andaluz de salud Bucodental, temas que motivaron intensa participación y numerosas preguntas por parte de los asistentes al encuentro.</p> <p>La Conferencia de Clausura estuvo a cargo del Dr. del Pozo Machuca (Director de la Revista Pediatría Integral y Pediatra extrahospitalario de Sevilla) quien de una manera brillante, clara y amena supo exponer los problemas actuales de la Adolescencia, a la vez que apuntaba reflexiones para una mejor compresión y tratamiento del joven con problemas.</p> <p>Agradeciendo a la Sociedad Española de Pediatría Extra-Hospitalaria y Atención Primaria su participación y patrocinio en este III Encuentro Multidisciplinar; y a las entidades Pfizer,  Dentaid, Pierre-Fabre, Normon y Fundación El Monte su colaboración, la Dra. Domínguez Reyes por la SEOII y el Dr. del Pozo Machuca por la SEPEAP clausuraron este tercer encuentro, recordando que:</p> <p><b>El V Congreso Nacional y I Internacional de la Sociedad Española de Odontología Infantil Integrada </b>tendrá lugar los día 14 a 18 de Marzo del 2007 en Sevilla. Evento para el que se cuenta con un Curso a cargo de la Dra. Wilma Simoes (Brasil), otro del Dr. Rocabado (EEUU) y cursos de RCP infantil y Microimplantes; además de conferencias por Odontólogos y Pediatras Españoles y Extranjeros.</p> <h2>Tríptico del encuentro</h2> <p>Descargar <a href=\"resources/upload/link/78-iii-encuentro/seoii-triptico-cara.pdf\"><strong>tríptico cara</strong></a> | descargar <a href=\"resources/upload/link/78-iii-encuentro/seoii-triptico-dorso.pdf\"><strong>tríptico dorso</strong></a><strong><br /> </strong></p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:34',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(11,479,'ii-congreso-santiago-de-compostela-2002',1,1,'II Congreso Nacional Santiago de Compostela 2002',NULL,NULL,NULL,NULL,NULL,'<p>II Congreso de la Sociedad Española de Odontología Infantil Integrada</p> <p>X Congreso de la Asociación Gallega de Higienistas Dentales</p> <p>Santiago de Compostela 15 y 16 de noviembre de 2002</p> <p>Jornadas Luso-Espanholas de Medicina Dentária Infantil</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/84-ii-congreso-sevilla-2007/triptico-1.jpg\" target=\"_blank\">portada [JPG]</a></b> | <b><a href=\"resources/upload/link/84-ii-congreso-sevilla-2007/triptico-2.jpg\" target=\"_blank\">interior [JPG]</a></b></li> </ul>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:35',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(12,480,'i-encuentro-multidisciplinar-sevilla-2003',1,1,'I Encuentro Multidisciplinar Sevilla 2003',NULL,NULL,NULL,NULL,NULL,'<p>I Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría E