,NULL,NULL,0,NULL,NULL,NULL),(15,483,'iii-congreso-nacional-barcelona-2003',1,1,'III Congreso Nacional Barcelona 2003',NULL,NULL,NULL,NULL,NULL,'<p>III Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</p> <p>Hotel Alimara, Barcelona, 6 al 8 de noviembrede 2003</p> <p>Con el soporte de la Academia de Ciencias Médicas de Cataluña e islas&#160; Baleares y el reconocimiento de interés sanitario de la Generalitat de Catalunya</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a target=\"_blank\" href=\"resources/upload/link/93/III-Congreso-2003-Barcelona-portada.jpg\">portada [JPG]</a></b> | <b><a target=\"_blank\" href=\"resources/upload/link/93/III-Congreso-2003-Barcelona-interior.jpg\">interior [JPG]</a></b></li> </ul>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:36',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(16,484,'iv-congreso-nacional-madrid-2005',1,1,'IV Congreso Nacional Madrid 2005',NULL,NULL,NULL,NULL,NULL,'<p>IV&#160;Congreso de la Sociedad Española de Odontología Infantil Integrada</p> <p>Madrid, 11 y 12 de marzo de 2005</p> <p>Primer año que se solicitan y conceden acreditaciones, desde este momento, para&#160; todas las actividades se solicitaron y concedieron créditos de Formación Continuada (para Profesionales) y de Libre Configuración (para los alumnos de las Licenciatura).</p> <p>Este es un dato a destacar, dado que para ello, la actividad necesita reunir una serie de requisitos para su aceptación y su elaboración y la solicitud ha de ser realizada de modo minucioso y lleva mucho tiempo y trabajo.</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/94/IV-Congreso-Madrid-2005-portada.jpg\" target=\"_blank\">portada [JPG]</a></b> | <b><a href=\"resources/upload/link/94/IV-Congreso-Madrid-2005-interior.jpg\" target=\"_blank\">interior [JPG]</a></b></li> </ul>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:36',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(17,485,'iii-congreso-internacional-viii-congreso-nacional-de-odontologia-infantil-integrada-madrid-2013',1,1,'Madrid 2013: III Congreso Internacional, VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada',NULL,NULL,NULL,NULL,NULL,'<p>Los días <strong>14 al 16 de marzo de 2013</strong> se celebró en Madrid el <strong>III Congreso&#160; Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada.</strong><strong><br /> </strong></p> <ul>   <li>Ver <a href=\"http://seoii.es/es/96/iii-congreso-internacional-viii-congreso-nacional-de-odontologia-infantil-integrada-madrid-2013#premios_congreso\"><strong>Premios de Comunicaciones del Congreso</strong></a></li> </ul> <p><img alt=\"\" src=\"resources/upload/image/96-madrid2013/presentacion-seoii-madrid2013.jpg\" /></p> <h3>Presentación</h3> <p align=\"justify\">Queridos y estimados compañeros,</p> <p align=\"justify\">Como Presidenta del Comité Organizador, me gustaría invitaros a  participar en el <strong>3er  Congreso&#160; Internacional&#160; y&#160; 8º  Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</strong> que  tendrá lugar del 14 al 16 de Marzo de 2013, en la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p align=\"justify\">En esta ocasión, trataremos temas de relevante  actualidad e impacto  que nos serán útiles en nuestro día a día, por  esta razón nos centraremos en  aquellos aspectos más novedosos en la  atención odontológica infantil a través  de mesas redondas, talleres y  cursos intracongreso.</p> <p align=\"justify\">Contaremos para ello con la colaboración de  diversos profesionales de  reconocido prestigio, tanto nacional como  internacional, pertenecientes a  distintos&#160; ámbitos de las Ciencias de  la  Salud.</p> <p align=\"justify\">Todo esto conforma un Congreso de carácter  multidisciplinar e  interprofesional, característica distintiva de  nuestra Sociedad (SEOII) que  esta comprometida con la innovación y la  mejora continuada, enriquecido por las  aportaciones de los  participantes realizadas mediante comunicaciones  presenciales y/o  pósters virtuales.</p> <p align=\"justify\">Nos gustaría contar con vuestra asistencia y a la  vez animaros a  recorrer Madrid,&#160; a disfrutar&#160; de una ciudad donde os  encontraréis en  vuestra casa. Madrid ofrece una gran diversidad  cultural, gastronómica y de  ocio, todo esto unido, a su vida en la  calle y a la forma  en que sus habitantes acogen al visitante.</p> <p align=\"justify\">En el convencimiento de que estos días que vamos a  disfrutar van a ser  inolvidables, os animo a compartir conocimientos y  amistades, lo que nos  ayudará a ser mejores profesionales y sobre todo  mejores personas.</p> <p align=\"left\">Esperando  contar con tu  presencia, recibe un&#160; fuerte abrazo</p> <p><strong>Dra. Mª Rosa Mourelle Martínez<br /> Presidenta Comité Organizador del 3er Congreso Internacional  y <br /> 8º Congreso  Nacional de la <br /> Sociedad Española de Odontología Infantil Integrada.</strong></p> <p>&#160;</p> <h3 id=\"premios_congreso\">Premios de Comunicaciones que se entregarán en el Congreso</h3> <ul>   <li><strong>Premio Dra. Rocio Cortés a la MEJOR COMUNICACIÓN ORAL presentada por un odontólogo o estomatólogo al 3º Congreso Internacional 8º Nacional de la SEOII</strong><br />   La Sociedad Española de Odontología Infantil Integrada patrocinado por las Dras. Mº del Carmen Martín de Agar y Blanca Loscertales Martín de Agar convocan el “PREMIO DRA. ROCIO CORTÉS” A LA MEJOR COMUNICACIÓN ORAL presentada por un Post-Graduado en Odontología o Estomatología sobre ODONTOLOGÍA INFANTIL al 3º Congreso Internacional 8º Nacional de la SEOII que tendrá lugar en Madrid desde el 14 al 16 de marzo de 2013. <br />   <a href=\"http://seoii.es/file/326\"><em>Descargar las bases</em></a></li>   <li><strong>Premio Dr. González-Meneses a la MEJOR COMUNICACIÓN al 3º Congreso </strong><strong><strong>Internacional </strong>8º Nacional de la SEOII</strong><br />   La Sociedad Española de Odontología Infantil Integrada convoca el “Premio DR. GONZÁLEZ-MENESES” A LA MEJOR COMUNICACIÓN ORAL presentada por un Post-Graduado en Odontología, Estomatología, Pediatría u otras Ciencias de la Salud sobre tema MULTIDISCIPLINAR en Odonto-Estomatología Infantil al 3º Congreso Internacional 8º Nacional de la SEOII que tendrá lugar en Madrid desde el 14 al 16 de marzo de 2013. <br />   <a href=\"http://seoii.es/file/327\"><em>Descargar las bases</em></a></li> </ul> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Facultad de Odontología</strong><br /> Universidad Complutense de Madrid - Ciudad Universitaria<br /> 28040 Madrid - Tel.+ 34 914520400</p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:36',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(18,486,'viii-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria',1,1,'Sevilla 2011: VIII Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria',NULL,NULL,NULL,NULL,NULL,'<p><img height=\"286\" width=\"200\" alt=\"\" src=\"http://seoii.es/resources/276\" class=\"right bordered\" />El día Sábado <strong>28 de Mayo de 2011 </strong>se celebró el <span style=\"font-weight: bold;\">VIII Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria, </span><strong>Sevilla</strong></p> <p>&#160;</p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos 0,92 Créditos de Formación Continuada y 1 Crédito de Libre Configuración para los alumnos de la Universidad de Sevilla.</strong></li>   <li><strong>Se entregará certificado de asistencia con créditos.</strong></li> </ul> <p>&#160;</p> <h3>Conclusiones</h3> <p>El pasado 28 de Mayo tuvo lugar en Sevilla el anual Encuentro Multidisciplinar e Interprofesional&#160; de&#160;la&#160; Sociedad Española de Odontología Infantil integrada (SEOII), Sociedad Española de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). Un Encuentro Multidisciplinar que, como en años anteriores, volvió a constituir un verdadero éxito de participación y comunicaciones científicas.</p> <p>En esta ocasión el tema monográfico a desarrollado fue “El maltrato infantil” y a él asistieron como ponentes y participantes Odontólogos, Estomatólogos, Pediatras, Psicólogos y Maestros.</p> <p>El acto fue inaugurado por el&#160; Ilmo. Sr. D. Ignacio Gómez de Terreros (Vicedecano de Hospitales de Sevilla y Presidente del Consejo Andaluz de asuntos de Menores);&#160;el Dr. José Luís Bonal Villanueva (Presidente de la SEPEAP),&#160;el Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca (Presidente honorífico de la SEPEAP) y&#160;la Dra. Antonia Domínguez Reyes (Presidenta de la SEOII).</p> <p>Reconocido por&#160;la Dirección General&#160; de Calidad Investigación y Gestión del Conocimiento con 0,92 créditos de Formación Continuada, y por la Universidad de Sevilla con 1 crédito de Libre Configuración, el tema de esta VIII reunión, se desarrolló en dos mesas redondas: <br /> En la primera, moderada por D. Rafael Muriel Fernández, trató&#160;la “Promoción y Recuperación en la intervención ante el maltrato infantil”. La segunda mesa redonda versó sobre “La incorporación de las voces infantiles en las políticas de salud”. Fue moderada por D. Antonio Garrido Porras y en ella se abordaron los distintos aspectos que supone la atención frente al maltrato: gestión, sanidad (“Opiniones infantiles a la vivencia hospitalaria”); “Análisis Cualitativo” y aspectos educacionales, presentándose, además, la llamada “Red Sabia” (Salud y buen trato a la infancia y adolescencia en Andalucía)</p> <p>Las comunicaciones, desarrolladas por diferentes profesionales de las distintas áreas de la salud, fueron muy comentadas por su actualidad y alto nivel.</p> <p>La Conferencia de Clausura estuvo a cargo del Dr. D. Ignacio Gómez de Terreros Sánchez y versó sobre estuvo centrada en “La convención sobre los derechos del niño en marcha. Nuestros avances y retos en 20 años de aplicación”.</p> <p>El Dr. D. José del Pozo Machuca, explicó&#160; la trayectoria de estas reuniones y el importante reconocimiento a su calidad científica. Reconocimiento que ha trascendido el ambiente universitario para integrarse en la sociedad y práctica profesional diaria. El Dr. Joaquín Ortiz Tardío, señaló la fundamental importancia que estos Encuentros Multidisciplinares tienen en la formación de todo profesional atento a la salud general del niño.</p> <p>La Dra. Domínguez Reyes, tras señalar que ya se está preparando el próximo Encuentro y que en Madrid en el 2013 tendrá lugar el próximo Congreso Nacional agradeció a la Universidad, a la Agencia de Acreditación y a las Sociedades SEPEAP y SPAOYEX su participación y patrocinio en este VIII Encuentro Multidisciplinar; a todos los ponentes su participación altruista; a las entidades Jonson &amp; Johnson, Ivoclar-Vivadent, Ortolan Dental, Elgydium y a la Fundación Cajasol su colaboración y a todos los asistentes su inquietud por aprender cada día un poco más a cerca del niño y su entorno, tras lo cual el Dr. Gómez de Terreros dio por clausurado el VIII Encuentro Multidisciplinar de la SEOII /SEPEAP/SPAOYEX.&#160;</p> <p><strong>&#160;&#160; </strong></p> <h3>Lugar de celebración</h3> <p><strong><strong>Sede del Congreso<br /> </strong></strong>Centro Cultural CAJASOL<br /> C/ Laraña nº 4 ( Sevilla)</p> <p><strong>&#160;&#160; </strong></p> <h3>Programa del congreso</h3> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/97-viii-sevilla2011/SEOII-VIII-Encuentro-Programa.pdf\">Archivo PDF</a></b></p> <p>&#160;</p> <h3 class=\"slideToggle\">Comité científico</h3> <div class=\"hide\"> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>Antonio F. Galán González</li>   <li>Ignacio Gómez de Terreros Sánchez</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del&#160; Pozo Machuca</li>   <li>Comité Organizador:</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> </div> <h3 class=\"slideToggle\">Comité Organizador:</h3> <div class=\"hide\"> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> </div> <h3 class=\"slideToggle\">Ponentes y participantes</h3> <div class=\"hide\"> <ul>   <li>Dr. D. José Luis Bonal Villanueva (Pediatra extrahospita-lario. Presidente de la SEPEAP)</li>   <li>Dª Ángeles Caballero Trigo (Trabajadora Social. HUS Valme).</li>   <li>Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).</li>   <li>Dª Isabel Escalona Labella (Jefa de Servicio de Promoción de la Salud y Participación Social. Subdirección General&#160; de Promoción de la Salud y Participación Social.&#160; Consejería de Salud. Junta de Andalucía).</li>   <li>D. Antonio Garrido Porras (Asesor Técnico Consejería de Salud).</li>   <li>Dr. D. Juan Gil Arrones (Pediatra. HUS Valme).</li>   <li>Dr. D. Ignacio Gómez de Terreros Sánchez (Profesor Titular de Pediatría. U. de Sevilla. Jefe Servicio de Pediatría Hospital Infantil Universitario Virgen del Rocío)</li>   <li>Dr. D. Mariano Hernán García (Profesor de Promoción de la Salud y Salud Pública en la Escuela Andaluza de Salud Pública. Master en Salud Pública y Gestión Sanitaria).</li>   <li>D. Pedro Jaén Rincón (Psicólogo. Presidente de ADIMA).</li>   <li>Dr. D. Jesús Jiménez Morago (Profesor de Psicología Evolutiva. Universidad de Sevilla).</li>   <li>Dra. Dª Carmen de Manuel Vicente (Psicóloga clínica. USMIJ Puerta del Mar).</li>   <li>Dr. D. Rafael Muriel Fernández (Asesor Técnico del Servicio Socio Sanitario. Secretaria General de Participación Pública. Conserjería de Salud Junta de Andalucía).</li>   <li>Dr. D. Joaquín Ortiz Tardío (Jefe de Servicio de Pediatría del Hospital de Jerez&#160; de la Frontera. Presidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).</li> </ul> </div> <p>&#160;</p> <h3>Galería de fotos del congreso</h3> <p><strong>1º Foto: Mesa Inagural de izquierda a derecha</strong><br /> - Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).<br /> - Dr. D. Joaquín Ortiz Tardío (Jefe de Servicio de Pediatría del Hospital de Jerez&#160; de la Frontera. Presidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).<br /> - Dr. D. Ignacio Gómez de Terreros Sánchez (Profesor Titular de Pediatría. U. de Sevilla. Jefe Servicio de Pediatría Hospital Infantil Universitario Virgen del Rocío)<br /> - Dr. D. José Luis Bonal Villanueva (Pediatra extrahospitalario. Presidente de la SEPEAP)<br /> - Dr. D. José del Pozo Machuca ( Vicepresidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).</p> <p><strong>2º foto: Ponentes Primera Mesa Redonda (de izquierda a derecha)</strong><br /> - Dr. D. Rafael Muriel Fernández (Pediatra.Asesor Técnico. Consejería de Salud).<br /> - Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).<br /> - Dra. Dª Carmen de Manuel Vicente (Psicóloga clínica. USMIJ Puerta del Mar).<br /> - Dr. D. Jesús Jiménez Morago (Profesor Titular de Psicología Evolutiva. Universidad de Sevilla).</p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:36',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(19,487,'murcia-2011-copia-completa-con-conclusiones',1,1,'Murcia 2011 COPIA COMPLETA CON CONCLUSIONES',NULL,NULL,NULL,NULL,NULL,'<p>Los días <strong>17 al 20 de febrero de 2011</strong> se celebró el <strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada.</strong></p> <h2><strong>Acreditación de las Actividades Científicas</strong></h2> <ul>   <li><strong>Hasta 1,5 Créditos de Libre Configuración, Universidad de Murcia.<br />   </strong></li>   <li><strong>Hasta 3 Créditos de Libre Configuración, Universidad de Sevilla.</strong></li> </ul> <p>&#160;</p> <p><img height=\"156\" width=\"643\" alt=\"\" src=\"resources/upload/image/73/banner.jpg\" /></p> <p>En ciencias de la salud, <strong>los conocimientos </strong>no son compartimentos estancos, sino aspectos diferentes que<strong> deben ser integrados.<br /> </strong><strong>El niño es un ser dinámico que está en continuo crecimiento y desarrollo</strong> tanto físico como psíquico y social.<br /> Odontológicamente<strong> ha de ser visto, diagnosticado y tratado como un todo.</strong>&#160;</p> <p><strong>Congreso Multidisciplinar, Interdisciplinar e Interprofesional, </strong>en el cual se abordará al niño y adolescente en crecimiento y desarrollo.</p> <p>A través de ponencias, talleres prácticos y mesas redondas, globalmente se presentarán los últimos avances y conocimientos científicos-técnicos&#160;más actuales dentro de la <strong>Odontología Infantil.</strong></p> <p>Se integran materias como la<strong> Neurofisiología, Ortodoncia, &#160;Ortopedia Funcional, Radiología 3D, Pediatría, &#160;Otorrinolaringología, Logopedia, Fisioterapia, Osteopatía, Psicología,</strong> entre otras disciplinas en Ciencias de la Salud.</p> <p>Compartiremos conceptos e ideas como también distintas perspectivas de protocolos de actuación dentro de la Odontología en el niño.</p> <p>&#160;Para los alumnos de pre-grado de las distintas carreras de las Ciencias de la Salud, las Universidades de Murcia y Sevilla, concedieron hasta 1.5 y 3 créditos de Libre Configuración respectivamente.</p> <p>&#160;</p> <h1>Conclusiones del congreso</h1> <p><img src=\"http://seoii.es/admin/index.php/resources/view/246\" alt=\"\" /></p> <p>El evento estuvo constituido por cuatro Mesas Redondas y cuatro Talleres dedicados a Odonto-Estomatólogos y otros profesionales de las Ciencias de la Salud.</p> <p>Dentro de la Mesa Redonda, <i><b>“Tratamiento del niño en crecimiento y desarrollo. Visión global”</b></i>, (coordinada por la Dra. Domínguez Reyes, Profa Titular de Odontología Infantil y Ortodoncia Integrada en de la U. de Sevilla) la Dra. Marie- Josèphe Deshayes, Médico Estomatólogo y Paleontóloga, expuso dos temas: <i>Crecimiento craneal: vínculos con la dentición primaria; y Tratamientos precoces antes de los seis años de edad.</i></p> <p>Con ambas ponencias pudimos comprender mejor las fuerzas que dentro de la base craneal conducen el desarrollo facial hacia oclusiones específicas; y además, ver cómo, diagnosticando en el recién nacido pequeñas asimetrías faciales, se podía pronosticar y prevenir futuras asimetrías faciales de crecimiento y desórdenes en la ATM.</p> <p>El Dr.Yves Castaing Haerïng, Lcdo. en Fisioterapia y Doctor en Osteopatía por la Universidad de Medicina  de Montreal y Lyón, desarrolló la ponencia <i>“Osteopatía Craneal. Su influencia sobre la Oclusión durante el Crecimiento y Desarrollo en el Niño”.</i> En ella expuso que, la oclusión y, en general, la Odontología infantil, han evolucionado hasta tal punto, que, hoy, la misma, no puede considerarse separada del contexto general del cuerpo.</p> <p>La conferencia <i>“</i><i>Odontología en el niño: Futuro Funcional</i><i>”</i>, del Dr. Michael Gorbonos, Doctor of Dental Medicine DMD Medical University of Southen Africa, Medunsa, Rep. of South Africa y profesor visitante de Ortodoncia en Universidad Autónoma del Estado de Mexico, no solo señaló que la terapia funcional hace posible tra­tar problemas de manera más fácil y racional, sino que destacó la necesidad de crear una plataforma internacional para la do­cumentación, educación y conservación de las técnicas ortopédicas funcionales.</p> <p><b>La Segunda mesa redonda bajo el epígrafe general </b><i><b>de “La alimentación en el niño y sus repercusiones clínicas”, </b></i>estuvo constituida por los Drs. Juán Madrid Conesa; Cristina Cardoso Silva; Leopoldo Becerra Posada y Concepción López Soler.</p> <p>Moderada por la Profa. Elena Barbería (Catedrático de Odontopediatría en la U. Complutense de Madrid) y la Dra. Margarita Varela Morales (Jefe de la Unidad de Ortodoncia en la Fundación Jiménez Díaz de Madrid), los ponentes desarrollaron, respectivamente, “<i>Alimentar bien a nuestros hij@s: una asignatura pendiente”; “Alimentación y Nutrición: importancia de la salud bucal de los niños”;</i><b> </b><i>“Prevención de la caries desde el nacimiento. Generación Caries Cero”; y “Aspectos Psicológicos de la Odontología infantil y adolescente”</i></p> <p>En esta mesa redonda se recogieron los diferentes aspectos de la alimentación actual en los niños, las causas de la mala alimentación actual y las formas de corregir y mejorarla, una magnífica, clara y amena exposición del Dr. Madrid, en la que también mostró como se puede enseñar a comer correctamente a la población infantil mediante juegos. La Dra. Cardoso señaló que los cuidados de la salud oral deben comenzar ya desde el embarazo con educación a las futuras madres y su entorno.</p> <p>El Dr. Becerra (Odontopediatra por la U. de los Ángeles) expuso, por primera vez en España, su más que interesante iniciativa de la Cartilla odontológica para el bebé con objeto de obtener generaciones caries cero; y la Dra. Soler, los distintos aspectos y manifestaciones de la conducta infantil en el gabinete dental, aportando estrategias racionales para el control de la conducta y comprensión psicológica de las distintas situaciones.</p> <p>Moderada por los Drs. Luis A. Bravo (Prof. Titular de Ortodoncia en la U. Murcia) y el Prof. Joaquín de Nova (Titular de Odontopediatría en la U. Complutense de Madrid) tuvo lugar la tercera mesa redonda bajo el título general de “<i><b>Abordaje Odontológico-Clínico en situaciones de compromiso.</b></i></p> <p>Los “<i>Traumatismos en dentición temporal y sus efectos en la dentición definitiva”</i> fueron expuestos por el Dr. García Ballesta de la Universidad de Murcia; la “<i>Revisión de la Oligodoncia no sindrómica” </i>por el Dr. Arturo Sánchez Pérez; “<i>En busca del Equilibrio estético funcional” </i>por el Dr<i>. A</i>ntonio Matos da Fonseca, Cirujano Maxilo-Facial en la U. de Lisboa y<b> </b>el “<i>Presente y futuro de la imagen. Imagen 3D en Odontología”</i> por el Dr. Vicente Hernández Soler.</p> <p>Las cuatro ponencias, de alto nivel científico, constituyeron una total puesta al día de los diversos temas y los diferentes agentes de distinta naturaleza que pueden desviar el curso del crecimiento cráneo-facial en el niño.</p> <p>La cuarta y última Mesa Redonda, <i><b>Relaciones Clínicas Sistema Estomatognático / vías aéreas</b></i><b>”</b> fue desarrollada por la Dra. Yolanda Cerezo del Olmo<b>,</b> Especialista en Pediatría, que disertó sobre las<b> </b><i>“Patologías más frecuentes en el niño que pueden implicar alteraciones del sistema estomatognático”; </i>la Dra. Concepción Maeztu Sardiña, que habló sobre los <i>“Trastornos respiratorios del sueño (SAOS) y su abordaje Neurofisiológico en niños y adolescentes”.</i></p> <p>Con “<i>Ortodoncia y ORL infantil. La importancia de trabajar en equipo”</i>,<i> el Dr.</i><b> </b>Carlos Escobar Sánchez (Otorrinolaringólogo Prof. en la Facultad de Murcia) señaló las íntimas relaciones que puede tener la ortodoncia y las afecciones otorrinolaringológicas y el<i> </i>Prof. Juan Cobo Planas, (Catedrático de Ortodoncia en la Universidad de Oviedo) que disertó sobre “<i>Ortopedia Maxilar y Vías Aéreas Superiores”. En esta </i> ponencia, expuso las relaciones y efectos de las afecciones de las vías aéreas superiores sobre el desarrollo normal y  posibles anomalías del Sistema Estomatognático, destacando que el trabajo multidisciplinar e interprofesional, en muchas ocasiones, era más que necesario.</p> <p>Esta mesa redonda fue moderada por los Drs. Ustrell, Prof. Titular de Ortodoncia. U.de Barcelona,  y el Prof. Oñate, Prof. Titular de Pacientes Especiales en la U. de Murcia.</p> <p>Tras cada mesa redonda se estableció un animado coloquio entre moderadores ponentes y congresistas en los que pudo detectarse, no solo la alta participación de los asistentes, sino el gran interés despertado por los temas del Congreso y sus ponentes.</p> <p><b>Los cuatro Talleres </b>dirigidos a Odonto-Estomatólogos y otros profesionales en ciencias de la salud fueron:</p> <p>“<i><b>Taller de  Relación Oclusión- ATM según la Rehabilitación Neuroclusal”, </b></i>impartido por la Dra.Dª. Mercedes Gálvez Jiménez</p> <p>“<i><b>Taller De Disfunción Del Aparato Masticatorio: Diagnóstico Diferencial Oclusal- Osteopático-Visual”</b></i><b> </b>impartido  por Dra. Amaia Iturburu Aranzabal y  D. Donato Martínez Mateo.</p> <p>“<i><b>Taller De Intervención Logopédica Funcional En Los Desordenes Orales”, </b></i>impartido por la Licenciada Sonia Muñoz Rico</p> <p>“<i><b>Taller De Salud Oral En El Paciente En Crecimiento”, </b></i>impartido por<i><b> </b></i>la Dra<i><b>.</b></i></p> <p>Ivanna Camps Pereperez.</p> <p>Estos talleres a los que asistieron diferentes profesionales de las Ciencias de la Salud (odontólogos, fisioterapeutas, pediatras etc,) pusieron al alcance de todos los participantes formas prácticas, distintas maniobras y técnicas que permitían abordar al paciente infantil como un todo, de forma integral y en equipo multidisciplinar.</p> <p>En el Acto de Clausura, tras unas palabras de la Presidenta de la SEOII, se comunicó que la Sede del VIII Congreso Nacional sería Madrid y su organización correspondería a la Dra. Rosa Mourelles, Profesora de la Facultad de Odontología de la U. Complutense de Madrid.</p> <p>Así mismo comunicó el Hermanamiento de nuestra Sociedad con la International Functional Assosiation (IFUNA).</p> <p>La SEOII y el Comité Organizador del Congreso agradecieron a ponentes y congresistas su asistencia y activa participación; a las Instituciones su eficaz apoyo, a los Patrocinadores  Johnson-Johnson e Imper-Ortho, su inestimable colaboración en la realización de este importante evento científico y a los colaboradores, Kin, Ripano, Osteoplac, Maxillaris y Gaceta Dental  su contribución.</p> <p>&#160;</p> <h1>Carta de bienvenida</h1> <p>Queridos y estimados compañeros:</p> <p>En nombre del Comité Organizador quisiera invitaros al <strong>\"2º Congreso Internacional y 7º Nacional de la Sociedad Española de Odontología Infantil Integrada\"</strong> que se celebrará en<strong>&#160; Murcia del 17 al 20 de Febrero&#160; de&#160; 2011.</strong>&#160; Nuestro&#160; Congreso&#160; versará&#160; sobre&#160; las<strong>&#160; técnicas&#160; más&#160; actuales&#160; e&#160; innovadoras&#160; en&#160; el diagnóstico y tratamiento del niño en crecimiento y desarrollo. </strong>Compartiremos tanto conceptos e ideas como distintas perspectivas de protocolos de actuación dentro de laOdontología del niño.</p> <p>Siendo la <strong>SEOII la primera Sociedad Española e Internacional creada con carácter multidisciplinar e interprofesional,</strong> y aprovechando esta inigualable ocasión, hemos realizado un importante esfuerzo para&#160; ofrecer&#160; a&#160; todos&#160; lo&#160; mejor&#160; y&#160; más&#160; actual&#160; de&#160; la&#160; Odontología&#160; Infantil:&#160; Neurofisiología,&#160; Ortopedia Funcional, Pediatría, Logopedia, Otorrinolaringología, Psicología y Fisioterapia, que comparten nuestro concepto de ver al niño de manera global e integrada.</p> <p><strong>Un&#160;&#160; Congreso&#160;&#160;&#160; para&#160; aprender&#160;&#160;&#160; con&#160; ponencias&#160;&#160;&#160; y&#160; comunicaciones&#160;</strong>&#160;&#160;&#160; que&#160;&#160; reflejan las&#160; inquietudes&#160;&#160; y necesidades de nuestro tiempo<strong>, con talleres prácticos</strong>&#160; que ponen a disposición aprendizajes de alta calidad, y gran actualidad en la integración con otras disciplinas como demanda nuestra sociedad.</p> <p><strong>Os&#160; invito&#160; muy&#160;&#160; cordialmente,&#160;&#160;&#160; con&#160; la seguridad&#160;&#160; de&#160; que&#160;&#160; en&#160; Murcia&#160; os&#160; sentiréis&#160; acogidos por&#160; la&#160; hospitalidad de su gente</strong> y os sorprenderéis por la variedad y riqueza de sus expresiones artísticas,&#160; naturales y gastronómicas, de modo que podremos conjugar ocio y ciencia para conseguir juntos que esteCongreso de laSEOII sea inolvidable para todos nosotros.</p> <p>Un afectuoso saludo</p> <p><strong>María Eugenia Cabaña Muñoz</strong><br /> Presidenta del Comité Organizador</p> <p>&#160;</p> <h1>Lugar de celebración</h1> <p><img height=\"110\" width=\"266\" class=\"right bordered\" alt=\"Hotel Nelva Murcia\" src=\"resources/upload/image/73/hotel-nelva-murcia.jpg\" /></p> <p><strong><strong>Sede del Congreso<br /> </strong></strong>Hotel Nelva<br /> Av. Primero de Mayo, 9&#160;<br /> 30006 Murcia<br /> Tlf.: 968 06 02 00<br /> <a href=\"http://www.hotelmurcianelva.com\"> www.hotelmurcianelva.com</a></p> <p>&#160;</p> <h1>Formulario de inscripción y alojamiento&#160;</h1> <p><strong>Secretaría Técnica - VIAJES EL CORTE INGLES</strong><br /> Departamento &#160;de Congresos<br /> C/ Catedrático Eugenio Úbeda Romero, 6 • 30008 Murcia • Spain<br /> Teléfono +34 968-272390 • FAX +34 968-249721<br /> e-Mail: congresosmurcia@viajeseci.es</p> <p>Descarga el formulario de inscripción y alojamiento: <a href=\"http://seoii.es/resources/upload/link/73/SEOII-Formulario-de-Inscripcion.pdf\"><strong>Archivo PDF</strong></a></p> <p>&#160;</p> <h1>Programa del congreso</h1> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/73/SEOII-programa-congreso-Murcia2011.pdf\">Archivo PDF</a><br /> </b></p> <p>Descargar el cartel:<strong>&#160;<a rel=\"XprettyPhoto\" target=\"_blank\" href=\"resources/upload/image/73/cartel-web.jpg\">Archivo JPG<br /> </a></strong></p> <p>&#160;&#160;</p> <h1>Envío de comunicaciones</h1> <p>Las personas que deseen enviar sus comunicaciones al congreso pueden hacerlo a través de dirección de correo electrónico <strong><a href=\"mailto:comunicaciones@seoii.es?subject=Comunicaciones\">comunicaciones@seoii.es</a></strong></p> <p>Se ha prorrogado la entrega de <strong>comunicaciones hasta el día 15 de enero</strong><strong> de 2011</strong></p> <p>Descargar las instrucciones para la preparación y envío de comunicaciones orales:<strong>&#160;<a href=\"http://seoii.es/resources/upload/link/73/SEOII-Normas-de-comunicaciones.pdf\">Archivo PDF</a></strong></p> <p>&#160;</p> <h1>Ponentes del Congreso</h1> <h4><strong>Dra. MERCEDES GÁLVEZ JIMÉNEZ</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Odontólogo y Doctora en Medicina y Cirugía por la Universidad de Granada. Profesora Colaboradora de Prácticas Clínicas en Odontología Infantil Integrada de la Facultad de Odontología de Sevilla. Profesora del Máster de Odontología Infantil Integrada de la Facultad de Odontología de la Universidad de Sevilla, donde imparte enseñanza de Rehabilitación Neuroclusal (RNO) y Ortopedia Funcional de los Maxilares. Formada en esta disciplina bajo la dirección de los Drs. Pedro Planas en Barcelona y Wilma Simoes en Brasil. Coautora en capítulos de libros, es dictante de varios cursos en Hispanoamérica sobre RNO y en Foros españoles de Fisioterapeutas y Foniatras.</p> <hr /> <h4>Dra. ANTONIA DOMÍNGUEZ REYES</h4> <p><strong>Currículum:</strong> Doctor en&#160; Medicina y Cirugía por la Universidad de Sevilla. Especialista en Estomatología. Médico Puericultor. Profesor Titular de&#160; Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de Sevilla. Diploma Universitario en Ortodoncia y Ortopedia Dentofacial por la Universidad Paul Sabatier, Toulouse III (Francia). Directora del Máster Universitario en Odontología Infantil Integrada. Directora del Titulo de Experto Universitario en Tratamiento Global, Secuencial Avanzado en Odontología Infantil. Investigadora responsable en diversos Proyectos de Investigación financiados por la Junta de Andalucía y la Universidad de Sevilla. Profesora Invitada y Realización de Actividades Docentes e Investigadora en la Universidad do Vale do Itajaí de Brasil. Autora de numerosas publicaciones en revistas nacionales e internacionales. Dictante de varios cursos sobre Odontología en el niño y adolescente. Directora de varias Tesis Doctorales, DEA y Tesinas. Autora de diversos capítulos de libros sobre Odontología Infantil Integrada. Fundadora y actual Presidenta de la Sociedad Española de Odontología Infantil Integrada (SEOII). Miembro del Comité Cientifico del Journal of the American Dental Association (JADA) edición española. Miembro del Consejo Asesor de la Revista Claves de Odontología. Dependiente del Círculo Odontológico de Córdoba (Argentina). Revisora de las Revistas Journal of&#160; Contemporary Dental Practice e International Journal of Paediatric Dentistry.</p> <hr /> <h4><strong>Dra. AMAIA ITURBURU ARANZABAL</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum:</strong> Licenciada en Medicina y Cirugía por la UPV en 1981. Diplôme Dòsteopathe (Collegiale Academique de France) 2002. Coordinadora de“Osteopatía Cráneo Sacra” en la Escuela Universitaria de Osteopatía de Murcia. Profesora de Osteopatía Craneal del “Máster Oficial en Osteopatía” de la Universidad Pública de Murcia.<br /> Secretaria de la Fundación Española de Osteopatía (2007).&#160;&#160; Profesora del Master “Experto en terapia Orofacial y Miofuncional”. “Trastornos en la articulación Cráneo Mandibular” en la Universidad Pontificia de Salamanca (Curso 2008-2009; 2009-2010).<br /> Miembro del&#160; SEDCYDO (Sociedad Española de Disfunción Cráneo-mandibular y dolor Orofacial)). Miembro del “European Council of Osteopathic&#160; Education”</p> <hr /> <h4>Sr.&#160;DONATO&#160;MARTÍNEZ MATEO<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Licenciado en Educación Física. INEF Madrid (Universidad Politécnica de Madrid) Cursos 1986/87 al curso 1990/91.<br /> Funcionario de Carrera del Cuerpo Profesores de Enseñanza Secundaria.<br /> Diploma de Osteópata, por la Escuela Europea de Osteopatía (Murcia). 5500 horas lectivas. Murcia. 2002/2008.<br /> Diplôme de Fin de Deuxième Cycle d’Etudes Ostéopathiques, por la Ecole Superieure d’Osteopathie de París, 2008, tras la defensa de su mémoire “Influencia inmediata y a las 48 horas de la técnica rodamiento alternativo de temporales con amplitud descendente sobre parámetros cardiovasculares” en París.<br /> Docente en el Máster Oficial de Osteopatía (Universidad de Murcia) <br /> Actualmente realiza la tesis doctoral en el Dpto de Anatomía Humana y Psicobiología de la Universidad de Murcia, con el título: Influencia de la técnica osteopática “rodamiento alternativo de temporales” sobre la presión arterial y frecuencia cardiaca. Cuantificación del estímulo y elección del protocolo más eficaz.</p> <hr /> <h4><strong>Dra. MARIE-JOSÈPHE DESHAYES</strong></h4> <p><strong>Currículum: </strong>Médica Antropóloga. Miembro de la Sociedad Francesa de Ortopedia Dento-Facial. Miembro del Club Internacional de Morfología Facial. Miembro fundador del Club Telecrane Internacional. Miembro de la Sociedad Antropológica de París. Autora de numerosos cursos, artículos y conferencias. Autora de libros como “Repérages Crâniens” “L\'art de traiter avant 6 ans”&#160;y “Craniofacial Morphogénesis”.</p> <hr /> <h4>Dr. YVES CASTAING HAERÏNG<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Licenciado en Podología en Paris (1978). Graduado en Kinesioterapia y Rehabilitación Funcional en la Facultad de Medicina de Burdeos (Francia). Doctor en Osteopatía por la Universidad de Medicina&#160; de Montreal (1984) y la Facultad de Medicina de Lyón (Francia, 1986). Sus investigaciones y trabajos en ese ámbito, le han conducido a una verdadera especialización en Osteopatía Craneal Infantil. Posee el Diploma Universitario en Fukuoka (Japón) y el de Acupuntor por la Facultad de Medicina de Burdeos. Actualmente, además de ser miembro del Colegio de Osteópatas de Francia y España, trabaja en colaboración con centros de maternidad franceses (Perpignan, Bordeaux, Toulouse) y españoles (Madrid y Barcelona). Autor de diversos artículos en Francia, también es autor del Libro, en español, “Osteopatía Craneal usted y su bebe”. En la actualidad transmite el resultado de sus investigaciones y experiencias sobre la osteopatía a través de conferencias y seminarios internacionales.</p> <hr /> <h4>Dr. DAVID SUÁREZ QUINTANILLA<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina por la Universidad de Santiago de Compostela. Especialista en Estomatología (Universidad de Oviedo). Máster Europeo en Ortodoncia y Ortopedia Dentofacial (Universidad de Valencia). Catedrático de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Councillor&#160; y&#160; Elect President 2012 de la European Orthodontic Society <br /> Diplomado de la Sociedad Española de Ortodoncia. Miembro de la International Academy of Dentistry , SEDO, AESOR, WFO , AIO, AAO y otras sociedades científicas. Miembro fundador del European&#160; Orthodontic Teacher´s Forum&#160; (EOTF) y de la Sociedade Galega de Ortodoncia (SGO). Académico Corresponsal desde 1996 de la Real Academia de Medicina y Cirugía de Galicia. Premio de la Real Academia de Medicina y Cirugía de España. Responsable de varios proyectos de investigación financiados. Director de numerosas Tesis Doctorales y artículos publicados en revistas nacionales 