ina.<br /> Licenciada en Odontología por la Universidad de Granada, España.<br /> Diploma Universitario de Ortodoncia y Ortopedia Dentofacial.<br /> Université Paul Sabatier. Faculté de Chirurgie Dentaire. Toulouse III. Francia.<br /> Proyecto de investigación sobre Microimplantes en Ortodoncia en la Universidad de Murcia.<br /> Ponente en Cursos y Conferencias Nacionales e Internacionales sobre Microimplantes y Ortodoncia.<br /> Profesora Colaboradora del Master de Ortodoncia y Ortopedia Dento-Facial de la Universidad de Murcia.<br /> Presidenta del 1º Congreso Europeo de Microimplantes, Murcia, España.<br /> Miembro de SEDO, SEDCYDO, SEOII, AESOR, AAO, EOS, WFO.</p> <hr /> <h4>Dra. CATALINA CANALDA ALFARA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Barcelona (1972). Médico Estomatólogo. Ortodoncista con práctica en niños y adultos de los trastornos de la Oclusión y Disfunción Cráneo Mandibular (D.C.M.). Colabora con el Profesor Pedro Planas desde 1979. Desde 1984 hasta 1994 ejercicio en asociación con el Profesor Pedro Planas. Desde 1994 ejerce en asociación y comparte la dirección de Dentoclinic&#160; con el Dr. Carlos de Salvador Planas. Miembro del&#160; C.I.R.N.O (Club Internacional de Rehabilitación Neuro Oclusal).Miembro de la Asociación Española Pedro Planas de R.N.O. (A.E.P.P.) Miembro de la S.F.O.D.F.(Sociedad de Ortopedia Dento Facial Francesa). Miembro fundador del C.E.R.N.O. (Club de Enseñanza de Rehabilitación Neuro Oclusal). Miembro de Honor de la Sociedad de Ortopedia Funcional de los Maxilares de Venezuela. Conferenciante invitada en varios países de Europa y América donde además ha impartido e imparte Cursos de divulgación y talleres de R.N.O. primero con el Dr. Pedro Planas y más tarde con el Dr. Carlos de Salvador Planas, (1987-2010).&#160;</p> <hr /> <h4>Dra. IVANNA CAMPS PEREPEREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía (1989) y Odontología (1992) por la Universidad de Valencia. Ortodoncista (Valencia1994). Profesora del Máster de Ortodoncia Facultad de Medicina y Odontología de la Universidad de Valencia (2005-2009). Profesora del Máster de Ortodoncia CEU Universidad Cardenal Herrera (Valencia) desde 2009.</p> <hr /> <h4>Dr. JUAN MADRID CONESA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en medicina y Cirugía. Especialista en Endocrinología y Nutrición. Endocrinólogo y Nutricionista en el Hospital Universitario Virgen de la Arrixaca desde hace más de 25 años, es autor de diversas comunicaciones y publicaciones científicas en Congresos y Revistas nacionales e internacionales. Autor de numerosos libros sobre la diabetes, el sobrepeso, la obesidad&#160; y otros problemas endocrinológicos y nutricionales en niños y adultos. Colaborador habitual en numerosas publicaciones y actividades de la Consejería de Sanidad de la Comunidad de Murcia. Asiduo participante en actividades sanitarias de divulgación en diversos medios de&#160; comunicación.</p> <hr /> <h4>Dra. CRISTINA CARDOSO SILVA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina Dentaria por el “Instituto Superior de Ciencias da Saúde – Norte” de Portugal. Máster en Odontopediatría (Facultad de Odontología. Universidad Complutense de Madrid). Máster en Ciencias Odontológicas de la Facultad de Odontología (Universidad Complutense de Madrid). Doctor en&#160; Odontología por la Facultad de Odontología de la Universidad Complutense de Madrid. Asistente invitada de Odontopediatria en la “Faculdade de Medicina Dentária” de la Universidade do Porto (Portugal). Miembro del equipo investigador del “Programa de Atención Odontológica Integral a pacientes en edad infantil” (Facultad de Odontología, Universidad Complutense de Madrid). Autora y coautora de diversas publicaciones en revistas nacionales e internacionales. Premio Revista “Dental Practice” al mejor artículo en español y Premio Revista “JADA – Edición Española” al mejor artículo en español (2007 /2008). Miembro de la “International Association of Paediatric Dentistry”e “International Association of Dental Traumatology”.</p> <hr /> <h4>Dr. LEOPOLDO BECERRA POSADA</h4> <p><strong>Currículum: </strong>Cirujano Dentista.&#160; Universidad Tecnológica de México, UNITEC. Certificado en Odontopediatría, Universidad de Los Ángeles, California. UCLA. Certificado en Niños con Retraso Mental y Discapacitados. Universidad de Los Ángeles, California. UCLA – Neuro Psychiatric Institute. Master en Ortodoncia. Universidad Intercontinental. UIC. México, D.F. Diplomado en Gestión, Dirección, Mercadotecnia y Administración Hospitalaria. Universidad La Salle – Hospital Médica Sur. México, D.F. Diplomado en Técnica Roth Williams. Universidad Nacional Autónoma de México. UNAM. Diplomado en Ortodoncia y Cirugía Ortognática. Universidad Nacional Autónoma de México. UNAM.</p> <hr /> <h4>Dra. CONCEPCIÓN LÓPEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Dra. en Psicología (1986). Responsable de la Consulta de Psicología Clínica en el Hospital Virgen de la Arrixaca desde 1988. Profesora Vinculada Clínica, en el Hospital U. V. Arrixaca desde julio 2006. Responsable de la Unidad Asistencial de Psicología Clínica en Hospital Morales Meseguer (1993- 1996). Profesora Asociada a tiempo completo de Psicología Medica en la Facultad de Medicina de la Universidad de Murcia (1982- 1986). Profesora Titular de Personalidad Evaluación y Tratamientos Psicológicos en la Facultad de Psicología. Especialista en Psicología Clínica (1998). Directora del Centro de Orientación y Estudios Psicológicos (COEP) de la Universidad de Murcia (1990- 1994). Directora del Curso Psicología Clínica I Escuela de Práctica Psicológica. Miembro de la Comisión Nacional de Psicología Clínica (Ministerio de Sanidad 1999- 2006). Presidenta de la Asociación para el Desarrollo de la Salud Mental en Infancia y juventud “Quiero Crecer” (desde 2008). Investigadora titular y participante en diversos proyectos, es autora de diversas publicaciones en Revistas Internacionales y coautora en varios libros sobre psicología infantil.</p> <hr /> <h4>Dra. ELENA BARBERIA LEACHE<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Universidad de Navarra. Doctor en Medicina y Cirugía UCM. Médico Estomatólogo UCM y Doctor en Odontología UCM. Especialización en Odontopediatría. Especialización en Ortodoncia UCM. Profesor en la U.C.M.<br /> Catedrático de Universidad desde 1989. Departamento de Profilaxis, Odontopediatría y Ortodoncia. <br /> Directora del Curso de Especialización en Odontopediatría: 1979-88.<br /> Directora del Máster de Odontopediatría: 1988- actualidad.<br /> Participación como investigadora Principal o Investigadora en 24 proyectos financiados. En la actualidad, actividad clínica en el “Programa de Atención Odontológica a Pacientes en Edad Infantil” de la Universidad Complutense de Madrid. Directora de más de veinte Tesis Doctorales, Tesinas y&#160; trabajos para Diploma de Estudios Avanzados. Con más de 150 publicaciones en revistas nacionales e internacionales, además, es autora de varios libros y atlas sobre Odontopediatría para Odonto-Estomatólogos y Pediatras. Socio de Honor de la Asociación Española De Pediatría. Director Asociado del Journal of the American Dental Association (JADA), edición española. Editor Asociado para España del European Journal of Pediatric Dentistry. Marzo 2006. Revisora científica del European Journal of Pediatric Dentistry. Enero 2006. Revisor científico del European Journal of Dentistry. Enero 2008. Dictante, de numerosos cursos, conferencias y comunicaciones Nacionales y Extranjeras.</p> <hr /> <h4>Dra. MARGARITA VARELA MORALES<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Médico, especialista en Medicina Interna, Estomatología y Ortodoncia.<br /> Jefe de la Unidad de Ortodoncia y Directora del Programa de Postgrado de Ortodoncia de la Fundación Jiménez Díaz. Autora de&#160; libros y capítulos de libros&#160; sobre problemas bucodentales en Pediatría, Ortodoncia interdisciplinar y otros textos pediátricos.<br /> Profesora Honoraria del Dpto. de Pediatría de la Facultad de Medicina de la Universidad Autónoma de Madrid. Numerosas&#160; publicaciones en revistas nacionales e internacionales y Dictante y Organizadora de Conferencias y Cursos de formación dirigidos a ortodoncistas y a pediatras.</p> <hr /> <h4>Dr. CARLOS GARCÍA BALLESTA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Profesor Titular de Odontopediatría en la Facultad Odontología de la Universidad de Murcia. Académico de Número de la Real Academia de Medicina y Cirugía de Murcia. Ex-Presidente de la Sociedad Española de Odontopediatría. Premio de la Sociedad Española de Odontopediatría (once ocasiones), Sociedad Española de Periodoncia, Sociedad Española de Odontología Preventiva y Comunitaria (siete ocasiones), Sociedad Española de Estomatología, Real Academia de Medicina y Cirugía de Murcia (tres concursos de premios) y Real&#160; Academia Nacional de Medicina (Premio Prof. Juan Pedro Moreno). Con 130 trabajos publicados, 183 comunicaciones en congresos nacionales e internacionales, es autor o coautor de once libros sobre Odontopediatría. En el campo de la investigación, es Director&#160; de varios proyectos sobre traumatología dental financiados por el Fondo de&#160; Investigación&#160; Sanitaria - Unión Europea&#160; (FIS- FEDER), siendo, además, Evaluador Internacional de Universidades.</p> <hr /> <h4>Dr. ARTURO SÁNCHEZ PÉREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina y Cirugía por la Universidad de Murcia.<br /> Medico Diplomado en Medicina del Trabajo (Murcia 1985).<br /> Medico especialista en Medicina deportiva (Murcia 1986).<br /> Medico especialista en Estomatología por la Universidad de Murcia (1988). Master en implantología y periodoncia por la Universidad de París VII 1992. Profesor encargado de Periodoncia desde 1993.<br /> Profesor Asociado a tiempo completo desde 2005.<br /> Vocal por la Región de Murcia del Centro de Estudios de la III Región.<br /> Presidente del Grupo de Estudios Murciano Odontoestomatológicos.<br /> Vicedecano de Odontología desde 2006.<br /> Autor o colaborador de 10 Libros de la especialidad.<br /> Autor de 44 publicaciones de la especialidad en revistas Nacionales e Internacionales. Dictante de&#160; 112 comunicaciones a Congresos. Dictante de 61 cursos. Director de 4 tesis doctorales todas con premio otorgado.</p> <hr /> <h4>Dr. ANTONIO MATOS DA FONSECA<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Médico egresado de la&#160; Facultad de Medicina de Lisboa (1977). <br /> Especialista en Cirugía Maxilofacial. Hospital de S. José. Lisboa.<br /> Director de la “Clínica da Face”. Lisboa. Fellow of the European Board of Maxillofacial Surgery. Consultor del Hospital Pediátrico de D. Estefanía. Lisboa. (1998-2002). Consultor del Hospital Fernando da Fonseca. Amadora – Sintra. Miembro de la Sociedad de las Ciencias Médicas de Lisboa. Miembro de la Sociedad Portuguesa de Cirugía Cráneo-Maxilo-Facial. Miembro de la Sociedad Española de Cirugía Oral y Maxilofacial. Miembro de la Sociedad Portuguesa de Cirugía Plástica Reconstructiva y Estética. Miembro de la “International Association of Oral and Maxillofacial Surgeons”. Miembro de la Federación Ibero-Latino-Americana de Cirugía Plástica. Fellow of the International College of Surgeons. Profesor Titular de Terapéutica Especial del “Instituto Superior de Ciências da Saúde”.&#160; Portugal. (2003-2007). Profesor Honorario de la&#160; Universidad Alfonso X El Sabio - Madrid. Profesor del Posgrado de Cirugía Oral de la Universidad Lusófona - Lisboa. Profesor del Posgrado de Cirugía del CETAO – São Paulo – Brasil. Su actividad se desenvuelve en el campo de las dismorfologías cráneo-faciales. Co-autor del libro “Ortodoncia y Cirugía Ortognática” Diagnóstico y Planificación. Editado en Español, Portugués, Italiano e Inglés.</p> <hr /> <h4>Dr. VICENTE HERNÁNDEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina. Estomatólogo. <br /> Certificate in Orthodontics and Master in Medical Sciences (Harvard U, Boston, USA). Miembro diplomado de la SEDO.<br /> Diplomate of the American and European Board of Orthodontics. <br /> Active member of the Edward Angle Society. Profesor asociado de la Universidad de Valencia.</p> <hr /> <h4>Dr. LUIS&#160; ALBERTO BRAVO GONZÁLEZ<strong><br /> </strong></h4> <p><strong>Currículum:&#160; </strong>Doctor en Medicina y Cirugía. Especialista en Estomatología. Profesor Titular de Ortodoncia de la Universidad de Murcia. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Murcia.<br /> Miembro Diplomado de la SEDO. Miembro Diplomado del European Board of Orthodontists. Miembro Activo de la Sociedad Europea de Angle</p> <hr /> <h4>Dr. JOAQUÍN DE NOVA GARCÍA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Prof. Titular de Odontopediatría de la Universidad Complutense de Madrid (UCM).<br /> Director del Título Propio (UCM): Especialista en Atención Odontológica Integrada en el niño con necesidades especiales.<br /> Vocal de la SEOII.</p> <hr /> <h4>Dra. YOLANDA CEREZO DEL OLMO<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Murcia. Especialista en pediatría. Formación en el H. San Juan. Con diversas comunicaciones en Congresos de Pediatría, ejerce la especialidad en el Servicio de Salud de la Comunidad de Murcia.</p> <hr /> <h4>Dra. CONCEPCIÓN MAEZTU SARDIÑA</h4> <p><strong>Currículum:</strong> Licenciada en Medicina Y Cirugía. Facultad de Medicina de la Universidad de Navarra 1975-1981. Especialista en Neurofisiología Clínica vía MIR. C. S. Virgen de la Arrixaca de Murcia, 1982-1986.<br /> Doctora en Medicina Y Cirugía por la Universidad de Murcia.<br /> Master en Medicina Humanitaria (Universidad Miguel Hernández).&#160; Facultativo Especialista en Neurofisiología Clínica (NFLC) del Servicio Murciano de Salud. Médico Jefe de Sección de NFLC, del Servicio Murciano de Salud. Diferentes Comunicaciones y Ponencias en Mesas Redondas en Congresos y Reuniones Científicas. Coordinadora y Participante como docente en diversos cursos. Miembro de diferentes Comisiones del Hospital General Universitario de Murcia. Premio de la Comisión Central de Garantía de Calidad del Hospital Morales meseguer a la Comisión de Historias Clínicas y Documentación y a la Calidad Asistencial 2001. Evaluadora de Actividades Formativas Médicas Especializadas. Evaluadora externa de actividades formativas de SEAFORMEC (Sistema Español de Acreditación de la Formación Médica Especializada) por designación del Colegio Oficial de Médicos de la Región de Murcia, desde 2004.<br /> Evaluadora externa de actividades de formación médica especializada del Servicio Murciano de Salud.</p> <hr /> <h4>Dr. CARLOS ESCOBAR SÁNCHEZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado y Doctor en Medicina y Cirugía por la Universidad de Murcia. Especialista en Otorrinolaringología. Diploma Universitario en Perturbaciones de la Audición y del Lenguaje (Logopedia) y Apto en requerimientos médicos-científicos en el Foreing Medical Graduate Examination Of The United States Of America. Facultativo Especialista de Área del Servicio de Otorrinolaringología del Hospital Universitario \"Morales Meseguer\" de Murcia, ha realizado numerosas estancias en el Extranjero, artículos en revistas científicas nacionales e internacionales y capítulos de libros. Editor de libros como “Orl sin recurrir a pruebas complementarias”, “Hipoacusias Infantiles”, “Sinusitis Crónica Y Poliposis” y “Rinología Básica”. Miembro de la Sociedad de Otorrinolaringología y Patología Cérvico- Facial de la Región de Murcia con el cargo de Secretario General entre 1996-2004.&#160; Sociedad Española de Otorrinolaringología y Patología Cervico- Facial. Cargo de Vocal de la Comisión de protocolos y Estándar durante un mandato. Socio Fundador y Tesorero Español de la Asociación Hispano-Alemana de ORL y Cirugía Cérvico-Facial desde 1998 hasta la fecha. Socio Fundador y Presidente de la Asociación de Médicos ORL DEB.</p> <hr /> <h4>Dr. JUAN COBO PLANAS<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Facultad de Medicina de la Universidad de Zaragoza. Especialista en Estomatología por la Escuela de Estomatología de la Universidad de Oviedo. Doctor en Medicina y Cirugía (Universidad de Oviedo). Diplomado en Periodoncia Social (University of Illinois). Especialista Universitario en Ortodoncia. Especialista Universitario en Valoración del Daño Buco Dental. Master Universitario en Metodología y Técnicas de Investigación Oral Master Universitario en Metodología y Técnicas de Investigación en Ciencias de la Salud. Catedrático de Ortodoncia de la Facultad de Odontología de la Universidad de Oviedo. Miembro de la American Association of Orthodontists. Director del Programa Máster de Ortodoncia y Ortopedia Dento-Facial.<br /> Director del Programa de Especialistas Universitarios en Ortodoncia, Universidad de Oviedo. Instructor acreditado para la enseñanza de la técnica de Arco Recto,Lawrence F. Andrews Foundation. San Diego (E.E.U.U.). Director de la Escuela de Estomatología, Universidad de Oviedo.&#160; Profesor Colaborador del Programa de Especialización en Ortodoncia de la Facultad de Medicina y Odontología de la Universidad de Valencia. Coordinador del Proyecto E 5017.&#160; Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996) Coordinador del Proyecto D 5004. Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996). Director del Máster de Ortodoncia y Ortopedia Dento Facial. Universidad de Oviedo. (2002-2005). Director del Título de Especialista Universitario en Ortodoncia. (Actualidad). Director del Máster Oficial de Ortodoncia y Ortopedia Dentofacial. Director y autor de numerosas Tesis Doctorales, comunicaciones y ponencias.</p> <hr /> <h4>Dr. RICARDO E. OÑATE SÁNCHEZ</h4> <p><strong>Currículum: </strong>Especialista en Estomatología.<br /> Licenciado en Medicina y Cirugía.<br /> Profesor Titular de la Universidad de Murcia.<br /> Responsable de la Unidad Docente de Pacientes Especiales en la Licenciatura de Odontología.<br /> Secretario del Departamento de Dermatología, Estomatología,<br /> Radiología y Medicina Física de la Facultad de Medicina y Odontología de la Universidad de Murcia.</p> <hr /> <h4>Dr. JOSÉ Mª USTRELL<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado, Doctor en Medicina y Cirugía y especialista en Estomatología, por la Universidad de Barcelona (UB). Profesor Titular de Ortodoncia en la Facultad de Odontología de la Universidad de Barcelona. Coordinador del \"Mestrado na especialidade de Ortodontia\" en el Instituto Superior de Ciências da Saúde-Norte de Gandra y Miembro del Comité Técnico del \"Mestrado de Ortodontia e Cirurgia Ortognática\" en la Universidade de Porto (Portugal) (2005). Miembro correspondiente de la Reial Acadèmia de Medicina de Catalunya (RAMC). Vocal de la Acadèmia de Ciències Mèdiques de Catalunya i Balears. Presidente de la Comisión de Salud Bucodental de la Generalitat de Catalunya. Tesorero del Groupement International pour la Recherche Scientifique en Stomatologie et Odontologie. Miembro fundador y vicepresidente de la Sociedad Española de Odontologia Infantil Integrada. Autor de varios libros sobre Ortodoncia e historia de la Odontología. Director de numerosas y autor de publicaciones es dictante de varios Cursos y responsable de varias líneas de investigación. Ostenta el premio Lauréat du prix (1995), Mention spécial (1997) del GIRSO y legado Prof. Lluís Sayé (1999) de la RAMC.</p> <p>&#160;</p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:38',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(20,488,'ix-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria',1,1,'Sevilla 2012: IX Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria',NULL,NULL,NULL,NULL,NULL,'<p><a href=\"http://seoii.es/resources/upload/link/57-vii-encuentro/Cartel-IX-Encuentro.pdf\" title=\"Descargar cartel PDF\"><img width=\"200\" height=\"283\" src=\"http://seoii.es/resources/304\" class=\"right bordered\" alt=\"\" /></a>El día <strong>6 de octubre de 2012</strong> se celebró el <strong>IX Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria, </strong>que se desarrolla en el contexto del<strong> XXVI Congreso Nacional de la SEPEAP y el III Congreso Internacional Hispano - Luso de Pediatría Extrahospitalaria.<br /> </strong></p> <p>&#160;</p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos 0,95 Créditos de Formación Continuada y de Libre Configuración.</strong></li>   <li><strong>Se entregará certificado de asistencia con créditos.</strong></li> </ul> <h3>Conclusiones</h3> <p>El pasado 6 de octubre en las nuevas instalaciones del Palacio de Exposiciones y Congresos de Sevilla (FIBES) tuvo lugar el IX Encuentro&#160; Multidisciplinar de Odontología Infantil Integrada (SEOII) Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). En esta ocasión el encuentro tuvo como tema monográfico “Caries de la niñez temprana: Abordaje y perspectiva multidisciplinar”&#160; y se desarrolló dentro del XXVI Congreso Nacional de la SEPEAP y III Congreso Internacional Hispano Luso de Pediatría Extra-Hospitalaria.</p> <p>Como en anteriores eventos, este Encuentro tuvo el reconocimiento de la Agencia Nacional de Acreditación con 0,95 créditos de Formación Continuada y de la Universidad Hispalense de Sevilla con 1 crédito de Libre Configuración para los alumnos de pregrado.</p> <p>Con una amplia asistencia de 152 profesionales, comunicaciones y numerosos alumnos, la mesa inaugural estuvo presidida por el Dr. D. José Luís Bonal (Presidente de la SEPEAP), el Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca (Vicepresidente de la SAOYEX), el Dr Cristobal Coronel (Pediatra y Presidente del XXVI Congreso de la SEPEAP) y la Dra. Dª Antonia Domínguez Reyes, (Presidenta de la SEOII Ampliamente desarrollado por diferentes profesionales de las Ciencias de la Salud, odontólogos, estomatólogos, psicólogos y pediatras, todos coincidieron en señalar que el hecho de que hoy, en nuestro medio, sigan viéndose niños con caries en más de dos o tres superficies en dientes temporales recién erupcionados, es clara indicación de la importante y alarmante actualidad de este tema. Alarmante actualidad sobre todo si tenemos en cuenta que pese a los avances y promociones en pos de la educación sanitaria, la caries en la niñez temprana sigue mostrando una alta frecuencia.</p> <p>Fueron ponentes en la Mesa Redonda las Dras. Isabel Colomer&#160; Ureña, Montserrat Gómez de Terreros Guardiola, Rosario Gómez Cuadrado y Patricia Gatón quienes, ante este panorama, analizaron&#160; la situación, los&#160; factores contribuyentes a la misma, la genética, los estilos de vida, dieta y hábitos, algo para lo que es indispensable aplicar metodologías y protocolos de actuación conjunta antes de los tres años de edad, incluso desde antes del nacimiento con educación a las embarazadas y entorno familiar.</p> <p>Tras las distintas exposiciones, todos los asistentes constituyeron un interesante foro con importante participación activa. Un foro de preguntas, respuestas y discusiones donde se pudo aprender, debatir y consensuar los distintos aspectos y visiones multidisciplinares de este actual y acuciante problema que demanda la implicación de todos.</p> <p>El que participaran numerosos alumnos de pre y post-grado de las distintas Facultades de nuestro país puso de relieve el cada vez mayor interés que suscita dentro y fuera de nuestras fronteras la tendencia a ver al niño como un todo bajos todos sus aspectos: biológicos, psíquicos y sociales; conceptos que la SEOII viene desarrollando desde su fundación.</p> <p>La conferencia de clausura estuvo a cargo Dr. D. Ignacio Gómez de Terreros Sánchez el cual centró su intervención en <strong>“La Familia ante&#160; el Reto Del Siglo XXI</strong>”</p> <p>La Dra. Domínguez Reyes, tras señalar que el próximo Congreso Nacional de la SEOII tendrá lugar en Madrid en&#160; marzo de 2013 (presidido por&#160; la Dra. Mourelle) agradeció a todos, ponentes, Universidades, Agencia de Acreditación y asistentes, su activa participación; a la empresa Jonson &amp; Johnson su&#160; patrocinio y a GC- Ibérica Dental Product y&#160; Ripano su colaboración. Palabras tras las cuales, el Drs. Del Pozo Machuca, Ortiz Tardío y&#160; Gómez de Terreros dieron por clausurado el IX Encuentro Multidisciplinar de la SEOII /SEPEAP/SPAOYEX.</p> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Palacio de Exposiciones y Congresos de Sevilla (FIBES) </strong><br /> Avda. Alcalde Luis Uruñuela, 1<br /> 41020&#160; Sevilla</p> <p><strong>&#160;&#160; </strong></p> <h3>Programa del congreso para el día sábado, 6 de Octubre de 2012</h3> <ul>   <li>08:30 - 9:30: <strong>Entrega de documentación.</strong></li>   <li>09:30: <strong>Inauguración de la Jornada</strong><br />   Dr. D. José del Pozo Machuca<br />   Dr. D. Joaquín Ortiz Tardío<br />   Dr. D. José Luis Bonal Villanueva<br />   Dr. D. CristóbalCoronelRodríguez<br />   Dra. Dª Antonia Domínguez Reyes<br />   &#160;<br />   <strong>Mesa redonda: Caries de la niñez temprana. Abordaje y Perspectiva Multidisciplinar. <br />   </strong>Moderadores:&#160; Dr. D. José del Pozo Machuca y Dra. Dª Antonia Domínguez Reyes<br />   &#160;</li>   <li>10:00 – 10:45: <strong>¿Como debe ser&#160; la alimentación desde la lactancia hasta la niñez temprana? Tipos, modelos e influencias. <br />   </strong>Dra. Dª.&#160; Isabel Colomer Ureña</li>   <li>10:45 – 11:15: <strong>Aspectos Psicológicos de la alimentación la niñez temprana.&#160; <br />   </strong>Dra. Dª Montserrat Gómez de Terreros Guardiola.</li>   <li>11:15 – 11:45: <strong>Café</strong></li>   <li>11:45 - 12:30: <strong>Abordaje precoz de la caries de la Primera Infancia.&#160; <br />   </strong>Dra. Dª&#160; Rosario Gómez Cuadrado</li>   <li>12:30 – 13:15: <strong>Protocolos de Prevención&#160; en niños afectos de caries&#160; de la Primera Infancia.</strong><br />   Dra. Dª Patricia Gatón Hernández</li>   <li>13:15 – 14:30: <strong>Coloquio Mesa Redonda.</strong></li>   <li>16:00 – 17:00: <strong>Moderadores:&#160; </strong>Dr. D. José González Hachero y Dr. D. Joaquín de Nova</li>   <li>17:00 – 18:00: <strong>Moderadores:&#160; </strong>Dr. D. Joaquín Ortiz&#160; Tardío y Dr. D. Antonio F. Galán González</li>   <li>18:00 – 19:00: <strong>Moderadores:&#160; </strong>Dra. Dª .Inés Mª Marín Castro y Dr. D. Cristóbal Coronel Rodríguez</li>   <li>19:00 – 19:30: <strong>Mesa Coloquio de la Comunicaciones Libres</strong></li>   <li>19:30: <strong>Conferencia de clausura: La Familia ante&#160; el Reto Del Siglo XXI</strong><br />   Dr. D. Ignacio Gómez de Terreros</li>   <li>08:30:&#160; <strong>Clausura</strong></li> </ul> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Programa-IX-Encuentro.pdf\">Archivo PDF</a></b></p> <p>&#160;</p> <h3>Colaboran:</h3> <ul>   <li>Sociedad de Pediatría de Andalucía Occidental y Extremadura, Pediatría Extrahospitalaria de Sevilla</li> </ul> <p>&#160;</p> <h3 class=\"slideToggle\">Comité científico:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>Antonio F. Galán González</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del&#160; Pozo Machuca</li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Comité Organizador:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Inscripciones:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Gratuita, para los Miembros de las distintas Asociaciones.</li>   <li>Estudiantes de pregrado: 15 €</li>   <li>Estudiantes de postgrado: 25 €</li>   <li>Profesionales: 40 €</li>   <li>Dado el aforo limitado se ruega comunicar asistencia a la Secretaria Técnica.</li>   <li>Descargar el formulario de inscripción: <a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Hoja_inscripcion_IX_Encuentro.pdf\"><strong>Archivo PDF</strong></a></li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Comunicaciones:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.&#160;</li>   <li>Descargar Normas de Comunicaciones: <strong><a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Normas-de-comunicaciones.pdf\">Archivo PDF</a><br />   </strong></li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Ponentes y participantes:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li><strong>Teresa Aznar Martín: </strong>Profesora Colaboradora de Odontología Infantil Integrada. Universidad de Sevilla. Vocal de la SEOII.</li>   <li><strong>Elena Barbería Leache: </strong>Catedrático de Odontopediatría. Universidad de Madrid. Asesor de la SEOII.</li>   <li><strong>José Luis Bonal Villanueva:</strong> Pediatra extrahospitalario. Presidente de la SEPEAP</li>   <li><strong>Eugenio P. Cabrera Suárez:</strong> Medicina Familiar&#160; y Comunitaria. Centro de Salud. Sevilla. Asesor de la SEOII.</li>   <li><strong>Isabel Colomer Ureña:</strong> Médico Especialista en Medicina Intensiva. Residente en Pediatría (HUS Virgen Macarena)</li>   <li><strong>Cristóbal Coronel Rodríguez:</strong> Asistente Honorario de Pediatría. Pediatra CS Amante Laffón. Sevilla</li>   <li><strong>Antonia Domínguez Reyes:</strong> Profesora Titular de Odontología Infantil Integrada. Universidad de Sevilla. Presidenta de la SEOII.</li>   <li><strong>Antonio F. Galán González:</strong> Profesor Asociado de Odontología Infantil Integrada. Universidad de Sevilla. Secretario de la SEOII.</li>   <li><strong>Patricia Gatón Hernández: </strong>Profesora Asociada. Universidad de Barcelona.</li>   <li><strong>Rosario Gómez Cuadrado:</strong> Profesora Asociada de Odontología Infantil Integrada.&#160; Universidad de Sevilla.</li>   <li><strong>Montserrat Gómez de Terreros Guardiola:</strong> Profesora Titular , Facultad de Psicología, Universidad de Sevilla. Especialista en Psicología Clínica.</li>   <li><strong>Ignacio Gómez de Terreros Sánchez:</strong> Profesor Titular . Universidad de Sevilla. Presidente de la Fundación “Gota de Leche” de Sevilla</li>   <li><strong>José González Hachero:</strong> Catedrático de Pediatría. Universidad de Sevilla.</li>   <li><strong>Inés Mª Marín Castro:</strong> Profesora Asociada de Odontología Infantil Integrada. Universidad de Sevilla. Tesorera de la SEOII.</li>   <li><strong>Joaquín de Nova García:</strong> Profesor Titular de Odontoprdiatría. U. C. de Madrid.</li>   <li><strong>Joaquín Ortiz Tardío: </strong>Pediatra. Jefe de Servicio de Pediatría del Hospital de Jerez de la Frontera Presidente de la SPAOYEX</li>   <li><strong>José del Pozo Machuca:</strong> Pediatra Extrahospitalario. Sevilla. Director de Vox Pædiatrica. Vicepresidente de la SPAOYEX</li> </ul> <p></p> </div> <h3>Galería de fotos del congreso</h3> <ul>   <li><strong><strong>1º Foto: </strong>Mesa inaugural: </strong>(De izquierda a derecha) Dr. D. José del Pozo Machuca (Vicepresidente de la SAOYEX), Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), Dra. Dª Antonia Domínguez Reyes, (Presidenta de la SEOII, Dr. D. José Luís Bonal (Presidente de la SEPEAP), y el Dr Cristobal Coronel (Pediatra y Presidente del XXVI Congreso de la SEPEAP) .</li>   <li><strong><strong>2º Foto: </strong>Coloquio mesa redonda:</strong> (De izquierda a derecha) Ponentes: Dra. Dª Montserrat Gómez de Terreros&#160; Guardiola (Profesora Titular&#160; de Psicología, Facultad de Psicología, Universidad de Sevilla. Especialista en Psicología Clínica), Dra. Dª Isabel Colomer&#160; Ureña (,Médico Especialista en Medicina Intensiva y Pediatría. Asociado en Pediatría. Universidad de Sevilla), Dra. Dª Rosario Gómez Cuadrado (Profesora Asociada de Odontología Infantil Integrada. Universidad de Sevilla. Dra. Dª Patricia Gatón Hernández (Profesora Asociada. Universidad de Barcelona).<br />   Moderadores: Dr. D. Joaquín Ortiz Tardío (Pediatra. (Jefe de Servicio de Pediatría del Hospital de Jerez de la Frontera, Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil Integrada. Universidad de Sevilla).</li>   <li><strong>3º Foto:&#160;</strong> Dr. Galán,&#160; Mª Jose Clavijo, delegada de Johnson &amp; Johnson y Dra. Cabrera</li> </ul>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:39',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(21,489,'madrid-2013-iii-congreso-internacional-viii-congreso-nacional',1,1,'Madrid 2013: III Congreso Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada',NULL,NULL,NULL,NULL,NULL,'<p>Los días <strong>14 al 16 de marzo de 2013</strong> se celebró en Madrid el <strong>III Congreso&#160; Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada.</strong><strong><br /> </strong></p> <p>Más información en la web del congreso: <a href=\"http://www.seoii2013madrid.com\"><strong>seoii2013madrid.com</strong></a></p> <p>&#160;</p> <h3>Presentación</h3> <p align=\"justify\">Queridos y estimados compañeros,</p> <p align=\"justify\">Como Presidenta del Comité Organizador, me gustaría invitaros a  participar en el <strong>3er  Congreso&#160; Internacional&#160; y&#160; 8º  Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</strong> que  tendrá lugar del 14 al 16 de Marzo de 2013, en la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p align=\"justify\">En esta ocasión, trataremos temas de relevante  actualidad e impacto  que nos serán útiles en nuestro día a día, por  esta razón nos centraremos en  aquellos aspectos más novedosos en la  atención odontológica infantil a través  de mesas redondas, talleres y  cursos intracongreso.</p> <p align=\"justify\">Contaremos para ello con la colaboración de  diversos profesionales de  reconocido prestigio, tanto nacional como  internacional, pertenecientes a  distintos&#160; ámbitos de las Ciencias de  la  Salud.</p> <p align=\"justify\">Todo esto conforma un Congreso de carácter  multidisciplinar e  interprofesional, característica distintiva de  nuestra Sociedad (SEOII) que  esta comprometida con la innovación y la  mejora continuada, enriquecido por las  aportaciones de los  participantes realizadas mediante comunicaciones  presenciales y/o  pósters virtuales.</p> <p align=\"justify\">Nos gustaría contar con vuestra asistencia y a la  vez animaros a  recorrer Madrid,&#160; a disfrutar&#160; de una ciudad donde os  encontraréis en  vuestra casa. Madrid ofrece una gran diversidad  cultural, gastronómica y de  ocio, todo esto unido, a su vida en la  calle y a la forma  en que sus habitantes acogen al visitante.</p> <p align=\"justify\">En el convencimiento de que estos días que vamos a  disfrutar van a ser  inolvidables, os animo a compartir conocimientos y  amistades, lo que nos  ayudará a ser mejores profesionales y sobre todo  mejores personas.</p> <p align=\"left\">Esperando  contar con tu  presencia, recibe un&#160; fuerte abrazo</p> <p><strong>Dra. Mª Rosa Mourelle Martínez<br /> Presidenta Comité Organizador del 3er Congreso Internacional  y <br /> 8º Congreso  Nacional de la <br /> Sociedad Española de Odontología Infantil Integrada.</strong></p> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Facultad de Odontología</strong><br /> Universidad Complutense de Madrid - Ciudad Universitaria<br /> 28040 Madrid - Tel.+ 34 914520400</p> <p>&#160;</p> <h3>Página web del congreso</h3> <p>Para encontrar más información puedes visitar la web del congreso: <a href=\"http://www.seoii2013madrid.com\">seoii2013madrid.com</a></p>',0,NULL,'00:00:00',NULL,0,0,NULL,NULL,NULL,'a:0:{}','2016-03-14 16:48:39',NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(22,490,'sevilla-2013-x-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria',1,1,'Sevilla 2013: X Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria',NULL,NULL,NULL,NULL,NULL,'<p><img width=\"220\" src=\"http://seoii.es/resources/328\" class=\"right bordered\" alt=\"Sevilla 2013: X Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria\" />El día <strong>16 de noviembre de 2013</strong> se celebró el <strong>X Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria. </strong></p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos </strong><strong>1 crédito de Libre Configuración por la Universidad de Sevilla.</strong></li>   <li><strong>Concedido 0.88 créditos de Formación Continuada por la Agencia de Calidad Sanitaria de ndalucía. Consejería de Salud y Bienestar Social.</strong></li>   <li><strong>Se entregó certificado de asistencia con créditos.</strong></li> </ul> <h3>Conclusiones del congreso</h3> <p>Una vez más en el Centro Cultural Cajasol de Sevilla, el 16 de Noviembre, tuvo lugar el X Encuentro  Multidisciplinar de Odontología Infantil Integrada (SEOII). Encuentro que, conjuntamente con la Sociedad de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX), Otorrinolaringología y otras Ciencias de la Salud, constituye uno de esos clásicos eventos científicos anuales de Sevilla. En esta ocasión dicho encuentro tuvo como tema monográfico<i> </i>el problema de l<i>a </i>respiración en el niño, sus alteraciones y consecuencias sobre el Sistema Estomatognático. Consecuencias que muchas veces requieren un tratamiento multidisciplinar.</p> <p>Como en ocasiones anteriores este encuentro tuvo el reconocimiento de la Agencia Nacional de Acreditación y  la Universidad Hispalense de Sevilla que concedieron créditos de formación continuada y libre configuración para profesionales y alumnos.</p> <p>La Inauguración de la Jornada estuvo presidida por el Dr. del Pozo Machuca Presidente de Honor SEPEAP y Director de la Revista Vox Paediatrica,  Dra. Domínguez Reyes, Presidenta de la SEOII, Dr. Coronel, Vicepresidente la SPAOYEX y el Dr. Cabrera, Asesor de la SEOII.</p> <p>Ante amplia asistencia de más de un centenar de profesionales y alumnos, intervinieron la Dra. Dª Antonia Domínguez Reyes, Profa. Titular de Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de Sevilla y Presidenta de la Sociedad Española de Odontología infantil Integrada; el Dr. D. Anselmo Andrés Martín, Prof. Contratado Doctor con vinculación clínica al SSPA del Servicio de Pediatría del Hospital V. Macarena de Sevilla y Neumólogo Infantil, el Dr. D. Carlos O`Connor, especialista en Otorrinolaringología, autor del primer implante de paladar que se desarrolló en España para el tratamiento de la apnea de sueño y del primer estudio científico internacional publicado sobre el tratamiento de la rinitis alérgica infantil con radiofrecuencia; la Dra. Dª Paola &gt;Díaz Borrego, especialista en Foniatría que ha trabajado sobre los protocolos de actuación para trastornos de la deglución oro-farínfea y la Dra. Dª Mercedes Gálvez, odontólogo especialista en Ortopedia Funcional de los Maxilares por la Universidad de UNICSUL de Brasil, varias veces invitada como Profesora por la Universidad de Texas (Health Science Center at Houston,USA) y por la Profa. Wilma Simoes en su Centro Docencia de Sao Paulo en Brasil y actualmente Profa. del Master Propio en Odontología Infantil Integrada de la Universidad de Sevilla.</p> <p>Tras las distintas exposiciones tanto los miembros de la mesa como los  asistentes constituyeron un interesante coloquio abierto en el que las preguntas, respuestas y discusiones establecieron la importancia que, por sus repercusiones tanto a nivel Sistémico como Estomatognático, tiene el conocimiento y reconocimiento por parte de los pediatras, odontólogos y foniatras de las afecciones respiratorias en el niño. Problemas como el asma, la apnea de sueño, las rinitis alérgicas y otras afecciones que muchas veces requieren tratamientos multidisciplinares. En el coloquio establecido se pudo debatir y consensuar los distintos aspectos y visiones multidisciplinares de este actual y grave problema de las alteraciones respiratorias en el niño y su influencia en el desarrollo buco-dento-facial.</p> <p>La conferencia de clausura estuvo a cargo del Prof. D. Enrique Valdivieso González, Catedrático de Historia del Arte en la Universidad Hispalense, autor de varios libros sobre el tema de la Pintura quien, desarrolló una magnífica conferencia sobre el niño en la pintura romántica sevillana.</p> <p>La Dra. Domínguez Reyes, tras invitar al próximo Encuentro de Sevilla,  señala que el próximo Congreso Nacional de la SEOII tendrá lugar en Salamanca, presidido por la Dra Pilar Moreno los días 12 a 14 de Marzo de 2015. Agradece a todos los asistentes y ponentes su activa participación; a la Universidad y  Agencia de Acreditación, su reconocimiento; al Centro Cultural Cajasol su acogida y a Jonson &amp; Johnson su patrocinio, clausuró este X Encuentro que una vez más constituyó un importante foro de participación interprofesional e interdisciplinar.</p> <p>&#160;</p> <h3 class=\"slideToggle\" id=\"programa_congreso\">Programa del congreso para el día sábado, 6 de Octubre de 2012</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li><strong>8:30 - 9:30: Entrega de documentación.</strong></li>   <li><strong>9:30: Inauguración de la Jornada. </strong><br />   Dr. D. José del Pozo Machuca<br />   Dr. D. Joaquín Ortiz Tardío<br />   Dr. D. José Luis Bonal Villanueva<br />   Dr. D. Cristóbal Coronel Rodríguez<br />   Dra. Dª Antonia Domínguez Reyes<br />   <br />   <strong>Mesa redonda: Respiración en el niño. Un abordaje multidisciplinar. </strong><br />   Moderadores:&#160; Dr. D. José del Pozo Machuca<br />   &#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; Dra. Dª Antonia Domínguez Reyes</li>   <li><strong>10:00 – 10:45. Problemas respiratorios en la infancia. ¿cómo reconocerlos?</strong><br />   Dr. D Anselmo Andrés Martín</li>   <li><strong>10:45 – 11:30: ¿Que nos aporta la ORL a los problemas odontológicos derivados de un mala respiración?.</strong><br />   &#160;Dr. D.&#160; Carlos O’Connor Reina</li>   <li><strong>11:30 – 11:45: Café</strong></li>   <li><strong>11:45- 12:30. ¿Cómo contribuye la Foniatría a mejorar los problemas respiratorios y sus repercusiones? </strong><br />   Dra. Dª&#160; Laura García Rodríguez</li>   <li><strong>12:30 – 13:15 ¿Cómo debe actuar el odontólogo ante problemas respiratorios en el niño?</strong><br />   Dra. Dª Mercedes Gálvez Jiménez</li>   <li><strong>13:15 – 14:30: Coloquio Mesa Redonda.</strong></li>   <li><strong>19:30: Conferencia de clausura: El niño en la pintura barroca europea .Siglo XVII.</strong><br />   Prof. D. Enrique Valdivieso González</li>   <li><strong>20:30&#160; Clausura del X Encuentro</strong></li> </ul> <p>Descargar el programa:<b> <a target=\"_blank\" href=\"http://seoii.es/resources/upload/link/113-x-encuentro-multidisciplinar/SEOII_Programa-X-Encuentro.pdf\" rel=\"external\">Archivo PDF</a></b></p> </div> <h3 class=\"slideToggle\" id=\"comunicaciones_congreso\">Comunicaciones:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li>Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.&#160;</li>   <li>Mesa Coloquio de las Comunicaciones Libres</li>   <li>Descargar Normas de Comunicaciones: <strong><a href=\"http://seoii.es/resources/upload/link/113-x-encuentro-multidisciplinar/SEOII_Normas-de-comunicaciones.pdf\" target=\"_blank\" rel=\"external\">Archivo PDF</a><br />   </strong></li>   <li><strong>16:30 – 17:30  Moderadores:</strong><br />   Dra. Dª. Rosa Mourelle Martínez<br />   Dr. D. Cristóbal Coronel Rodríguez</li>   <li><strong>17:30 – 18:30  Moderadores:</strong><br />   Dra. Dª. Nuria Esther Gallardo López<br />   Dr. D. Joaquín Ortiz Tardío</li>   <li><strong>18:30 – 19:30  Moderadores:</strong><br />   Dr. D Josep Mª Ustrell Torrent<br />   Dr. D. Joaquín de Nova García</li> </ul> </div> <h3 class=\"slideToggle\" id=\"formulario_inscripcion_congreso\">Inscripciones:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li>Gratuita, para los Miembros de las distintas Asociaciones.</li>   <li>Estudiantes de pregrado: 20 €</li>   <li>Estudiantes de postgrado: 30 €</li>   <li>Profesionales: 50 €</li>   <li>Dado el aforo limitado se ruega comunicar asistencia a la Secre