o Andaluz</li>   <li><strong>11:30 – 11:45: Café</strong></li>   <li><strong>11:45- 12:30. ¿Cómo contribuye la Foniatría a mejorar los problemas del lenguaje por hábitos nocivos?</strong><br />   Dra. Dª Paola Díaz Borrego</li>   <li><strong>12:30 – 13:15. Maloclusion orofacial ¿causa o consecuencia de las alteraciones del lenguaje?</strong><br />   Dra. Dª. Meritxell Sánchez Molins</li>   <li><strong>13:15 – 14:30: Coloquio Mesa Redonda.</strong></li>   <li><strong>19:30: Conferencia de clausura: El menor maduro. ¿Quién decide qué, cuándo y cómo?.</strong><br />   Prof. D. José Mª Rubio Rubio</li>   <li><strong>20:30 Clausura del XI Encuentro</strong></li> </ul> <p>Descargar el programa:<b> <a rel=\"external\" href=\"http://seoii.es/resources/upload/link/114-xi-congreso/Programa_XI_Encuentro.pdf\" target=\"_blank\">Archivo PDF</a></b></p> </div> <h3 id=\"comunicaciones_congreso\" class=\"XslideToggle\">Comunicaciones:</h3> <div style=\"Xdisplay:none;\" class=\"Xhide\"> <ul>   <li>Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.&#160;</li>   <li>Mesa Coloquio de las Comunicaciones Libres</li>   <li>Descargar Normas de Comunicaciones: <strong><a rel=\"external\" target=\"_blank\" href=\"http://seoii.es/resources/upload/link/114-xi-congreso/Normas_de_comunicaciones_XI_Encuentro.pdf\">Archivo PDF</a><br />   </strong></li>   <li><strong>16:30 – 17:30  Moderadores:</strong><br />   Dra. Dª. Rosa Mourelle Martínez<br />   Dr. D. Cristóbal Coronel Rodríguez</li>   <li><strong>17:30 – 18:30  Moderadores:</strong><br />   Dra. Dª. Nuria Esther Gallardo López<br />   Dr. D. Joaquín Ortiz Tardío</li>   <li><strong>18:30 – 19:30  Moderadores:</strong><br />   Dr. D Josep Mª Ustrell Torrent<br />   Dr. D. Joaquín de Nova García</li> </ul> </div> <h3 id=\"formulario_inscripcion_congreso\" class=\"XslideToggle\">Inscripciones:</h3> <di