8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:847:\"<p>There are a lot of stuff that has been re-coded in this release. </p>\n\n<h3 id=\"most-notable-changes-are\">Most notable changes are:</h3>\n\n<h2 id=\"section\">1.8.9.10</h2>\n<ol>\n  <li>Security Patch - Update your plugin.</li>\n  <li>Security Patch provided by Dion at WordPress.org and Security report provided by http://planetzuda.com .</li>\n  <li>Language files update</li>\n</ol>\n\n<h2 id=\"section-1\">1.8.9.8</h2>\n<ol>\n  <li>Daily Schedule Option Added</li>\n  <li>Email notification on automatic optimization, default email is admin email address. You can change this in settings</li>\n</ol>\n\n  <p><a href=\"http://wp-optimize.ruhanirabin.com/whats-new-in-release-v-dot-1-8-dot-9-dot-10/\">What\'s new in release v.1.8.9.10</a> was originally published by Ruhani Rabin at <a href=\"http://wp-optimize.ruhanirabin.com\">WP-Optimize</a> on May 12, 2015.</p>\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}i:1;a:6:{s:4:\"data\";s:22:\"\n  \n  \n  \n  \n  \n  \n  \n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"URGENT BugFix: 1.8.9.7\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"rel\";s:9:\"alternate\";s:4:\"type\";s:9:\"text/html\";s:4:\"href\";s:57:\"http://wp-optimize.ruhanirabin.com/urgent-bugfix-1-8-9-7/\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://wp-optimize.ruhanirabin.com/urgent-bugfix-1-8-9-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2014-09-08T10:19:26+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2014-09-08T10:19:26+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:18:\"\n    \n    \n    \n  \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:3:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Ruhani Rabin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:3:\"uri\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://wp-optimize.ruhanirabin.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:5:\"email\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"get@email.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:1496:\"<p>Just after releasing the previous update with new changes; I have noticed that the <strong>Disable/Enable trackback/comments buttons</strong> on the setting screen causing the <strong>AUTO SCHEDULE</strong> option to reset itself. </p>\n\n<p>In fact, executing any of the <strong>Disable/Enable trackback/comments buttons</strong> will disable the <strong>AUTO SCHEDULE</strong> option, ==you will still be able to enable it by clicking the checkbox==. </p>\n\n<p><img src=\"http://wp-optimize.ruhanirabin.com/images/enable-disable-trackback-comments-update2.png\" alt=\"Image\" /></p>\n\n<p><em>I’ve made the _necessary changes_ and re-organize the Settings Screen so this does not happen again. Refer to the new screen above.</em></p>\n\n<h2 id=\"how-does-the-new-screen-work\">How does the new screen work?</h2>\n<ol>\n  <li>If you want to disable or enable trackbacks and comments, select the dropdown list for each of them. </li>\n  <li>Press <strong>SAVE SETTINGS</strong>, it will enable or disable the corresponding feature such as Trackbacks and Comments.</li>\n  <li><strong>This only reflects the ==published posts==</strong>, the reason of doing that is - ==Drafts or unpublished post you may choose to enable comments or trackbacks, it is up to you.== </li>\n</ol>\n\n  <p><a href=\"http://wp-optimize.ruhanirabin.com/urgent-bugfix-1-8-9-7/\">URGENT BugFix: 1.8.9.7</a> was originally published by Ruhani Rabin at <a href=\"http://wp-optimize.ruhanirabin.com\">WP-Optimize</a> on September 08, 2014.</p>\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}i:2;a:6:{s:4:\"data\";s:22:\"\n  \n  \n  \n  \n  \n  \n  \n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Changes in v1.8.9.6\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"rel\";s:9:\"alternate\";s:4:\"type\";s:9:\"text/html\";s:4:\"href\";s:55:\"http://wp-optimize.ruhanirabin.com/changes-in-v1-8-9-6/\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://wp-optimize.ruhanirabin.com/changes-in-v1-8-9-6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2014-09-04T11:21:19+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2014-09-04T11:21:19+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:18:\"\n    \n    \n    \n  \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:3:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Ruhani Rabin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:3:\"uri\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://wp-optimize.ruhanirabin.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:5:\"email\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"get@email.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:925:\"<h3 id=\"whats-changed\">What’s changed</h3>\n<p><img src=\"http://wp-optimize.ruhanirabin.com/images/enable-disable-trackbacks.png\" alt=\"Image\" /></p>\n\n<ol>\n  <li>There were few <strong>number formatting problem</strong> and detection of InnoDB table format. Charles Dee Rice solved the problems that I missed out. Thank you!</li>\n  <li>Now has the ability to batch <strong>enable/disable trackbacks and comments</strong> for <strong><em>all your published posts</em></strong>. Please remember this is a batch operation. If there is a post that was disabled but the rest of the other posts were enabled, the batch operation will reset it. </li>\n  <li>Other code optimizations and cleanup</li>\n</ol>\n\n  <p><a href=\"http://wp-optimize.ruhanirabin.com/changes-in-v1-8-9-6/\">Changes in v1.8.9.6</a> was originally published by Ruhani Rabin at <a href=\"http://wp-optimize.ruhanirabin.com\">WP-Optimize</a> on September 04, 2014.</p>\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}i:3;a:6:{s:4:\"data\";s:25:\"\n  \n  \n  \n  \n  \n  \n  \n  \n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"What\'s new in release v.1.8.9\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"rel\";s:9:\"alternate\";s:4:\"type\";s:9:\"text/html\";s:4:\"href\";s:72:\"http://wp-optimize.ruhanirabin.com/whats-new-in-release-v-dot-1-8-dot-9/\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"http://wp-optimize.ruhanirabin.com/whats-new-in-release-v-dot-1-8-dot-9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"2014-06-13 23:06:06 +0000T00:00:00-00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"2014-05-12T00:00:00+00:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:18:\"\n    \n    \n    \n  \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:3:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Ruhani Rabin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:3:\"uri\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://wp-optimize.ruhanirabin.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}s:5:\"email\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"get@email.com\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:2514:\"<p>There are a lot of stuff that has been re-coded in this release. </p>\n\n<h3 id=\"most-notable-changes-are\">Most notable changes are:</h3>\n\n<ol>\n  <li>\n    <p>Persistent settings for main screen: Allows user to save the checkbox selection on the main screen so next time they do not need to select the items they use frequently. Red marked items could not be saved. <img src=\"http://wp-optimize.ruhanirabin.com/images/2014-05-12-1.png\" alt=\"Image\" /></p>\n  </li>\n  <li>\n    <p>Credits page has been re-organized with proper information and links. Now includes GitHub master branch commits.</p>\n  </li>\n  <li>\n    <p>Now cleans up redundant comment meta data and akismet left over data from comments meta data table. </p>\n  </li>\n  <li>\n    <p>Time settings according to the blog local time, so schedules and time display will show time properly. This would only work if the blog time has been set up properly</p>\n  </li>\n  <li>\n    <p>I have enabled mixed type tables optimization. So basically what will it do? It will enable you to run optimization if you have mixed of innoDB and MyISAM tables. But, it will skip the optimization commands on innoDB tables. Some tables may report wrong size, haven’t been able to find a proper workaround to this. </p>\n  </li>\n  <li>\n    <p>New table type column - this gives you an overlook of what types of tables you have on your database.  <img src=\"http://wp-optimize.ruhanirabin.com/images/table-type-display.png\" alt=\"Image\" /></p>\n  </li>\n  <li>\n    <p>InnoDB table type <strong>Overhead Size</strong>  are set to <strong>0 bytes</strong> because most of the time they report wrong overhead size.</p>\n  </li>\n  <li>\n    <p>Shows last blog post from GitHub Pages for WP-Optimize at the <strong>Status Log</strong></p>\n  </li>\n  <li>\n    <p><strong>Independent translation portal</strong> for Translators to live update translations before actual releases. So their translation at always in sync. <strong><a href=\"http://wp-optimize.ruhanirabin.com/translations/\">Read instructions</a></strong> <img src=\"http://wp-optimize.ruhanirabin.com/images/translations-interface.png\" alt=\"Image\" /></p>\n  </li>\n  <li>\n    <p>Updated SQL Queries to include backticks for better compatibilty with reserved names. </p>\n  </li>\n</ol>\n\n\n  <p><a href=\"http://wp-optimize.ruhanirabin.com/whats-new-in-release-v-dot-1-8-dot-9/\">What\'s new in release v.1.8.9</a> was originally published by Ruhani Rabin at <a href=\"http://wp-optimize.ruhanirabin.com\">WP-Optimize</a> on May 12, 2014.</p>\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:2:\"en\";}}}}}}}}}}}}s:4:\"type\";i:512;s:7:\"headers\";a:20:{s:6:\"server\";s:10:\"GitHub.com\";s:12:\"content-type\";s:15:\"application/xml\";s:13:\"last-modified\";s:29:\"Tue, 23 Jun 2015 15:11:55 GMT\";s:27:\"access-control-allow-origin\";s:1:\"*\";s:7:\"expires\";s:29:\"Tue, 15 Mar 2016 03:42:44 GMT\";s:13:\"cache-control\";s:11:\"max-age=600\";s:16:\"content-encoding\";s:4:\"gzip\";s:19:\"x-github-request-id\";s:29:\"B91F1214:0345:C5539C:56E7825C\";s:14:\"content-length\";s:4:\"2937\";s:13:\"accept-ranges\";s:5:\"bytes\";s:4:\"date\";s:29:\"Wed, 16 Mar 2016 18:08:35 GMT\";s:3:\"via\";s:11:\"1.1 varnish\";s:3:\"age\";s:3:\"103\";s:10:\"connection\";s:5:\"close\";s:11:\"x-served-by\";s:17:\"cache-lcy1129-LCY\";