INSERT INTO `wp_posts` VALUES (5,1,'2016-02-24 12:04:49','2016-02-24 12:04:49','<h2>¿Qué es una cookie?</h2>\n<p>\n	Una <em>cookie</em> es un fichero de texto <b>inofensivo</b> que se almacena en su navegador cuando visita casi cualquier página web. La utilidad de la <em>cookie</em> es que la web sea capaz de recordar su visita cuando vuelva a navegar por esa página. Aunque mucha gente no lo sabe las <em>cookies</em> se llevan utilizando desde hace 20 años, cuando aparecieron los primeros navegadores para la World Wide Web.\n</p> \n<h2>¿Qué NO ES una cookie?</h2>\n<p>\n	No es un virus, ni un troyano, ni un gusano, ni spam, ni spyware, ni abre ventanas pop-up.\n</p> \n<h2>¿Qué información almacena una <em>cookie</em>?</h2>\n<p>\n	Las <em>cookies</em> no suelen almacenar información sensible sobre usted, como tarjetas de crédito o datos bancarios, fotografías, su DNI o información personal, etc. Los datos que guardan son de carácter técnico, preferencias personales, personalización de contenidos, etc.\n</p>\n<p>\n	El servidor web no le asocia a usted como persona si no a su navegador web. De hecho, si usted navega habitualmente con Internet Explorer y prueba a navegar por la misma web con Firefox o Chrome verá que la web no se da cuenta que es usted la misma persona porque en realidad está asociando al navegador, no a la persona.\n</p>\n<h2>¿Qué tipo de <em>cookies</em> existen?</h2>\n<p>\n	<ul>\n		<li><em>Cookies</em> técnicas: Son las más elementales y permiten, entre otras cosas, saber cuándo está navegando un humano o una aplicación automatizada, cuándo navega un usuario anónimo y uno registrado, tareas  básicas para el funcionamiento de cualquier web dinámica.</li>\n		<li><em>Cookies</em> de análisis: Recogen información sobre el tipo de navegación que está realizando, las secciones que más utiliza, productos consultados, franja horaria de uso, idioma, etc.</li>\n		<li><em>Cookies</em> publicitarias: Muestran publicidad en función de su navegación, su país de procedencia, idioma, etc.</li>\n	</ul>\n</p>\n<h2>¿Qué son las <em>cookies</em> propias y las de terceros?</h2>\n<p>\n	Las <em>cookies propias</em> son las generadas por la página que está visitando y las <em>de terceros</em> son las generadas por servicios o proveedores externos como Facebook, Twitter, Google, etc.\n</p> \n<h2>¿Qué ocurre si desactivo las <em>cookies</em>?</h2>\n<p>\n	Para que entienda el alcance que puede tener desactivar las <em>cookies</em> le mostramos unos ejemplos:\n	<ul>\n		<li>No podrá compartir contenidos de esa web en Facebook, Twitter o cualquier otra red social.</li>\n		<li>El sitio web no podrá adaptar los contenidos a sus preferencias personales, como suele ocurrir en las tiendas online.</li>\n		<li>No podrá acceder al área personal de esa web, como por ejemplo <em>Mi cuenta</em>, o <em>Mi perfil</em> o <em>Mis pedidos</em>.</li>\n		<li>Tiendas online: Le será imposible realizar compras online, tendrán que ser telefónicas o visitando la tienda física si es que dispone de ella.</li>\n		<li>No será posible personalizar sus preferencias geográficas como franja horaria, divisa o idioma.</li>\n		<li>El sitio web no podrá realizar analíticas web sobre visitantes y tráfico en la web, lo que dificultará que la web sea competitiva.</li>\n		<li>No podrá escribir en el blog, no podrá subir fotos, publicar comentarios, valorar o puntuar contenidos. La web tampoco podrá saber si usted es un humano o una aplicación automatizada que publica <em>spam</em>.</li>\n		<li>No se podrá mostrar publicidad sectorizada, lo que reducirá los ingresos publicitarios de la web.</li>\n		<li>Todas las redes sociales usan <em>cookies</em>, si las desactiva no podrá utilizar ninguna red social.</li>\n	</ul>\n</p>\n<h2>¿Se pueden eliminar las <em>cookies</em>?</h2>\n<p>\n	Sí. No sólo eliminar, también bloquear, de forma general o particular para un dominio específico.\n</p>\n<p>\n	Para eliminar las <em>cookies</em> de un sitio web debe ir a la configuración de su navegador y allí podrá buscar las asociadas al dominio en cuestión y proceder a su eliminación.\n</p>\n<h2 id=\"navegadores\">Configuración de <em>cookies</em> para los navegadores más polulares</h2>\n<p>\n	A continuación le indicamos cómo acceder a una <em>cookie</em> determinada del navegador <b>Chrome</b>. Nota: estos pasos pueden variar en función de la versión del navegador:\n	<ol>\n		<li>Vaya a Configuración o Preferencias mediante el menú Archivo o bien pinchando el icono de personalización que aparece arriba a la derecha.</li>\n		<li>Verá diferentes secciones, pinche la opción <em>Mostrar opciones avanzadas</em>.</li>\n		<li>Vaya a <em>Privacidad</em>, <em>Configuración de contenido</em>.</li>\n		<li>Seleccione <em>Todas las <em>cookies</em> y los datos de sitios</em>.</li>\n		<li>Aparecerá un listado con todas las <em>cookies</em> ordenadas por dominio. Para que le sea más fácil encontrar las <em>cookies</em> de un determinado dominio introduzca parcial o totalmente la dirección en el campo <em>Buscar cookies</em>.</li>\n		<li>Tras realizar este filtro aparecerán en pantalla una o varias líneas con las <em>cookies</em> de la web solicitada. Ahora sólo tiene que seleccionarla y pulsar la <em>X</em> para proceder a su eliminación.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador <b>Internet Explorer</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Vaya a <em>Herramientas</em>, <em>Opciones de Internet</em></li>\n		<li>Haga click en <em>Privacidad</em>.</li>\n		<li>Mueva el deslizador hasta ajustar el nivel de privacidad que desee.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador <b>Firefox</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Vaya a <em>Opciones</em> o <em>Preferencias</em> según su sistema operativo.</li>\n		<li>Haga click en <em>Privacidad</em>.</li>\n		<li>En <em>Historial</em> elija <em>Usar una configuración personalizada para el historial</em>.</li>\n		<li>Ahora verá la opción <em>Aceptar cookies</em>, puede activarla o desactivarla según sus preferencias.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador <b>Safari para OSX</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Vaya a <em>Preferencias</em>, luego <em>Privacidad</em>.</li>\n		<li>En este lugar verá la opción <em>Bloquear cookies</em> para que ajuste el tipo de bloqueo que desea realizar.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador <b>Safari para iOS</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Vaya a <em>Ajustes</em>, luego <em>Safari</em>.</li>\n		<li>Vaya a <em>Privacidad y Seguridad</em>, verá la opción <em>Bloquear cookies</em> para que ajuste el tipo de bloqueo que desea realizar.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador para dispositivos <b>Android</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Ejecute el navegador y pulse la tecla <em>Menú</em>, luego <em>Ajustes</em>.</li>\n		<li>Vaya a <em>Seguridad y Privacidad</em>, verá la opción <em>Aceptar cookies</em> para que active o desactive la casilla.</li>\n	</ol>\n</p>\n<p>\n	Para acceder a la configuración de <em>cookies</em> del navegador para dispositivos <b>Windows Phone</b> siga estos pasos (pueden variar en función de la versión del navegador):\n	<ol>\n		<li>Abra <em>Internet Explorer</em>, luego <em>Más</em>, luego <em>Configuración</em></li>\n		<li>Ahora puede activar o desactivar la casilla <em>Permitir cookies</em>.</li>\n	</ol>\n</p>\n<p>\n	Asesor de Cookies es un <a href=\"http://wordpress.org/plugins/asesor-cookies-para-la-ley-en-espana/\" target=\"_blank\">plugin para WordPress</a> creado por Carlos Doral (<a href=\"http://webartesanal.com\" target=\"_blank\">webartesanal.com</a>)\n</p>\n','Más información sobre las cookies','','publish','closed','closed','','mas-informacion-sobre-las-cookies','','','2016-02-24 12:04:49','2016-02-24 12:04:49','',0,'http://seoii.davidsantiago.net/mas-informacion-sobre-las-cookies/',0,'page','',0),(6,1,'2016-02-24 12:04:49','2016-02-24 12:04:49','<h1>Política de cookies</h1>\n<p>\n	Una <em>cookie</em> es un pequeño fichero de texto que se almacena en su navegador cuando visita casi cualquier página web. Su utilidad es que la web sea capaz de recordar su visita cuando vuelva a navegar por esa página. Las <em>cookies</em> suelen almacenar información de carácter técnico, preferencias personales, personalización de contenidos, estadísticas de uso, enlaces a redes sociales, acceso a cuentas de usuario, etc. El objetivo de la <em>cookie</em> es adaptar el contenido de la web a su perfil y necesidades, sin <em>cookies</em> los servicios ofrecidos por cualquier página se verían mermados notablemente. Si desea consultar más información sobre qué son las <em>cookies</em>, qué almacenan, cómo eliminarlas, desactivarlas, etc., <a href=\"http://seoii.davidsantiago.net/mas-informacion-sobre-las-cookies/\">le rogamos se dirija a este enlace.</a>\n</p>\n<h2>Cookies utilizadas en este sitio web</h2>\n<p>\n	Siguiendo las directrices de la Agencia Española de Protección de Datos procedemos a detallar el uso de <em>cookies</em> que hace esta web con el fin de informarle con la máxima exactitud posible.\n</p>\n<p>\n	Este sitio web utiliza las siguientes <strong>cookies propias</strong>:\n	<ul>\n		<li>Cookies de sesión, para garantizar que los usuarios que escriban comentarios en el blog sean humanos y no aplicaciones automatizadas. De esta forma se combate el <em>spam</em>.</li>\n	</ul>\n</p>\n<p>\n	Este sitio web utiliza las siguientes <strong>cookies de terceros</strong>:\n	<ul>\n		<li>Google Analytics: Almacena <em>cookies</em> para poder elaborar estadísticas sobre el tráfico y volumen de visitas de esta web. Al utilizar este sitio web está consintiendo el tratamiento de información acerca de usted por Google. Por tanto, el ejercicio de cualquier derecho en este sentido deberá hacerlo comunicando directamente con Google.</li>\n		<li>Redes sociales: Cada red social utiliza sus propias <em>cookies</em> para que usted pueda pinchar en botones del tipo <em>Me gusta</em> o <em>Compartir</em>.</li>\n	</ul>\n</p>\n<h2>Desactivación o eliminación de cookies</h2>\n<p>\n	En cualquier momento podrá ejercer su derecho de desactivación o eliminación de cookies de este sitio web. Estas acciones se realizan de forma diferente en función del navegador que esté usando. <a href=\"http://seoii.davidsantiago.net/mas-informacion-sobre-las-cookies/#navegadores\">Aquí le dejamos una guía rápida para los navegadores más populares</a>.\n</p>\n<h2>Notas adicionales</h2>\n<p>\n	<ul>\n		<li>\n			Ni esta web ni sus representantes legales se hacen responsables ni del contenido ni de la veracidad de las políticas de privacidad que puedan tener los terceros mencionados en esta política de <em>cookies</em>.\n		</li>\n		<li>\n			Los navegadores web son las herramientas encargadas de almacenar las <em>cookies</em> y desde este lugar debe efectuar su derecho a eliminación o desactivación de las mismas. Ni esta web ni sus representantes legales pueden garantizar la correcta o incorrecta manipulación de las <em>cookies</em> por parte de los mencionados navegadores.\n		</li>\n		<li>\n			En algunos casos es necesario instalar <em>cookies</em> para que el navegador no olvide su decisión de no aceptación de las mismas.\n		</li>\n		<li>\n			En el caso de las <em>cookies</em> de Google Analytics, esta empresa almacena las <em>cookies</em> en servidores ubicados en Estados Unidos y se compromete a no compartirla con terceros, excepto en los casos en los que sea necesario para el funcionamiento del sistema o cuando la ley obligue a tal efecto. Según Google no guarda su dirección IP. Google Inc. es una compañía adherida al Acuerdo de Puerto Seguro que garantiza que todos los datos transferidos serán tratados con un nivel de protección acorde a la normativa europea. Puede consultar información detallada a este respecto <a href=\"http://safeharbor.export.gov/companyinfo.aspx?id=16626\" target=\"_blank\">en este enlace</a>. Si desea información sobre el uso que Google da a las cookies <a href=\"https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage?hl=es&csw=1\" target=\"_blank\">le adjuntamos este otro enlace</a>.\n		</li>\n		<li>\n			Para cualquier duda o consulta acerca de esta política de <em>cookies</em> no dude en comunicarse con nosotros a través de la sección de contacto.</a>\n		</li>\n	</ul>\n</p>\n<p>\n	Asesor de Cookies es un <a href=\"http://wordpress.org/plugins/asesor-cookies-para-la-ley-en-espana/\" target=\"_blank\">plugin para WordPress</a> creado por Carlos Doral (<a href=\"http://webartesanal.com\" target=\"_blank\">webartesanal.com</a>)\n</p>\n','Política de cookies','','publish','closed','closed','','politica-de-cookies','','','2016-02-24 12:04:49','2016-02-24 12:04:49','',0,'http://seoii.davidsantiago.net/politica-de-cookies/',0,'page','',0),(8,1,'2016-02-24 14:27:30','2016-02-24 14:27:30','[vc_row][vc_column][vc_column_text]<img class=\"size-medium wp-image-11 alignleft\" src=\"http://seoii.davidsantiago.net/wp-content/uploads/2016/02/foto.jpg\" alt=\"foto\" width=\"184\" height=\"236\" />En nombre de la <strong>Sociedad Española de Odontología Infantil Integrada (SEOII) </strong>bienvenidos a nuestra página web.\r\n\r\nEsta página web ha sido creada para que los <strong>profesionales con visión Integral de la Odontología en el niño</strong>, <strong>los odontólogos </strong>con distintas dedicaciones: Ortodoncistas, Odontopediatras, Cirujanos; <strong>los Profesores </strong>que llevan esta asignatura en las distintas Facultades de nuestro país, otros profesionales en Ciencias de la Salud: Pediatras, Otorrinolaringólogos, Foniatras, Fisioterapeutas, Logopedas, Psicólogos y<strong> personas y familias interesadas en conocer este tema de actualidad,</strong> puedan conocer el ideario general de la Sociedad, estar al día en los diferentes avances que se vayan produciendo dentro de la Odontología infantil y estar informados sobre programas, eventos, congresos, reuniones y otras noticias de interés.\r\n\r\n<strong>La Sociedad Española de Odontología Infantil Integrada,</strong> creada hace diez años en Sevilla, <strong>es una sociedad odontológica multidisciplinar, interdisciplinar e interprofesional</strong> que  además de defender las legítimas aspiraciones e inquietudes que en este campo puedan tener sus socios, <strong>tiene como objetivo fundamental el estudio, la investigación y la difusión de la Odontología Infantil, vista en su conjunto e integrada en el concepto general de salud en el niño.</strong>\r\n\r\n<strong>El Odontólogo Infantil con visión Integral, ve, diagnostica, previene y trata al niño de una manera global,</strong><strong>secuencial e integrada.</strong> Ve al niño  no como una boca o alteración sistémica aislada, sino como un <strong>ser dinámico que está en continuo crecimiento y desarrollo tanto físico como psíquico y social.</strong>\r\n\r\nSostiene que las afecciones del Sistema Estomatognático influyen sobre las afecciones generales de orden sistémico, la familia y el ambiente; y éstas y sus tratamientos, sobre el Sistema Estomatognático.<strong> Un concepto que resulta ser una verdadera necesidad en nuestro tiempo.</strong>\r\n\r\nCon esta página pretendemos tengas<strong> la mejor información</strong>, no sólo de nuestros particulares eventos científicos, sino de todo aquello que relacionado con el niño podamos obtener.\r\n\r\nContamos con tu ayuda y estamos abiertos a tus sugerencias. Y si como <strong>profesional dedicado al niño no eres socio, aprovecho la ocasión para invitarte a pertenecer a la Sociedad Española de Odontología Infantil Integrada</strong>que aprendiendo cada día de todos y cada uno,<strong> tiene mucho que ofrecer a favor de la Odontología en el niño,</strong> a los distintos profesionales en Ciencias de la Salud y a los docentes de nuestra y otras profesiones.\r\n\r\nCon un cordial saludo<strong>\r\n</strong>\r\n\r\n<span class=\"Estilo2\"><strong>Profa. Antonia Domínguez Reyes.</strong>\r\n</span>Presidenta de la SEOII[/vc_column_text][/vc_column][/vc_row]','Presentación','','publish','closed','closed','','presentacion','','','2016-02-24 14:41:15','2016-02-24 14:41:15','',0,'http://seoii.davidsantiago.net/?page_id=8',0,'page','',0),(11,1,'2016-02-24 14:40:48','2016-02-24 14:40:48','','foto','','inherit','open','closed','','foto','','','2016-02-24 14:40:48','2016-02-24 14:40:48','',8,'http://seoii.davidsantiago.net/wp-content/uploads/2016/02/foto.jpg',0,'attachment','image/jpeg',0),(14,1,'2016-03-02 14:52:03','2016-03-02 14:52:03','[vc_row][vc_column width=\"1/2\"][vc_column_text]\r\n<h2>Presidente:</h2>\r\n<strong>Antonia Domínguez Reyes</strong>\r\n<h2>Secretario:</h2>\r\nAntonio F. Galán González\r\n<h2>Tesorero:</h2>\r\nInés M. Marín Castro[/vc_column_text][/vc_column][vc_column width=\"1/2\"][vc_column_text]\r\n<h2>Asesores:</h2>\r\n<ul>\r\n	<li>Elena Barbería Leache</li>\r\n	<li>Eugenio P. Cabrera Suárez</li>\r\n</ul>\r\n<h2>Vocales:</h2>\r\n<ul>\r\n	<li>Joaquín de Nova García (Representante Com. Madrid)</li>\r\n	<li>José Mª Ustrell  Torrent (Representante en Cataluña)</li>\r\n	<li>Teresa Aznar Martín</li>\r\n	<li>Lourdes Muñoz Muñoz</li>\r\n</ul>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\r\n<h2>Miembros Numerarios encargados de la difusión de la Sociedad:</h2>\r\n<ul>\r\n	<li>Mercedes Gálvez Jiménez</li>\r\n	<li>Rosario Gómez Cuadrado</li>\r\n	<li>Rosa Mourelle Martínez</li>\r\n	<li>Mª Eugenia Cabrera Domínguez</li>\r\n	<li>Mª del Carmen de la Torre Ábalos</li>\r\n	<li>José Javier Cabrera Domínguez</li>\r\n</ul>\r\n<h2>Miembros Numerarios Representantes de jóvenes profesionales:</h2>\r\n<ul>\r\n	<li>Maria Noguerado Mellado</li>\r\n	<li>Marta Paz Cortés</li>\r\n	<li>Ana Ovidia Macías Romero</li>\r\n	<li>Irene Viñuelas Perales</li>\r\n</ul>\r\n[/vc_column_text][/vc_column][/vc_row]','Junta directiva','','publish','closed','closed','','junta-directiva','','','2016-03-02 14:53:39','2016-03-02 14:53:39','',0,'http://seoii.davidsantiago.net/?page_id=14',0,'page','',0),(18,1,'2016-03-02 14:55:58','2016-03-02 14:55:58','[vc_row][vc_column][vc_column_text]\r\n<h2>¿Cuándo hay que llevar los niños al dentista por primera vez?</h2>\r\nLa salud oral y el correcto desarrollo de la boca, forman parte de la salud general en el niño. Desde el nacimiento hay que explorar la cavidad oral para detectar posibles anomalías. Si no existen alteraciones, un buen momento sería cuando comienzan a salirle los dientes (6 meses - 1 año). Es aconsejable que el dentista esté acostumbrado a atender niños, y sobre todo que tenga una visión integral del mismo.\r\n\r\nCuando comienzan a aparecer los dientes (dentición temporal) las visitas periódicas al pediatra y al dentista son recomendables, y durante el recambio de los dientes, fundamental. Estas visitas deben mantenerse a lo largo de la infancia y la adolescencia.\r\n<h2>¿Es aconsejable la lactancia materna?</h2>\r\nDar el pecho es de suma importancia para el desarrollo físico, inmunológico y afectivo,  favoreciendo además un correcto desarrollo de la boca del niño. Durante la lactancia materna es importante mantener una buena higiene oral del niño (limpieza bucal) tras cada toma, sobre todo después de la ultima toma de la noche.\r\n<h2>¿Qué hacer si el niño tiene dolor porque le están saliendo los dientes?</h2>\r\nA menudo el proceso eruptivo de la dentición temporal resulta molesto e incluso doloroso; un proceso durante el cual puede aparecer irritabilidad, aumento de la salivación, disminución del apetito y, a veces, ligera febrícula.\r\n\r\nDurante este periodo es recomendable que el niño esté bien hidratado, para lo cual debe aumentarse la ingesta de agua, disminuir la temperatura de los alimentos y enfriar papillas y biberones.\r\n\r\nEl uso de productos de aplicación tópica con efectos sedantes en las encías no son recomendables, porque pueden interferir en el proceso de erupción.\r\n\r\nLos antitérmicos y analgésicos tipo paracetamol, a dosis adecuadas, siempre bajo la supervisión del pediatra, son la medida ideal.\r\n\r\nExisten en el mercado mordedores de goma que son muy útiles para calmar el dolor de la erupción. Su compra debe hacerse en farmacias para que estén debidamente homologados.\r\n<h2>¿Hasta que edad puede mantenerse el chupete?</h2>\r\nEl uso o no del chupete en los recién nacidos es un tema muy controvertido. Estaría muy bien que no fueran necesarios, pero todos sabemos que ante el llanto persistente del bebé, el chupete puede ser una ayuda.\r\n\r\nLo ideal es utilizar siempre chupetes anatómicos con el menor tamaño posible. Su uso no debe prolongarse más allá de los dos años y medio de edad, intentando, si es posible, retirarlo antes, ya que su persistencia en el tiempo puede ocasionar alteraciones en el desarrollo de las arcadas dentarias y ser causa de maloclusiones.\r\n<h2>¿Cómo actuar si el niño sufre traumatismo dental en un diente temporal?</h2>\r\nCuando el niño comienza a andar los dientes temporales del grupo anterior suelen estar ya erupcionados; es por lo que estos traumatismos afectan a estas piezas con mayor frecuencia\r\n\r\nAnte un golpe en la boca, lo primero es mantener la calma, ya que las zonas periorales y las encías, al estar muy vascularizadas, sangran con gran facilidad.\r\n\r\nEn estos casos es muy importante acudir al dentista lo antes posible, el cual, realizará el correcto estudio y diagnóstico de las lesiones; aconsejará o no el uso de antibióticos y las medidas higiénicas adecuadas.\r\n\r\nSi existe pérdida de algún diente, no se debe intentar recolocarlo como hacemos con un diente definitivo, porque, entre otras cosas, puede dañarse el germen del diente permanente que se encuentra debajo.\r\n<h2>¿Tengo que darle a mi hijo suplementos de flúor?</h2>\r\nEn primer lugar hay que tener en cuenta la zona en la que viven las familias y saber si el agua de la zona está o no fluorada. Si lo está, debe conocerse su grado de fluorización; si no lo está, deben los padres consultar al pediatra y llevar al niño al odontólogo para determinar si, según la edad y estado oral, es necesario su empleo. Un exceso de flúor, podría ser más perjudicial que beneficioso en el niño.\r\n<h2>¿Cuántas veces al día deben cepillarse los dientes?</h2>\r\nEl cepillado debe realizarse después de cada comida (desayuno, almuerzo y cena). Debemos destacar que es muy importante que tras el último cepillado, antes de dormir, no deben ingerirse alimentos ni bebidas a excepción de agua. Por ello la higiene dental que se realiza antes de irse a la cama es la más importante.\r\n<h2>¿Hay que tratar los dientes de leche?</h2>\r\nSi. La dentición temporal, aparte su función estética, masticatoria y fonatoria, cumple la misión de ser guía para la dentición permanente o definitiva del niño.\r\n\r\nSi tiene caries auque sea en la dentición temporal, hay que tratarlas porque la caries es una enfermedad infecciosa en el diente e influye, como cualquier otro proceso infeccioso, en el resto de su organismo alterando la salud.\r\n\r\nPor otro lado, si se pierde prematuramente un diente temporal, el permanente puede no tener espacio para erupcionar, ocasionando maloclusiones en la dentición definitiva.\r\n\r\nPor lo tanto se deben prevenir las pérdidas y, si ello fuese inevitable, colocar un mantenedor de espacio hasta que erupcione el definitivo correspondiente.\r\n<h2> ¿Que son los selladores?</h2>\r\n<img class=\"left alignleft\" src=\"http://seoii.es/resources/upload/image/55/faqs_clip_image002.jpg\" alt=\"\" width=\"162\" height=\"117\" />Los selladores son un método preventivo de caries en los niños. Consiste en la aplicación de un material resistente en surcos y fisuras dentales. Este material impide que las bacterias productoras de caries se introduzcan en ellos, y su aplicación es indolora, y por lo tanto, se realiza sin necesidad de anestesia. Son un método de prevención rápido, eficaz y fácil de aplicar.\r\n\r\n&nbsp;\r\n<h2>¿Es conveniente el uso de biberones? ¿Hasta cuándo pueden los niños alimentarse con biberón?</h2>\r\n<img class=\"left alignleft\" src=\"http://seoii.es/resources/upload/image/55/faqs_clip_image004.jpg\" alt=\"\" width=\"162\" height=\"109\" />Lo ideal es que el niño no utilice el biberón mientras pueda ser amamantado, ya que aparte de los beneficios inmunológicos, nutricionales, psicológicos y de relación con la madre, la lactancia materna permite el correcto desarrollo de los maxilares, favorece la correcta ubicación de la lengua en la cavidad oral y por tanto la correcta deglución.\r\n\r\nA veces creemos que el niño no coge bien el pecho o no toma suficiente leche, por lo que se tiende a sustituir la lactancia materna por biberones. Antes de tomar esta importante decisión debemos consultar con el pediatra. Si por alguna razón el biberón fuera necesario, hay que utilizar un biberón con tetina anatómica, de orificio pequeño y que obligue a extraer la leche y a respirar por la nariz. Debe obtenerse en farmacias.\r\n\r\nEn estos casos, su uso no debe prolongarse más allá del año de edad; y esto, porque abusar del mismo puede ocasionar problemas en las funciones masticatorias, deglutorias y respiratorias inmediatas o futuras, así como alteraciones tipo malposición dentaria, paladares ojivales o mordidas abiertas.\r\n<h2> Mi niño se chupa el dedo ¿Que puedo hacer?</h2>\r\n<img class=\"left alignleft\" src=\"http://seoii.es/resources/upload/image/55/faqs_clip_image005.jpg\" alt=\"\" width=\"162\" height=\"168\" />El chuparse el dedo es un hábito que aparece de forma frecuente en los niños. Este hábito ha podido detectarse, incluso, en el seno materno. No obstante debe eliminarse lo antes posible, ya que es capaz de inducir alteraciones en el desarrollo esquelético y dental.\r\n\r\nPara solucionar este hábito nocivo, la primera opción es siempre convencer al niño que lo abandone de forma voluntaria.\r\n\r\nEn la farmacia existen determinados productos, no siempre eficaces, que pintan los dedos y tienen mal sabor.\r\n\r\nEs conveniente ponerse en contacto con un dentista experto en niños, para intentar un pacto entre niño, padres y odontólogo; puede intentarse establecer algún tipo de recompensa encaminada a conseguir el abandono de la succión digital. Esta recompensa no debe ser extravagante, pero si especialmente motivadora para el niño.\r\n\r\nSi el hábito persistiera, junto a una labor de convencimiento, podría optarse por colocar aparatos que dificulten la succión digital.\r\n<h2>¿A qué edad salen los primeros dientes de leche?</h2>\r\nAunque la cronología y secuencia de la erupción dental es muy variable y  por muy diversas razones, aproximadamente alrededor de los 6 meses de vida, los primeros dientes temporales o de “leche” que aparecen en boca suelen ser los incisivos inferiores. La dentición temporal debe estar completa a los tres años de edad.\r\n<h2>¿A que edad se caen los primeros dientes de leche?</h2>\r\nEl recambio dentario, igual que la erupción, también es muy variable. Cada diente temporal se recambia por su correspondiente permanente excepto los molares temporales que se sustituyen por los premolares.\r\n\r\nLa caída de los primeros dientes temporales y la aparición de los dientes definitivos, coincide con los 6 años de edad.\r\n\r\nEs importante señalar que es en este periodo de tiempo (6 años de vida) cuando aparece el primer molar definitivo, que erupciona por detrás de la segunda muela de “leche”.\r\n<h2>¿A que edad tienen que cepillarse los niños los dientes?</h2>\r\n<img class=\"left alignleft\" src=\"http://seoii.es/resources/upload/image/55/faqs_clip_image007.jpg\" alt=\"\" width=\"162\" height=\"238\" />El cuidado, limpieza o higiene de la cavidad oral, debe realizarse desde el nacimiento.\r\n\r\nLa higiene o limpieza de las encías ha de efectuarse tras cada toma de leche con gasa estéril.\r\n\r\nCuando erupcionan los primeros dientes, existen en farmacia dediles de caucho y pequeños cepillos que los padres pueden utilizar para introducir al niño en el hábito de la higiene bucal.\r\n\r\nUna vez que el niño es más autónomo, puede realizar su higiene diaria con un pequeño cepillo y sin pasta dental, bajo la supervisión de los padres, y una vez al día deben realizarla los padres. La pasta dental puede usarse a partir de los 3 años de edad, y debe ser fluorada (no superando una concentración de 1100 ppm); en las farmacias existen cepillos y pastas adecuadas a estas edades.\r\n<h2>Mi hijo rechina los dientes ¿Qué puedo hacer?</h2>\r\n<img class=\"left alignleft\" src=\"http://seoii.es/resources/upload/image/55/faqs_clip_image009.jpg\" alt=\"\" width=\"162\" height=\"119\" />El mal hábito de rechinar los dientes, llamado bruxismo, puede darse tanto de día como de noche, siendo más frecuente por la noche. Suele aparecer en los niños entre los cuatro y seis años de edad. Los factores desencadenantes pueden ser diversos, se relaciona con frecuencia con niños hiperactivos y situaciones de estrés.\r\n\r\nSi el hábito se mantiene, produce serios desgastes en los dientes, dando lugar a dolor dentario y de la musculatura perioral.\r\n\r\nLos padres deben consultar con el dentista infantil para su correcto diagnóstico y poner en marcha las medidas terapéuticas oportunas, que pueden ir desde tratamiento por un psicólogo con técnicas antiestrés, hasta la utilización de accesorios protectores para prevenir el desgaste.\r\n<h2>¿Que son mejor, los empastes blancos o los tradicionales de metal (empastes grises)?</h2>\r\nEn los dientes temporales dada sus características diferentes a los dientes permanentes, se coloca normalmente metal, aunque en determinados casos el dentista si lo cree conveniente puede colocar empaste blanco[/vc_column_text][/vc_column][/vc_row]','Información para los padres','','publish','closed','closed','','in','','','2016-03-15 23:17:51','2016-03-15 22:17:51','',0,'http://seoii.davidsantiago.net/?page_id=18',0,'page','',0),(21,1,'2016-03-02 14:59:49','2016-03-02 14:59:49','[vc_row][vc_column][vc_column_text]\r\n<ul>\r\n	<li><a href=\"http://www.sepeap.es/\" target=\"_blank\" rel=\"external\">Sociedad Española de Pediatría Extrahospitalaria y Atención Primaria. SEPEAP</a></li>\r\n	<li><a href=\"http://www.aeped.es/\" target=\"_blank\" rel=\"external\">Asociación Española de Pediatría. AEPED</a></li>\r\n	<li><a href=\"http://www.aeped.es/lac-mat/index2.htm\" target=\"_blank\" rel=\"external\">Asociación de Lactancia Materna</a></li>\r\n	<li><a href=\"http://www.clc-logopedia.org/\" target=\"_blank\" rel=\"external\">Col-legi de Logopedes de Catalunya</a></li>\r\n	<li><a href=\"http://www.aelfa.org/\" target=\"_blank\" rel=\"external\">Asociación Española de Logopedia, Foniatría y Audiología</a></li>\r\n	<li><a href=\"http://www.spaoyex.es/\" target=\"_blank\" rel=\"external\">Sociedad de Pediatría de Andalucía Occidental y ExtremaduraSociedad de Pediatría de Andalucía Occidental y Extremadura. SPAOYEX</a></li>\r\n	<li><a href=\"http://ifuna.info/\" target=\"_blank\" rel=\"external\">International Functional Association. IFUNA</a></li>\r\n	<li><a href=\"http://www.listerine.es/\" target=\"_blank\" rel=\"external\">Johnson &amp; Johnson</a></li>\r\n</ul>\r\n&nbsp;\r\n\r\n<a title=\"Listerine de Johnson&amp;Johnson\" href=\"http://bit.ly/1zZHtXq\" target=\"_blank\" rel=\"external\"><img src=\"http://seoii.es/resources/images/banner_listerine.gif\" alt=\"\" /></a>[/vc_column_text][/vc_column][/vc_row]','Enlaces de interés','','publish','closed','closed','','enlaces-de-interes','','','2016-03-15 23:25:15','2016-03-15 22:25:15','',0,'http://seoii.davidsantiago.net/?page_id=21',0,'page','',0),(24,1,'20