Encuentro Multidisciplinar','','publish','open','open','','publicacion-en-la-gaceta-dental-sobre-el-vii-encuentro-multidisciplinar','','','2010-03-20 00:00:00','2010-03-20 00:00:00','',0,'http://seoii.davidsantiago.net/2010/03/20/publicacion-en-la-gaceta-dental-sobre-el-vii-encuentro-multidisciplinar/',0,'post','',0),(52,1,'2010-03-20 00:00:00','2010-03-20 00:00:00','<p>El pasado 20 de marzo tuvo lugar en Sevilla el VII Encuentro Multidisciplinar e Interprofesional de la Sociedad Española de Odontología Infantil Integrada (SEOII), la Sociedad Española de Pediatría Extrahospitalaria y Atención primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). Esta cita anual reunió a 136 asistentes, entre los que hubo odontólogos y estomatólogos, pero también pediatras, psicólogos, foniatras y fisioterapeutas.</p> <p>El acto estuvo inaugurado por el doctor Pedro Bullón Fernández, decano de la Facultar de Odontología de Sevilla.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en Maxillaris sobre el VII Encuentro Multidisciplinar','','publish','open','open','','publicacion-en-maxillaris-sobre-el-vii-encuentro-multidisciplinar','','','2010-03-20 00:00:00','2010-03-20 00:00:00','',0,'http://seoii.davidsantiago.net/2010/03/20/publicacion-en-maxillaris-sobre-el-vii-encuentro-multidisciplinar/',0,'post','',0),(53,1,'2008-03-28 00:00:00','2008-03-28 00:00:00','<p>Los días 26, 27 y  28 de marzo se celebró en Granada el VI&#160;Congreso Nacional de la  Sociedad Española de Odontología  Infantil Integrada (SEOII), bajo la presencia de la doctora Mercedes Gálvez Jiménez.</p> <p>El número de asistentes al congreso rondó los 150 profesionales, la mayoría de ells españoles, aunque también hubo entre los ponentes y congresistas doctores de Portugal, Argentina, Brasil, Italia o México. Junto a los dontólogos y estomatólogos, el la cita participaron otros profesionales sanitarios como pediatras, fisioterapeutas, otorrinolaringólogos o kinesiólogos.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en Maxillaris sobre el VI Congreso Nacional','','publish','open','open','','publicacion-en-maxillaris-sobre-el-v-encuentro-multidisciplinar','','','2008-03-28 00:00:00','2008-03-28 00:00:00','',0,'http://seoii.davidsantiago.net/2008/03/28/publicacion-en-maxillaris-sobre-el-v-encuentro-multidisciplinar/',0,'post','',0),(54,1,'2008-03-28 00:00:00','2008-03-28 00:00:00','<p>El Hotel Abades de  Granada ha albergado, durante los días 26, 27 y 28 de marzo, la ceberación&#160; se celebró del VI&#160;Congreso Nacional de la Sociedad Española de Odontología  Infantil Integrada (SEOII) y dentro del mismo la habitual Reunión SEOII-SEPEAP.</p> <p>Considerado de alto nivel cintífico por la Agencia de Acreditación Nacional, la Universidad de Sevilla y la Facultad de Medicina, Odontologóa y Fisioterapia de la Universidad de Granada, así como por otras instituciones como la COnsejería de Innovación, Ciencia y Empresa de la Junta de Andalucía, este congreso constituyó una verdadera puesta al día de los temas más actuales de la odontología en el niño.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en la Gaceta Dental sobre el VI Congreso Nacional','','publish','open','open','','noticia-4','','','2008-03-28 00:00:00','2008-03-28 00:00:00','',0,'http://seoii.davidsantiago.net/2008/03/28/noticia-4/',0,'post','',0),(55,1,'2008-03-27 00:00:00','2008-03-27 00:00:00','<p>Los días 26, 27 y 28 de marzo se celebró, en el Hotel Abades de Granada, el VI&#160;Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII) y la habitual Reunión SEOII-SEPEAP.</p> <p>El congreso constituyó una verdadera puesta al día de los temas más actuales de la odontología en el niño.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en El Dentista sobre el VI Congreso Nacional','','publish','open','open','','publicacion-en-el-dentista-sobre-el-vi-congreso','','','2008-03-27 00:00:00','2008-03-27 00:00:00','',0,'http://seoii.davidsantiago.net/2008/03/27/publicacion-en-el-dentista-sobre-el-vi-congreso/',0,'post','',0),(56,1,'2008-05-01 00:00:00','2008-05-01 00:00:00','<p>Con una participación de más de 200 asistentes, en el Centro Cultural \"Cajasol\" de Sevilla, se celebró el 8 de marzo de 2008, el&#160; V Encuentro Multidisciplinar de Odontología Infantil Integrada y   Pediatría Extrahospitalaria y Atención Primaria.</p> <p>Con este motivo, la SEOII quiere comunicar y presentar, en primer lugar, sus más sinceras disculpas a todos aquellos profesionales y estudiantes que, pese a haberlo solicitado, no pudieron ser admitidos en este encuentro debido a lo limitado del aforo.</p> <p>El alto nivel científico del evento fue avalado con la concesión por la Universidad de Sevilla y la Agencia Nacional de Acreditación con Créditos de Libre Configuración y de Formación COntinuada respectivamente.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en prensa sobre el V Encuentro Multidisciplinar','','publish','open','open','','publicacion-en-prensa-sobre-el-v-encuentro-multidisciplinar','','','2008-05-01 00:00:00','2008-05-01 00:00:00','',0,'http://seoii.davidsantiago.net/2008/05/01/publicacion-en-prensa-sobre-el-v-encuentro-multidisciplinar/',0,'post','',0),(57,1,'2008-05-01 00:00:00','2008-05-01 00:00:00','<p>El V Encuentro Multidisciplinar de Odontología Infantil Integrada y  Pediatría Extrahospitalaria y Atención Primaria, celebrado el pasado 8 de marzo en el centro cultural Cajasol de Sevilla, registró una participación superior a 200 personas.</p> <p>El límite del adoro impidió que más de 60 profesionales y estudiantes pudieran asistir a este acto, pese a haberlo solicitado, por lo que la Sociedad Española de Odontologóa Infantil Integrada (SEOII) presenta sus disculpas.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en Maxillaris sobre el V Encuentro Multidisciplinar','','publish','open','open','','publicacion-en-maxillaris-sobre-el-v-encuentro-multidisciplinar-2','','','2008-05-01 00:00:00','2008-05-01 00:00:00','',0,'http://seoii.davidsantiago.net/2008/05/01/publicacion-en-maxillaris-sobre-el-v-encuentro-multidisciplinar-2/',0,'post','',0),(58,1,'2008-05-02 00:00:00','2008-05-02 00:00:00','<p>La afluencia de superó tanto las expectativas de los organizadores como la capacidad del recinto.</p> <p>Con la participación de más de 200 asistentes, en el Centro Cultural \"Cajasol\" de la ciudad de Sevilla, se celebró, el día 8 de marzo de 2008, el <strong>V Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria.</strong></p> <p>El alto nivel científico del evento fue avalado con la concesión por la Universidad de Sevilla y la Agencia Nacional de Acreditación con Créditos de Libre Configuración y de Formación Continuada repectivamente.</p> <p>Continuar leyendo desde el archivo PDF adjunto</p>','Publicación en la Gaceta Dental sobre el V Encuentro Multidisciplinar','','publish','open','open','','publicacion-sobre-el-v-encuentro-v-encuentro-multidisciplinar-en-la-gaceta-dental','','','2008-05-02 00:00:00','2008-05-02 00:00:00','',0,'http://seoii.davidsantiago.net/2008/05/02/publicacion-sobre-el-v-encuentro-v-encuentro-multidisciplinar-en-la-gaceta-dental/',0,'post','',0),(59,1,'2008-09-01 00:00:00','2008-09-01 00:00:00','<p>Estimado  amigo y compañero:</p> <p>Como miembro que eres de la SEOII es para nosotros   verdadera satisfacción poderte comunicar que, entre todas las Sociedades   Odontológicas, la SPA Dental Practice &amp; JADA decidió conceder su  premio a  la Sociedad Odontológica Científica más destacada durante el  año 2008 a nuestra SEOII.</p> <p>Este premio, que se determina por votación anónima de   profesionales de la Odontología, fue recogido el pasado día 19 de  Junio de 2009  por nuestra Presidenta,&#160; Antonia  Domínguez Reyes en el  hotel Riz de Madrid, la cual, en nombre de todos, dio las  gracias por  dicha concesión, haciendo hincapié en la labor que sus miembros   realizan en pro de la salud bucodental y general del niño. Un niño visto  de  forma integral, en el que muchas veces son necesarios los  tratamientos  multidisciplinares; razón por la que en nuestros  Congresos, Reuniones y  Encuentros, se estimula siempre la creación de  equipos multidisciplinares con  lenguaje común.</p> <p>Aprovecho la ocasión para, haciéndote&#160; participe de este premio como socio que eres  de la SEOII.</p> <p>Con un afectuoso  saludo:<br /> &#160; <strong>- Antonia Domínguez Reyes, </strong>Presidenta de la SEOII<br /> &#160; <strong>- Antonio F. Galán González</strong>, Secretario de la SEOII</p>','Premio JADA concedido a la SEOII por la SPA Dental Practice & JADA','','publish','open','open','','noticia-9','','','2016-03-02 18:03:30','2016-03-02 17:03:30','',0,'http://seoii.davidsantiago.net/2008/09/01/noticia-9/',0,'post','',0),(60,1,'2007-03-14 00:00:00','2007-03-14 00:00:00','<p>La Sociedad Espalola de Odontologóa Infantil Integrada (SEOII) celebró en Sevilla, entre los días 14 y 17 de marzo, su primer congreso internacional y la quinta edición nacional.</p> <p>Según sus organizadores, el encuentro no sólo constituyó un completo éxtio de participación y asistencia, sino también una intensa puesta al día de los temas mas actuales de la odontologóa en el niño.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en Maxillaris sobre el I Congreso Internacional','','publish','open','open','','publicacion-en-maxillaris-sobre-el-i-congreso-internacional','','','2007-03-14 00:00:00','2007-03-14 00:00:00','',0,'http://seoii.davidsantiago.net/2007/03/14/publicacion-en-maxillaris-sobre-el-i-congreso-internacional/',0,'post','',0),(61,1,'2007-03-14 00:00:00','2007-03-14 00:00:00','<p>Próximamente, del 14 al 17 de marzo de 2007, tendrá lugar en Sevilla la celebración del I&#160;Congreso Internacional y V Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII), y al mismo tiempo, la IV Reunión SEOII-SEPEAP.</p> <p>Una reunión de odontólogos y pediatras que con la colaboración de todos, resulta ya un clásico en Sevilla.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación 1 en prensa sobre el I Congreso Internacional','','publish','open','open','','publicacion-en-prensa-sobre-el-i-congreso-internacional','','','2007-03-14 00:00:00','2007-03-14 00:00:00','',0,'http://seoii.davidsantiago.net/2007/03/14/publicacion-en-prensa-sobre-el-i-congreso-internacional/',0,'post','',0),(62,1,'2007-03-14 00:00:00','2007-03-14 00:00:00','<p>Próximamente, del 14 al 17 de marzo de 2007, tendrá lugar en Sevilla  la celebración del I&#160;Congreso Internacional y V Nacional de la Sociedad  Española de Odontología Infantil Integrada (SEOII), y al mismo tiempo,  la IV Reunión SEOII-SEPEAP.</p> <p>Una reunión de odontólogos y pediatras que con la colaboración de todos, resulta ya un clásico en Sevilla.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación 2 en prensa sobre el I Congreso Internacional','','publish','open','open','','publicacion-en-prensa-2-sobre-el-i-congreso-internacional','','','2007-03-14 00:00:00','2007-03-14 00:00:00','',0,'http://seoii.davidsantiago.net/2007/03/14/publicacion-en-prensa-2-sobre-el-i-congreso-internacional/',0,'post','',0),(63,1,'2007-03-14 00:00:00','2007-03-14 00:00:00','<p>Entre los días 14 a 17 de marzo tuvo lugar en el Hotel NH Central de Convenciones de Sevilla el I COngreso Internacional / V Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII).</p> <p>Al mismo tiempo se celebró la habitual Reunión SEOII-SEPEAP de responsabilidad y sostenibilidad.</p> <p>Este congreso, considerado de alto nivel científico, no sólo cosntituyó un total y completo éxito de participación y asistencia, sino una verdadera puesta al día de los temas más actuales de la odontología.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación 3 en prensa sobre el I Congreso Internacional','','publish','open','open','','publicacion-3-en-prensa-sobre-el-i-congreso-internacional','','','2007-03-14 00:00:00','2007-03-14 00:00:00','',0,'http://seoii.davidsantiago.net/2007/03/14/publicacion-3-en-prensa-sobre-el-i-congreso-internacional/',0,'post','',0),(64,1,'2007-03-14 00:00:00','2007-03-14 00:00:00','<p>Del 14 al 17 de marzo, tuvo lugar en Sevilla el I Congreso Internacional y V Nacional de la  Sociedad Española de Odontología Infantil Integrada (SEOII) y, al mismo tiempo, se celebró la Reunión SEOII-SEPEAP.</p> <p>Este congreso considerado de alto nivel científico por la Agencia de Acreditación Nacional, la Universidad de Sevilla, la Facultad de Odontología de la Universidad de Granada y la Consejería de Innovación, Ciencia y Emnpresa de la Junta de Andalucía, no sólo  cosntituyó un total y completo éxito de participación y asistencia, sino  una verdadera puesta al día de los temas más actuales de la  odontología.</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación 4 en prensa sobre el I Congreso Internacional','','publish','open','open','','publicacion-4-en-prensa-sobre-el-i-congreso-internacional','','','2007-03-14 00:00:00','2007-03-14 00:00:00','',0,'http://seoii.davidsantiago.net/2007/03/14/publicacion-4-en-prensa-sobre-el-i-congreso-internacional/',0,'post','',0),(65,1,'2011-01-07 00:00:00','2011-01-07 00:00:00','<p>El II Congreso de la SEOII centró sus debates en la atención bucondental integral del niño.</p> <p>Uno de los objetivos del congreso es la necesidad de crear equipos multidisciplinares de salud para el tratamiento de malformaciones y deformidades faciales en la infancia.</p> <p>[Continuar leyendo en el documento escaneado...]</p>','Publicación en La Voz de Galicia sobre el II Congreso','','publish','open','open','','publicacion-en-la-voz-de-galicia-sobre-el-ii-congreso','','','2016-03-02 18:03:46','2016-03-02 17:03:46','',0,'http://seoii.davidsantiago.net/2011/01/07/publicacion-en-la-voz-de-galicia-sobre-el-ii-congreso/',0,'post','',0),(66,1,'2001-10-10 00:00:00','2001-10-10 00:00:00','<p>El compromiso de Antonia Domínguez con el trabajo que desempeña en la Universidad de Sevilla como profesora en la asignatura Odontología Infantil y Ortodoncia Integrada, le ha llevado a presidir el pasado fin de semana el I Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada.</p> <p>Este encuentro de expertos ha permitido a Antonia Domínguez exponer su teoría en el tratamiento bucodental en la infancia.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación sobre el I Congreso Nacional','','publish','open','open','','publicacion-en-diario-de-sevilla-sobre-el-i-congreso-nacional','','','2016-03-02 18:03:51','2016-03-02 17:03:51','',0,'http://seoii.davidsantiago.net/2001/10/10/publicacion-en-diario-de-sevilla-sobre-el-i-congreso-nacional/',0,'post','',0),(67,1,'2001-09-15 00:00:00','2001-09-15 00:00:00','<p>Los días 5 y 6 de octubre tendrá lugar en el Colegio de Médicos de Sevilla el I Congreso Nacional de la Sociedad Española de Odontología Intantil Integrada, de la que es presindeta Antonia Domínguez Reyes.</p> <p>La doctora Domínguez Reyes, junto a un grupo de profesionales médicos pretende, entre otras cuestiones, que la salud del niño sea la adecuada y que, cuando deban permanecer en los hospitales con tratamientos prolongados, cuenten con un Servicio de Odontología.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en Diario de Sevilla sobre el I Congreso Nacional','','publish','open','open','','publicacion-en-diario-de-sevilla-sobre-el-i-congreso-nacional-2','','','2016-03-02 18:03:52','2016-03-02 17:03:52','',0,'http://seoii.davidsantiago.net/2001/09/15/publicacion-en-diario-de-sevilla-sobre-el-i-congreso-nacional-2/',0,'post','',0),(68,1,'2003-11-28 00:00:00','2003-11-28 00:00:00','<p>Del 6 al 8 de noviembre se celebró el III Congreso Anual de la Sociedad Española de Odontología Infantil Integrada (SEOII), en el hotel Alimara, de la Escuela de Hostelería y Turismo, centro adscrito a la Universidad de Barcelona.</p> <p>El comité organizador estuvo presidido por el doctor José M. Ustrell, vicepresidente de la Sociedad, y el comité científico por la doctora María Cristina Manzanares, ambos profesores titulares de la Universidad de barcelona.</p> <p>Colaboraron también profesores asociados y alumnos de la misma universidad y que forma parte de la asignatura Clínica Odontológica Integrada Infantil.</p> <p>Continuar leyendo desde el archivo JPG adjunto.</p>','Publicación en Maxillaris sobre el III Congreso Nacional','','publish','open','open','','publicacion-en-maxillaris-sobre-el-iii-congreso-nacional','','','2016-03-02 18:03:54','2016-03-02 17:03:54','',0,'http://seoii.davidsantiago.net/2003/11/28/publicacion-en-maxillaris-sobre-el-iii-congreso-nacional/',0,'post','',0),(69,1,'2003-11-22 00:00:00','2003-11-22 00:00:00','<p>En los días 6 al 8 de noviembre se celebró el Congreso Anual de la Sociedad Española de Odontologóa Infantil Integrada (SEOII), en el Hotel Alimara, de la Escuela de Hostelería y Turismo, centro adscripto a la Universidad de Barcelona.</p> <p>El Comité organizador estuvo presidido por los doctores José M. Ustrell, vicepresidente de la Sociedad y el Comité científico, y por María Cristina Manzanares, ambos profesores titulares de la Universidad de Barcelona</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en la Gaceta Dental sobre el III Congreso Nacional','','publish','open','open','','publicacion-en-la-gaceta-dental-sobre-el-iii-congreso-nacional','','','2016-03-02 18:03:57','2016-03-02 17:03:57','',0,'http://seoii.davidsantiago.net/2003/11/22/publicacion-en-la-gaceta-dental-sobre-el-iii-congreso-nacional/',0,'post','',0),(70,1,'2011-05-05 00:00:00','2011-05-05 00:00:00','<p>Los días <strong>17 al 20 de febrero de 2011</strong> se celebró el <a href=\"http://seoii.es/es/73\"><strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada</strong></a><strong>, </strong>publicamos las Conclusiones del congreso.</p> <p><img alt=\"\" src=\"http://seoii.es/admin/index.php/resources/view/246\" /></p> <p>El evento estuvo constituido por cuatro Mesas Redondas y cuatro  Talleres dedicados a Odonto-Estomatólogos y otros profesionales de las  Ciencias de la Salud.</p> <p>Dentro de la Mesa Redonda, <i><b>“Tratamiento del niño en crecimiento y desarrollo. Visión global”</b></i>,  (coordinada por la Dra. Domínguez Reyes, Profa Titular de Odontología  Infantil y Ortodoncia Integrada en de la U. de Sevilla) la Dra. Marie-  Josèphe Deshayes, Médico Estomatólogo y Paleontóloga, expuso dos temas: <i>Crecimiento craneal: vínculos con la dentición primaria; y Tratamientos precoces antes de los seis años de edad.</i></p> <p>Con ambas ponencias pudimos comprender mejor las fuerzas que dentro  de la base craneal conducen el desarrollo facial hacia oclusiones  específicas; y además, ver cómo, diagnosticando en el recién nacido  pequeñas asimetrías faciales, se podía pronosticar y prevenir futuras  asimetrías faciales de crecimiento y desórdenes en la ATM.</p> <p>El Dr.Yves Castaing Haerïng, Lcdo. en Fisioterapia y Doctor en  Osteopatía por la Universidad de Medicina  de Montreal y Lyón,  desarrolló la ponencia <i>“Osteopatía Craneal. Su influencia sobre la Oclusión durante el Crecimiento y Desarrollo en el Niño”.</i>  En ella expuso que, la oclusión y, en general, la Odontología infantil,  han evolucionado hasta tal punto, que, hoy, la misma, no puede  considerarse separada del contexto general del cuerpo.</p> <p>La conferencia <i>“</i><i>Odontología en el niño: Futuro Funcional</i><i>”</i>,  del Dr. Michael Gorbonos, Doctor of Dental Medicine DMD Medical  University of Southen Africa, Medunsa, Rep. of South Africa y profesor  visitante de Ortodoncia en Universidad Autónoma del Estado de Mexico, no  solo señaló que la terapia funcional hace posible tra­tar problemas de  manera más fácil y racional, sino que destacó la necesidad de crear una  plataforma internacional para la do­cumentación, educación y  conservación de las técnicas ortopédicas funcionales.</p> <p><b>La Segunda mesa redonda bajo el epígrafe general </b><i><b>de “La alimentación en el niño y sus repercusiones clínicas”, </b></i>estuvo constituida por los Drs. Juán Madrid Conesa; Cristina Cardoso Silva; Leopoldo Becerra Posada y Concepción López Soler.</p> <p>Moderada por la Profa. Elena Barbería (Catedrático de Odontopediatría  en la U. Complutense de Madrid) y la Dra. Margarita Varela Morales  (Jefe de la Unidad de Ortodoncia en la Fundación Jiménez Díaz de  Madrid), los ponentes desarrollaron, respectivamente, “<i>Alimentar bien  a nuestros hij@s: una asignatura pendiente”; “Alimentación y Nutrición:  importancia de la salud bucal de los niños”;</i><b> </b><i>“Prevención  de la caries desde el nacimiento. Generación Caries Cero”; y “Aspectos  Psicológicos de la Odontología infantil y adolescente”</i></p> <p>En esta mesa redonda se recogieron los diferentes aspectos de la  alimentación actual en los niños, las causas de la mala alimentación  actual y las formas de corregir y mejorarla, una magnífica, clara y  amena exposición del Dr. Madrid, en la que también mostró como se puede  enseñar a comer correctamente a la población infantil mediante juegos.  La Dra. Cardoso señaló que los cuidados de la salud oral deben comenzar  ya desde el embarazo con educación a las futuras madres y su entorno.</p> <p>El Dr. Becerra (Odontopediatra por la U. de los Ángeles) expuso, por  primera vez en España, su más que interesante iniciativa de la Cartilla  odontológica para el bebé con objeto de obtener generaciones caries  cero; y la Dra. Soler, los distintos aspectos y manifestaciones de la  conducta infantil en el gabinete dental, aportando estrategias  racionales para el control de la conducta y comprensión psicológica de  las distintas situaciones.</p> <p>Moderada por los Drs. Luis A. Bravo (Prof. Titular de Ortodoncia en  la U. Murcia) y el Prof. Joaquín de Nova (Titular de Odontopediatría en  la U. Complutense de Madrid) tuvo lugar la tercera mesa redonda bajo el  título general de “<i><b>Abordaje Odontológico-Clínico en situaciones de compromiso.</b></i></p> <p>Los “<i>Traumatismos en dentición temporal y sus efectos en la dentición definitiva”</i> fueron expuestos por el Dr. García Ballesta de la Universidad de Murcia; la “<i>Revisión de la Oligodoncia no sindrómica” </i>por el Dr. Arturo Sánchez Pérez; “<i>En busca del Equilibrio estético funcional” </i>por el Dr<i>. A</i>ntonio Matos da Fonseca, Cirujano Maxilo-Facial en la U. de Lisboa y<b> </b>el “<i>Presente y futuro de la imagen. Imagen 3D en Odontología”</i> por el Dr. Vicente Hernández Soler.</p> <p>Las cuatro ponencias, de alto nivel científico, constituyeron una  total puesta al día de los diversos temas y los diferentes agentes de  distinta naturaleza que pueden desviar el curso del crecimiento  cráneo-facial en el niño.</p> <p>La cuarta y última Mesa Redonda, <i><b>Relaciones Clínicas Sistema Estomatognático / vías aéreas</b></i><b>”</b> fue desarrollada por la Dra. Yolanda Cerezo del Olmo<b>,</b> Especialista en Pediatría, que disertó sobre las<b> </b><i>“Patologías más frecuentes en el niño que pueden implicar alteraciones del sistema estomatognático”; </i>la Dra. Concepción Maeztu Sardiña, que habló sobre los <i>“Trastornos respiratorios del sueño (SAOS) y su abordaje Neurofisiológico en niños y adolescentes”.</i></p> <p>Con “<i>Ortodoncia y ORL infantil. La importancia de trabajar en equipo”</i>,<i> el Dr.</i><b> </b>Carlos  Escobar Sánchez (Otorrinolaringólogo Prof. en la Facultad de Murcia)  señaló las íntimas relaciones que puede tener la ortodoncia y las  afecciones otorrinolaringológicas y el<i> </i>Prof. Juan Cobo Planas, (Catedrático de Ortodoncia en la Universidad de Oviedo) que disertó sobre “<i>Ortopedia Maxilar y Vías Aéreas Superiores”. En esta </i>  ponencia, expuso las relaciones y efectos de las afecciones de las vías  aéreas superiores sobre el desarrollo normal y  posibles anomalías del  Sistema Estomatognático, destacando que el trabajo multidisciplinar e  interprofesional, en muchas ocasiones, era más que necesario.</p> <p>Esta mesa redonda fue moderada por los Drs. Ustrell, Prof. Titular de  Ortodoncia. U.de Barcelona,  y el Prof. Oñate, Prof. Titular de  Pacientes Especiales en la U. de Murcia.</p> <p>Tras cada mesa redonda se estableció un animado coloquio entre  moderadores ponentes y congresistas en los que pudo detectarse, no solo  la alta participación de los asistentes, sino el gran interés despertado  por los temas del Congreso y sus ponentes.</p> <p><b>Los cuatro Talleres </b>dirigidos a Odonto-Estomatólogos y otros profesionales en ciencias de la salud fueron:</p> <p>“<i><b>Taller de  Relación Oclusión- ATM según la Rehabilitación Neuroclusal”, </b></i>impartido por la Dra.Dª. Mercedes Gálvez Jiménez</p> <p>“<i><b>Taller De Disfunción Del Aparato Masticatorio: Diagnóstico Diferencial Oclusal- Osteopático-Visual”</b></i><b> </b>impartido  por Dra. Amaia Iturburu Aranzabal y  D. Donato Martínez Mateo.</p> <p>“<i><b>Taller De Intervención Logopédica Funcional En Los Desordenes Orales”, </b></i>impartido por la Licenciada Sonia Muñoz Rico</p> <p>“<i><b>Taller De Salud Oral En El Paciente En Crecimiento”, </b></i>impartido por<i><b> </b></i>la Dra<i><b>.</b></i></p> <p>Ivanna Camps Pereperez.</p> <p>Estos talleres a los que asistieron diferentes profesionales de las  Ciencias de la Salud (odontólogos, fisioterapeutas, pediatras etc,)  pusieron al alcance de todos los participantes formas prácticas,  distintas maniobras y técnicas que permitían abordar al paciente  infantil como un todo, de forma integral y en equipo multidisciplinar.</p> <p>En el Acto de Clausura, tras unas palabras de la Presidenta de la  SEOII, se comunicó que la Sede del VIII Congreso Nacional sería Madrid y  su organización correspondería a la Dra. Rosa Mourelles, Profesora de  la Facultad de Odontología de la U. Complutense de Madrid.</p> <p>Así mismo comunicó el Hermanamiento de nuestra Sociedad con la International Functional Assosiation (IFUNA).</p> <p>La SEOII y el Comité Organizador del Congreso agradecieron a ponentes  y congresistas su asistencia y activa participación; a las  Instituciones su eficaz apoyo, a los Patrocinadores  Johnson-Johnson e  Imper-Ortho, su inestimable colaboración en la realización de este  importante evento científico y a los colaboradores, Kin, Ripano,  Osteoplac, Maxillaris y Gaceta Dental  su contribución.</p> <p>&#160;Para ver mas informacion del congreso y la galeria de fotos:  <a href=\"http://seoii.es/es/73\"><strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada</strong></a></p>','Conclusiones del II Congreso Internacional, VII Congreso Nacional de Odontología Infantil Integrada, Murcia 2011','','publish','open','open','','conclusiones-del-ii-congreso-internacional-vii-congreso-nacional-de-odontologia-infantil-integrada-murcia-2011','','','2016-03-02 18:04:01','2016-03-02 17:04:01','',0,'http://seoii.davidsantiago.net/2011/05/05/conclusiones-del-ii-congreso-internacional-vii-congreso-nacional-de-odontologia-infantil-integrada-murcia-2011/',0,'post','',0),(71,1,'2011-03-24 00:00:00','2011-03-24 00:00:00','<p>En el pasado<a href=\"http://seoii.es/es/73\"> 2º Congreso Internacional 7º Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII)</a> tuvo lugar la firma de un Convenio-Hermanamiento entre la SEOII y la International Functional Assosiation (IFUNA); sociedad internacional que acoge el ideario de la SEOII como un “avance inestimable de la Odontología en el niño”.</p> <p>Esta firma, llevada a cabo tras año y medio de conversaciones por la Presidencia de ambas Sociedades,  Antonia Domínguez Reyes y Michel Gorbonos, respectivamente, no solo supone el establecimiento de una mayor capacidad investigadora para ambas sociedades, sino una mayor posibilidad para los asociados de la SEOII, los cuales tendrán la oportunidad de participar en un más amplio programa formativo.</p> <p>Ambas organizaciones se han comprometido a crear líneas de investigación conjuntas, colaborar en los respectivos Congresos y Reuniones científicas y establecer programas de formación con la posibilidad de obtener reconocimientos internacionales.</p>','Convenio de hermanamiento y colaboración Sociedad Española de Odontología Infantil Integrada (SEOII) - International Functional Association (IFUNA)','','publish','open','open','','convenio-de-hermanamiento-y-colaboracion-sociedad-espanola-de-odontologia-infantil-integrada-seoii-international-functional-association-ifuna','','','2016-03-02 18:04:04','2016-03-02 17:04:04','',0,'http://seoii.davidsantiago.net/2011/03/24/convenio-de-hermanamiento-y-colaboracion-sociedad-espanola-de-odontologia-infantil-integrada-seoii-international-functional-association-ifuna/',0,'post','',0),(72,1,'2011-01-20 00:00:00','2011-01-20 00:00:00','<p>La Dra. Antonia Domínguez es licenciada en Medicina y CIrugía por la Facultad de Medicina de la Universidad de Sevilla, especialista en Estomatología y Doctor en Medicina y CIrugía por este mismo centro, además de médico de empresa y médico por el Ministerio de Sanidad. Antonia Domínguez es profesora titular de la asignatura Odontología Infantil y Odontología Integrada, directora del Título de Experto Universitario en Tratamiento Global en la Universodad de Sevilla.</p> <p>Por su parte, la Dra. María Eugenia Cabaña es Odontóloga por la Universidad Nacional de Córdoba (Argentina), Licenciada en Odontología por la Universidad de Granada (España), Diploma Universitario de Ortodoncia y Ortopedia Dentofacial en la Universidad Paul Sabater...</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en la Gaceta Dental (Especial Congresos) sobre el II Congreso Internacional, VII Nacional','','publish','open','open','','publicacion-en-la-gaceta-dental-sobre-el-ii-congreso-internacional-vii-nacional','','','2016-03-02 18:04:05','2016-03-02 17:04:05','',0,'http://seoii.davidsantiago.net/2011/01/20/publicacion-en-la-gaceta-dental-sobre-el-ii-congreso-internacional-vii-nacional/',0,'post','',0),(73,1,'2011-04-13 00:00:00','2011-04-13 00:00:00','<p>La ciudad de Murcia acogió, entre los días 17 y 20 de febrero, el 2º Congreso Internacional y 7º Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII), un encuentro multidisciplinar e interprofesional, que ha abordado como tema general \"El niño en crecimiento y desarrollo\".</p> <p>En este sentido, Antonia Domínguez, presidenta de la SEOII, ha señalado que \"el niño, como ser dinámico que está en continuo crecimiento y desarrollo en todos sus aspectos, requiere de una visión integrada e integradora de la salud a estas edades\".</p> <p>Continuar leyendo desde el archivo PDF adjunto.</p>','Publicación en El Dentista sobre el II Congreso Internacional, VII Nacional, Murcia 2011','','publish','open','open','','publicacion-en-la-maxillaris-sobre-el-ii-congreso-internacional-vii-nacional-murcia-2011','','','2016-03-02 18:04:05','2016-03-02 17:04:05','',0,'http://seoii.davidsantiago.net/2011/04/13/publicacion-en-la-maxillaris-sobre-el-ii-congreso-internacional-vii-nacional-murcia-2011/',0,'post','',0),(74,1,'2011-06-04 00:00:00','2011-06-04 00:00:00','<p><strong>El VII Encuentro Multidisciplinar de la SEOII aborda el maltrato infantil</strong></p> <p>Reunión de la Sociedad de Odontología Infantil Integrada, de la Sociedad de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y de la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX)</p> <p>El pasado 28 de mayo tuvo lugar en el Centro Cultural Cajasol de Sevilla el VIII Encuentro Multidisciplinar de Odontología Infantil Integrada (SEOII), Pediatría Extrahospitalaria y&#160;Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX).</p> <p>En esta ocasión, el tema monográfico, \"El maltrato infantil\", fue el nexo de unión para que los diferentes profesionales sanitarios, educadores, psocólogos y asesores técnicos de la COnsejería de Salud de la Junta de Andalucía, pusieron sobre la mesa el trabajo que se está realizando en este campo.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en El Dentista sobre el VIII Encuentro, Sevilla 2011','','publish','open','open','','publicacion-en-el-dentista-sobre-el-viii-encuentro-sevilla-2011','','','2016-03-02 18:04:09','2016-03-02 17:04:09','',0,'http://seoii.davidsantiago.net/2011/06/04/publicacion-en-el-dentista-sobre-el-viii-encuentro-sevilla-2011/',0,'post','',0),(75,1,'2011-05-20 00:00:00','2011-05-20 00:00:00','<p><strong>Convenio de hermanamiento y colaboración entre la SEOII y la International Functional Association</strong></p> <p>Durante el pasado VII COngreso Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII) tuvo lugar la firma de un convenio de hermanamiento entre dicha organización y la International Functional Association (IFUNA).</p> <p>Esta firma, llevada a cabo tras año y medio de conversaciones, no sólo supone el establecimiento de una mayor capacidad investigadora para ambas sociedades, sino una mayor posibilidad formativa para los asociados de la SEOII.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en Maxillaris sobre el hermanamiento SEOII / IFUNA','','publish','open','open','','publicacion-en-maxillaris-sobre-el-hermanamiento-seoii-ifuna','','','2016-03-02 18:04:10','2016-03-02 17:04:10','',0,'http://seoii.davidsantiago.net/2011/05/20/publicacion-en-maxillaris-sobre-el-hermanamiento-seoii-ifuna/',0,'post','',0),(76,1,'2011-05-10 00:00:00','2011-05-10 00:00:00','<p><strong>La Sociedad Española de Odontología Infantil Integrada reunió a destacados exponentes de la investigación, docencia y práctica clínica</strong></p> <p>Las conclusiones de esta reunión multidisciplinar, a la que acudieron más de 150 profesionales, dejaron claro aspectos que hoy en día cosntituyen la vanguardia en la atención del niño como ser dinámico que está en continuo crecimiento y desarrollo en todos sus aspectos.</p> <p>La ciudad de Murcia acogió el pasado febrero el II Congreso Internacional y VII Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII).</p> <p>Los más de 150 participantes tuvieron la oportunidad de conocer los últimos avances, teniendo acceso a una información de muy alto nivel científico y clínico de caracter multidisciplinar e interprofesional.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en Gaceta Dental sobre el II Congreso Internacional, Murcia 2011','','publish','open','open','','publicacion-en-gaceta-dental-sobre-el-ii-congreso-internacional-murcia-2011','','','2016-03-02 18:04:13','2016-03-02 17:04:13','',0,'http://seoii.davidsantiago.net/2011/05/10/publicacion-en-gaceta-dental-sobre-el-ii-congreso-internacional-murcia-2011/',0,'post','',0),(77,1,'2011-06-03 00:00:00','2011-06-03 00:00:00','<p>SEOII, SEPEAPy SPAOYEX</p> <p>Encuentro multidisciplinar en Sevilla para abordar el maltrato infantil</p> <p>EL pasado 28 de mayo tuvo lugar en el Centro cultural Cajasol de Sevilla el VIII Encuentro Multidisciplinar de Odontología Infantil Integrada (SEOII), Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX).</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Publicación en Gaceta Dental sobre el VIII Encuentro, Sevilla 2011','','publish','open','open','','publicacion-en-gaceta-dental-sobre-el-viii-encuentro-sevilla-2011','','','2016-03-02 18:04:19','2016-03-02 17:04:19','',0,'http://seoii.davidsantiago.net/2011/06/03/publicacion-en-gaceta-dental-sobre-el-viii-encuentro-sevilla-2011/',0,'post','',0),(78,1,'2011-07-08 00:00:00','2011-07-08 00:00:00','<p><strong>VIII&#160;Encuentro multidisciplinar para afrontar el maltrato infantil</strong></p> <p>El VIII&#160;Encuentro Multidisciplinar de la Sociedad Española Odontología Infantil Integrada (SEOII), la Sociedad Española de Pediatría xtrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX) se desarrolló el pasado 28 de mayo, en el Centro Cultural Cajasol de Sevilla.</p> <p>Continuar leyendo desde el archivo adjunto.</p>','Artículo publicado en Maxillaris sobre el VIII Encuentro, Sevilla 2011','','publish','open','open','','articulo-completo-publicado-en-maxillaris-sobre-el-viii-encuentro-sevilla-2011','','','2016-03-02 18:04:23','2016-03-02 17:04:23','',0,'http://seoii.davidsantiago.net/2011/07/08/articulo-completo-publicado-en-maxillaris-sobre-el-viii-encuentro-sevilla-2011/',0,'post','',0),(79,1,'2012-11-07 00:00:00','2012-11-07 00:00:00','<p>El pasado 6 de octubre en las nuevas instalaciones del Palacio de  Exposiciones y Congresos de Sevilla (FIBES) tuvo lugar el IX Encuentro&#160;  Multidisciplinar de Odontología Infantil Integrada (SEOII) Pediatría  Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de  Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). En esta  ocasión el encuentro tuvo como tema monográfico “Caries de la niñez  temprana: Abordaje y perspectiva multidisciplinar”&#160; y se desarrolló  dentro del XXVI Congreso Nacional de la SEPEAP y III Congreso  Internacional Hispano Luso de Pediatría Extra-Hospitalaria.</p> <p>Como en anteriores eventos, este Encuentro tuvo el reconocimiento de  la Agencia Nacional de Acreditación con 0,95 créditos de Formación  Continuada y de la Universidad Hispalense de Sevilla con 1 crédito de  Libre Configuración para los alumnos de pregrado.</p> <p>Con una amplia asistencia de 152 profesionales, comunicaciones y  numerosos alumnos, la mesa inaugural estuvo presidida por el Dr. D. José  Luís Bonal (Presidente de la SEPEAP), el Dr. D. Joaquín Ortiz Tardío  (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca  (Vicepresidente de la SAOYEX), el Dr Cristobal Coronel (Pediatra y  Presidente del XXVI Congreso de la SEPEAP) y la Dra. Dª Antonia  Domínguez Reyes, (Presidenta de la SEOII Ampliamente desarrollado por  diferentes profesionales de las Ciencias de la Salud, odontólogos,  estomatólogos, psicólogos y pediatras, todos coincidieron en señalar que  el hecho de que hoy, en nuestro medio, sigan viéndose niños con caries  en más de dos o tres superficies en dientes temporales recién  erupcionados, es clara indicación de la importante y alarmante  actualidad de este tema. Alarmante actualidad sobre todo si tenemos en  cuenta que pese a los avances y promociones en pos de la educación  sanitaria, la caries en la niñez temprana sigue mostrando una alta  frecuencia.</p> <p>Fueron ponentes en la Mesa Redonda las Dras. Isabel Colomer&#160; Ureña,  Montserrat Gómez de Terreros Guardiola, Rosario Gómez Cuadrado y  Patricia Gatón quienes, ante este panorama, analizaron&#160; la situación,  los&#160; factores contribuyentes a la misma, la genética, los estilos de  vida, dieta y hábitos, algo para lo que es indispensable aplicar  metodologías y protocolos de actuación conjunta antes de los tres años  de edad, incluso desde antes del nacimiento con educación a las  embarazadas y entorno familiar.</p> <p>Tras las distintas exposiciones, todos los asistentes constituyeron  un interesante foro con importante participación activa. Un foro de  preguntas, respuestas y discusiones donde se pudo aprender, debatir y  consensuar los distintos aspectos y visiones multidisciplinares de este  actual y acuciante problema que demanda la implicación de todos.</p> <p>El que participaran numerosos alumnos de pre y post-grado de las  distintas Facultades de nuestro país puso de relieve el cada vez mayor  interés que suscita dentro y fuera de nuestras fronteras la tendencia a  ver al niño como un todo bajos todos sus aspectos: biológicos, psíquicos  y sociales; conceptos que la SEOII viene desarrollando desde su  fundación.</p> <p>La conferencia de clausura estuvo a cargo Dr. D. Ignacio Gómez de Terreros Sánchez el cual centró su intervención en <strong>“La Familia ante&#160; el Reto Del Siglo XXI</strong>”</p> <p>La Dra. Domínguez Reyes, tras señalar que el próximo Congreso  Nacional de la SEOII tendrá lugar en Madrid en&#160; marzo de 2013 (presidido  por&#160; la Dra. Mourelle) agradeció a todos, ponentes, Universidades,  Agencia de Acreditación y asistentes, su activa participación; a la  empresa Jonson &amp; Johnson su&#160; patrocinio y a GC- Ibérica Dental  Product y&#160; Ripano su colaboración. Palabras tras las cuales, el Drs. Del  Pozo Machuca, Ortiz Tardío y&#160; Gómez de Terreros dieron por clausurado  el IX Encuentro Multidisciplinar de la SEOII /SEPEAP/SPAOYEX.</p>','Conclusiones del IX Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria, Sevilla 2011','','publish','open','open','','conclusiones-del-ix-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-sevilla','','','2016-03-02 18:04:25','2016-03-02 17:04:25','',0,'http://seoii.davidsantiago.net/2012/11/07/conclusiones-del-ix-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-sevilla/',0,'post','',0),(82,1,'2016-03-02 18:03:30','2016-03-02 17:03:30','','3','','inherit','open','closed','','3','','','2016-03-02 18:03:30','2016-03-02 17:03:30','',0,'http://seoii.davidsantiago.net/wp-content/uploads/2016/03/3.plain;%20charset=UTF-8',0,'attachment','image/jpeg',0),(83,1,'2016-03-02 18:03:31','2016-03-02 17:03:31','','4','','inherit','open','closed','','4','','','2016-03-02 18:03:31','2016-03-02 17:03:31','',59,'http://seoii.davidsantiago.net/wp-content/uploads/2016/03/4.plain;%20charset=UTF-8',0,'attachment','image/jpeg',0),(85,1,'2016-03-02 18:03:46','2016-03-02 17:03:46','','168','','inherit','open','closed','','168','',''