idsantiago.net/eventos/categorias/',0,'page','',0),(399,1,'2016-03-14 15:49:21','2016-03-14 14:49:21','CONTENTS','Etiquetas','','publish','closed','open','','etiquetas','','','2016-03-14 15:49:21','2016-03-14 14:49:21','',396,'http://seoii.davidsantiago.net/eventos/etiquetas/',0,'page','',0),(400,1,'2016-03-14 15:49:21','2016-03-14 14:49:21','CONTENTS','Mis Reservas','','publish','closed','open','','mis-reservas','','','2016-03-14 15:49:21','2016-03-14 14:49:21','',396,'http://seoii.davidsantiago.net/eventos/mis-reservas/',0,'page','',0),(470,1,'2010-07-21 12:41:06','2010-07-21 10:41:06','<ul>   <li>Concedido <strong>1,17 créditos de Formación  Continuada y 1 Crédito de Libre Configuración</strong><strong><a target=\"_blank\" href=\"http://www.seoii.com/PAGINA%5FANTIGUA/nueva/pdf/inscripcionVII.pdf\"><br />   </a></strong></li>   <li><span class=\"bigredtext\">Solicitados Créditos de Formación                 Continuada y de Libre Configuración.</span></li> </ul> <p>&#160;El pasado 20 de Marzo tuvo lugar, en Sevilla, el ya clásico y anual Encuentro Multidisciplinar e Interprofesional&#160; de la&#160; Sociedad Española de Odontología Infantil integrada (SEOII); Sociedad Española de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). Un Encuentro Multidisciplinar&#160; que, como en años anteriores volvió a constituir un verdadero éxito de participación y comunicaciones científicas. Asistentes y Participantes constituidos por Odontólogos, Estomatólogos, Pediatras, Psicólogos, Foniatras y Fisioterapeutas.</p> <p class=\"bigredtext\">El acto fue inaugurado por el Ilmo. Sr.&#160; D. Pedro Bullón Fernández (Decano de la Facultad de Odontología de Sevilla); el&#160; Ilmo. Sr. D. Ignacio Gómez de Terrero (Vicedecano de la Facultad de Medicina de Sevilla);&#160; el Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca (Presidente honorífico de la SEPEAP) y la Dra. Antonia Domínguez Reyes (Presidenta de la SEOII).&#160;</p> <p class=\"bigredtext\">Reconocido por la Dirección General&#160; de Calidad Investigación y Gestión del Conocimiento con 1,7 créditos de Formación Continuada y por la Univesrsidad de Sevilla con 1 crédito de Libre Configuración, el tema general de esta VII reunión, versó sobre el&#160; “Estado actual de la nutrición en el neonato. Evolución, tendencias y controversias. Un tema sobre el que disertaron los Drs. Josefa Aguayo Maldonado (Importancia de la lactancia materna:&#160; por qué, cómo y hasta cuándo); Cristóbal Coronel Rodríguez (Lactancia artificial);&#160; Dª,&#160; Mª de la Merced Barbancho Morant (¿Cómo reforzar el vínculo afectivo madre-hijo/a) y Dª María Teresa Briones Luján (Relación Dieta-Aparato Estomatognático).</p> <p class=\"bigredtext\">La Dra. Domínguez Reyes, tras palabras de bienvenida a la numerosa concurrencia, destacó el significado de estas reuniones, los logros en la obtención de un lenguaje común y la importancia que tiene el establecimiento de protocolos que permiten la asistencia al niño con verdaderos criterios globales, secuenciales e integrados; un indicativo de la alta calidad que, en la asistencia al pequeño paciente, tiene esta forma de ver la Odontología Infantil y sus tratamiento. Destacó también el reconocimiento que se hace de esta visión fuera de nuestro país: Portugal, Francia, Inglaterra, Italia, Latinoamérica, e incluso Israel. Países, donde la SEOII suele ser invitada a exponer sus ideas y conceptos.&#160; &#160;</p> <p class=\"bigredtext\">El Dr. D. José del Pozo Machuca, explicó&#160; la trayectoria de estas reuniones y el importante reconocimiento a su calidad científica; reconocimiento que ha trascendido el ambiente universitario para integrarse en la sociedad y práctica profesional diaria; y el Dr. Joaquín Ortiz Tardío, la fundamental importancia que estos Encuentros Multidisciplinares tienen en la formación de todo profesional atento a la salud general del niño.</p> <p class=\"bigredtext\">Las comunicaciones, desarrolladas por los diferentes profesionales de las distintas áreas de la salud, fueron muy comentadas por su actualidad y alto nivel.</p> <p class=\"bigredtext\">La Conferencia de Clausura“Retos sociales&#160; y educacionales”, estuvo a cargo del Dr. D. José Chamizo de la Rubia, Defensor del Pueblo Andaluz, el cual, de forma brillante, clara y amena, expuso los problemas que plantea la actual sociedad y las repercusiones que los mismos tienen sobre la&#160; educación, apuntando serias reflexiones para una mejor compresión y tratamiento tanto del niño como del joven con problemas.</p> <p class=\"bigredtext\">Agradeciendo a la Universidad, a la Agencia de Acreditación y a las Sociedades SEPEAP y SPAOYEX su participación y patrocinio en este VII Encuentro Multidisciplinar; a todos los ponentes por su participación altruista y a las entidades Johnson- Johnson y Fundación Cajasol su colaboración, se clausuró este VII Encuentro, señalando que el próximo Congreso de la SEOII tendrá lugar el próximo <br /> año 2011 en Murcia.</p> <h2>Comité Científico:</h2> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José Antonio Fernández Mosquera</li>   <li>Antonio F. Galán González</li>   <li>Carlos González Melián</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del Pozo Machuca</li> </ul> <h2>Comité Organizador:</h2> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca                 &#160;</li> </ul> <h2>Programa:</h2> <p><strong>9:00 - 9:15: Entrega de documentación.</strong><br /> <strong>9:15: Inauguración de la Jornada.                  ( Representantes de Colegios y Sociedades )</strong></p> <p><strong>Mesa redonda: Estado actual de la nutrición en el                  neonato. Evolución, tendencias y controversias.</strong> Moderador: Dr. D. Carlos González Melián / Dra. Dª Antonia Domínguez Reyes</p> <p><strong>9:30 – 10:00. Lactancia artificial.</strong> Dr D Cristobal Coronel</p> <p><strong>10:00 – 10:30: Importancia de la Lactancia                   materna: por qué, cómo y hasta cuándo.</strong> Dra. Dª Josefa Aguayo Maldonado</p> <p><strong>10:30 – 11:00: Café</strong><br /> <strong>11:00- 11:30: ¿Cómo reforzar el vínculo afectivo madre-hijo/a.</strong> Dª Ana María Romero Gómez</p> <p><strong>11:30 – 12:00: Relación dieta / Aparato Estomatognático. </strong>Dra. Dª María Teresa Briones Luján</p> <p><strong>12:00 – 13:00: Coloquio Mesa Redonda.</strong></p> <p><strong>16:00 – 17:00                    Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos                    de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.</strong></p> <p><strong>17:00 – 17:30: Café</strong></p> <p><strong>17 30 18 30 Continuación comunicaciones</strong></p> <p><strong>18:30 – 19:30 Mesa Coloquio, de la Comunicaciones Libres</strong>. Moderadores: Dra. Dª Elena Barbería Leache. / Dr. D. Joaquín Ortiz Tardío / Dr. D. Antonio Galán González</p> <p><strong>19:30: Conferencia de clausura: “Retos sociales y                    educacionales”</strong> Dr. D. José Chamizo de la Rubia (Defensor del Pueblo                   Andaluz)</p> <h2>Ponentes y participantes</h2> <p><strong>Josefa Aguayo Maldonado. </strong> Profesora  Asociada de Pediatría. Universidad de Sevilla. Hospital de Valme.</p> <p><strong>Teresa Aznar Martín. </strong>Prof.  Colaboradora de Odontología Infantil Integrada. Universidad de Sevilla. Vocal  de la SEOII.</p> <p><strong>Elena Barbería Leache. </strong> Catedrático de Odontopediatría. Universidad de Madrid.  Asesor de la SEOII.</p> <p><strong>José Luis Bonal Villanueva. </strong> Pediatra  extrahospitalario. Presidente de la SEPEAP</p> <p><strong>María Teresa Briones Luján</strong>. Profesora Asociada de Clínica Odontológica Integrada Infantil. / Facultad de Odontología. Universidad de Granada</p> <p><strong>Eugenio P. Cabrera Suárez. </strong>Medicina Familiar y Comunitaria. / C. De  Salud. Sevilla. Asesor de la SEOII.</p> <p><strong>Antonia Domínguez Reyes</strong><span style=\"font-weight: bold;\">. </span>Profa. Titular de Odontología Infantil Integrada.  Universidad de Sevilla. Presidenta de la SEOII.</p> <p><strong>Antonio F. Galán González</strong><span style=\"font-weight: bold;\">. </span>Prof. Asociado de Odontología Infantil Integrada.  Universidad de Sevilla. Secretario de la SEOII.</p> <p><strong>Ignacio Gómez de Terreros. </strong> Prof. Titular de Pediatría. U. De Sevilla. Jefe  Servicio de Pediatría H.I.U.V. Rocío.</p> <p><strong>Carlos  González Melián</strong><span style=\"font-weight: bold;\">. </span>Pediatra.</p> <p><strong>Joaquín Ortiz Tardío</strong><span style=\"font-weight: bold;\">. </span>Jefe de  Servicio de Pediatría del Hospital de Jerez  de la Frontera Presidente de la  Sociedad de Pediatría de Andalucía  Occidental y Extremadura.</p> <p><strong>José del Pozo Machuca</strong><span style=\"font-weight: bold;\">. </span>Pediatra  Extrahospitalario. Sevilla. / Director de Vox Pædiatrica / Vicepresidente de la Sociedad de Pediatría de Andalucía / Vicepresidente de la Sociedad de Pediatría de Andalucía                 Occidental y Extremadura.&#160;</p> <p><strong>Dª Ana María Romero Gómez</strong>. Psicóloga-Terapeuta. Coordinadora del Programa “Cuídame”</p> <p>&#160;</p> <h2>Colaboran:</h2> <p>Sociedad de Pediatría de Andalucía                  Occidental y Extremadura<br /> Pediatría Extrahospitalaria de Sevilla<br /> Asociación de Pediatras de  Atención Primaria de Sevilla</p> <p>&#160;</p> <h2>Lugar de celebración</h2> <p>Centro  Cultural CAJASOL C/ Laraña nº 4 ( Sevilla) C/ Laraña n 4 ( Sevilla) <br /> Fecha: Sábado,  20 de Mayo de 2010</p> <p>&#160;</p> <h2>Tríptico del encuentro</h2> <p>Descargar <a href=\"resources/upload/link/57-vii-encuentro/Programa-VII-encuentro.pdf\"><strong>tríptico</strong></a></p> <p><strong>&#160;</strong></p>','VII Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','vii-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:31','2016-03-14 15:48:31','',0,'http://seoii.davidsantiago.net/events/vii-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(471,1,'2010-07-21 12:41:16','2010-07-21 10:41:16','<p>Con una participación de más de 200 asistentes, en el Centro Cultural “Cajasol” de la ciudad de Sevilla, se celebró, el día 8 de marzo de 2008, el<strong> V Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria.</strong></p> <p>Con este motivo, la SEOII, quiere comunicar y presentar, en primer lugar, sus más sinceras disculpas a todos aquellos profesionales y estudiantes que, pese haberlo solicitado, no pudieron ser admitidos en este Encuentro debido a lo limitado del aforo.&#160;</p> <p>El alto nivel científico del evento fue avalado con la concesión por la Universidad de Sevilla y la Agencia Nacional de Acreditación con Créditos de Libre Configuración y de Formación Continuada respectivamente.&#160; En esta ocasión, dicho Encuentro SEOII-SEPEAP, estuvo constituido por dos mesas redondas con enriquecedor debate: “Alimentación en el niño” y “Prevención y tratamiento de la maloclusión en dentición temporal”.&#160;</p> <p>La mesa redonda “Alimentación en el niño” fue moderada por la <strong>Dra. Elena Barbería</strong>,&#160; Catedrático de la Universidad Complutense de Madrid, y tuvo la participación de los :<strong> Dr.&#160; José del Pozo y Dr. Cristóbal Coronel , pediatras de Sevilla, el Dr.&#160; Aníbal González, el Dr.&#160; Elías Casals,&#160; Profesores Titulares de Odontología y&#160; el Dr.&#160; José Chamizo Defensor del Pueblo Andaluz</strong>, en ella, se abordó el tema tan controvertido de la correcta alimentación del niño y sus repercusiones en el contexto de la salud general y bucal y las repercusiones <br /> demostradas en el adulto futuro. Se toman notas para que ello sea tenido en cuenta en el ámbito familiar y escolar.</p> <p>La mesa redonda “Prevención y tratamiento de la maloclusión en dentición temporal”, moderada por la <strong>Dra. Antonia Domínguez</strong>,&#160; Profesora Titular de la Universidad de Sevilla, y presidenta de la SEOII, contó con la participación de<strong>l Dr. Carlos O’Connor</strong> , otorrinolaringólogo, la <strong>Dra.&#160; Laura García,&#160; foníatra, Dra. Mercedes Gálvez , estomatólogo de Granada y. D.&#160; Cleofás Rodríguez , fisioterapeuta de la Universidad de Sevilla y el Dr. José Antonio Gámez</strong>, asesor del Área de Salud y Dependencia del Defensor del Pueblo Andaluz. Se analizó la importancia de un abordaje etiopatogenico precoz de las maloclusiones, con el necesario e imprescindible diagnostico y&#160; tratamientos multidisciplinar e interprofesional.</p> <p>La conferencia de clausura estuvo a cargo del <strong>Dr.&#160; Fernando Malmierca</strong>, pediatra y expresidente de la SEPEAP, con el tema Salud bucodental en el niño y política sanitaria; Agradeciendo a todos su participación y patrocinio(Obra Social Cajasol; Laboratorios Listerine-Oraldine; Nestlé; Dentaid y Pierre-Fabre; y Eds. Maxillaris, Gaceta Dental, Ripano y Dentistas), cerró el acto la propia presidenta de la SEOII, expresando el deseo de que tantos los colaboradores como los asistentes y las más de 70 personas que no pudieron asistir por causa del mencionado aforo, volviéramos a encontrarnos en el VI Congreso de la SEOII que, en el 2009, se celebrará en la ciudad de Granada. Congreso que presidirá la <strong>Dra. Mercedes Gálvez.</strong></p> <p><strong>&#160;</strong></p> <h2>Tríptico del encuentro</h2> <p>Descargar <a href=\"resources/upload/link/58-v-encuentro/seoii-triptico-cara.pdf\"><strong>tríptico cara</strong></a> | descargar <a href=\"resources/upload/link/58-v-encuentro/seoii-triptico-dorso.pdf\"><strong>tríptico dorso</strong></a></p> <p><strong>&#160;</strong></p> <h2>Página web del encuentro</h2> <p>Visitar la <a target=\"_blank\" href=\"http://seoii.es/miniwebs/v-encuentro-2008\"><strong>web del V Encuentro<br /> </strong></a></p>','V Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','web-v-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:31','2016-03-14 15:48:31','',0,'http://seoii.davidsantiago.net/events/web-v-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(472,1,'2010-07-21 12:41:27','2010-07-21 10:41:27','<p>Los pasados días 26 a 28 de Marzo de 2009, en el Hotel Abades de Granada ha tenido lugar la celebración del VI Congreso Nacional de la Sociedad&#160; Española de Odontología Infantil Integrada (SEOII); y dentro del mismo la&#160; habitual Reunión SEOII-SEPEAP. &#160;</p> <p>Este Congreso considerado de alto nivel científico por la Agencia de Acreditación Nacional, la Universidad de Sevilla y la Facultades de Medicina, Odontología y Fisioterapia de la Universidad de Granada, así como por otras Instituciones como la Consejería de Innovación, Ciencia y Empresa de la Junta de Andalucía,&#160; constituyó una verdadera puesta al día de los temas más actuales de la Odontología en el niño; un niño visto, no como un problema de afecciones bucales o sistémicas aisladas, sino como un ser dinámico que está en continuo crecimiento y desarrollo tanto físico&#160; como psíquico y social; concepto que exige tratamientos secuenciales en los que, a veces, son necesarias intervenciones multidisciplinares e interprofesionales. Una visión Integral de&#160; la salud que hace que esta Sociedad sea una verdadera Sociedad Multidisciplinar integradora.</p> <p>El día 26, por la mañana, en actividad&#160; Pre-Congreso tuvieron&#160; lugar dos talleres prácticos: uno en la Institución IAVANTE de Resucitación&#160; Cardio-Pulmonar en el niño a cargo del&#160; Dr. Modesto Valverde Molina y su equipo; y otro sobre Búsqueda de Información en la Red impartido por D. Rafael Olivares Castillo de la Universidad de Granada. Durante la tarde tuvieron lugar las presentaciones de Comunicaciones Orales y defensa de Póster. Tras cóctel y acto de bienvenida a la ciudad, los congresistas realizaron una visita nocturna guiada a la Alhambra que recibió los mayores elogios de los asistentes nacionales y extranjeros al evento. &#160;</p> <p>La inauguración&#160; oficial del Congreso, el día 27, estuvo Presidida por la Ilma. Sra. Dª Mª del&#160; Carmen Maroto Vela Presidenta de&#160; la Real Academia de Medicina y Cirugía de Granada la cual resaltó la importancia de estos acontecimientos científicos; lo novedoso y necesario del concepto de Integrada para la Odontología en el niño y adolescente; y nos animó a continuar&#160; con ilusión por conseguir lo mejor para nuestros pequeños pacientes. Este día, en primera sesión, tuvo lugar una mesa redonda sobre Abordaje Multidisciplinar de Patologías Faciales Congénitas en la Práctica Clínica donde&#160; intervinieron las Dras. Carmen Navarro Martínez y Adoración Martínez Plaza de España y los Drs. Aidé Terán Alcocer y Juán Carlos López Noriega de Méjico. En esta mesa redonda se resaltó la importancia de los tratamientos integrados e integradores en estas patologías donde la formación de equipos multidisciplinares e interprofesionales resulta&#160; de capital importancia. Por la noche en la Chumbera del Albayzín, en marcoincomparable con la Alhambra al fondo, tuvo lugar un espectáculo flamenco a cargo de Curro Albayzin y su grupo, un espectáculo, tras el cual, se realizó la cena de gala con entrega de premios a las mejores comunicaciones y póster del congreso. &#160;</p> <p>El día 28 tuvo lugar el VI Encuentro SEOII-SEPEAP (Sociedad Española de Pediatría Extra-Hospitalaria y Atención Primaria) que este año por razones prácticas se efectuó dentro del Congreso. En él, bajo el tema general de Prevención, Diagnóstico y Tratamiento Multidisciplinar en la Clínica Diaria y Aplicaciones Prácticas, se analizaron tanto la Prevención en Odontología del siglo XXI como diversos aspectos de enfermedades sistémicas con repercusiones orales, las interacciones de la salud oral -salud sistémica, los síndromes de apnea-hipoapnea, las relaciones oclusión y postura o la investigación con melatonina en la cavidad oral entre otros diversos temas en los que intervinieron importantes y prestigiosos profesionales nacionales y extranjeros como el Drs. Llodra, Zamorano, Cutando,&#160; Ceballos, Enzo y Sccioletti de Italia o Herrera entre otros.</p> <p>En la clausura, la organización quiso agradecer a todos los ponentes nacionales y extranjeros su inestimable colaboración altruista y entrega, auténticos motores del éxito del Congreso; a la SEPEAP, a los participantes&#160; y asistentes su presencia y a las casas comerciales, en especial a la patrocinadora Johnson &amp; Johnson y revistas como S.P.A., Gaceta Dental, Maxillaris, Ripano su inestimable aportación y contribución a&#160; la difusión de este Congreso.</p>','VI Congreso Nacional y VI Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','vi-congreso-nacional-y-vi-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:32','2016-03-14 15:48:32','',0,'http://seoii.davidsantiago.net/events/vi-congreso-nacional-y-vi-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(473,1,'2010-07-21 12:41:38','2010-07-21 10:41:38','<p><strong>VII ENCUENTRO   MULTIDISCIPLINAR ODONTOLOGÍA INFANTIL INTEGRADA – PEDIATRÍA  EXTRAHOSPITALARIA Y  ATENCIÓN PRIMARIA Y SOCIEDAD DE PEDIATRÍA DE  ANDALUCIA OCCIDENTAL Y EXTREMADURA</strong></p> <p align=\"center\">&#160;</p> <p align=\"center\" class=\"menu\"><a href=\"http://www.seoii.com/PAGINA%5FANTIGUA/nueva/pdf/nota-prensa-VII.pdf\" target=\"_blank\">Nota de prensa</a></p> <p align=\"center\" class=\"menu\">&#160;</p> <p align=\"center\" class=\"menu\"><a href=\"http://www.seoii.com/PAGINA%5FANTIGUA/nueva/pdf/fotos-vii.pdf\" target=\"_blank\">Album fotográfico</a></p>','VII Encuentro Multidisciplinar Odontología Infantil Integrada – Pediatría Extrahospitalaria y atención primaria y sociedad de pediatría de Andalucía occidental y Extremadura','','publish','open','open','','vii-encuentro-multidisciplinar-odontologia-infantil-integrada-pediatria-extrahospitalaria-y-atencion-primaria-y-sociedad-de-pediatria-de-andalucia-occidental-y-extremadura','','','2016-03-14 16:48:32','2016-03-14 15:48:32','',0,'http://seoii.davidsantiago.net/events/vii-encuentro-multidisciplinar-odontologia-infantil-integrada-pediatria-extrahospitalaria-y-atencion-primaria-y-sociedad-de-pediatria-de-andalucia-occidental-y-extremadura/',0,'event','',0),(474,1,'2010-07-22 11:28:40','2010-07-22 09:28:40','<p><strong>La Sociedad Española de Odontología Infantil Integrada (SEOII) ha celebrado su I Congreso Internacional y V Nacional en Sevilla</strong></p> <p>Los pasados días 14 a 17 de Marzo de 2007, en el Hotel NH Central Convenciones de Sevilla ha tenido lugar la celebración del I&#160; Congreso Internacional / V Nacional de la Sociedad Española de Odontología Infantil Integrada (SEOII); y al mismo tiempo, la&#160; habitual Reunión SEOII-SEPEAP.&#160;</p> <p>Este Congreso considerado de alto nivel científico por la Agencia de Acreditación Nacional, la Universidad de Sevilla, la Facultad de Odontología de la Universidad de Granada y otras Instituciones como la Consejería de Innovación, Ciencia y Empresa de la Junta de Andalucía, no solo constituyó un total y completo éxito de participación y asistencia, sino una verdadera puesta al día de los temas más actuales de la Odontología en el niño; un niño visto, no como un problema de afecciones bucales o sistémicas aisladas, sino como un ser dinámico que está en continuo crecimiento y desarrollo tanto físico como psíquico y social; un novedosos concepto que exige tratamientos secuenciales en los que, a veces, son necesarias intervenciones multidisciplinares e interprofesionales. Una visión Integral de la salud en el niño que hace que esta Sociedad sea una verdadera Sociedad Multidisciplinar Integradora.</p> <p>El día 14, por la mañana, en actividad&#160; Pre-Congreso tuvieron&#160; lugar dos talleres prácticos: uno de Resucitación Cardio-Pulmonar en el niño a cargo de los Drs. Soult Rubio, Muñoz Saez y Parrilla Parrilla del Servicio de Cuidados Intensivos Pediátricos del Hospital Infantil Virgen del Rocío de Sevilla y otro de Microimplantes impartido por los Drs. Cabañas Cabañas y Parmigiani Izquierdo. La tarde&#160; se dedicó completamente a la presentación de las numerosas Comunicaciones Orales y presentación de Comunicaciones formato Poster.&#160;&#160;</p> <p>El acto de bienvenida a la Ciudad, tuvo lugar en los Reales Alcázares de Sevilla,&#160; a cargo de D. Antonio Rodríguez Galindo el cual, en representación del Ilmo. Sr. Alcalde de Sevilla, no solo tuvo la deferencia de recibirnos en la llamada “Puerta del León”, sino quien tras afectuosas palabras de bienvenida, nos ilustró sobre la historia y diversos acontecimientos de los mismos, departiendo con natural afabilidad la visita guiada que tuvo lugar a continuación. Este acto terminó con una copa de bienvenida en los jardines, los cuales, junto con las estancias recibieron los mayores elogios de los asistentes.</p> <p>La inauguración&#160; oficial del Congreso, el día 15, estuvo Presidida por la Ilma. Sra. Dª Mari Cruz Arcos Vargas Vicerrectora de Relaciones Institucionales, Internacionales y Extensión Cultural de la Universidad de Sevilla, quien en nombre del Imo. Sr. Rector Magnífico D. Miguel Florencio resaltó la importancia de estos acontecimientos científicos; lo novedoso y necesario del concepto de Integrada para la Odontología en el niño y adolescente; y nos animó a continuar&#160; con ilusión por conseguir lo mejor para nuestros pequeños pacientes.</p> <p>Este día tuvo lugar la primera sesión,&#160; a cargo del Prof. Dr.&#160; D Mariano Rocabado Saetón, Decano de la Facultad de Ciencias de&#160; la Rehabilitación de la Universidad Andrés Bello de Chile; Kinesiólogo y&#160; Especialista en Terapia Manual Ortopédica. Estudioso <br /> profesional de alta nombradía internacional, que impartió durante toda la jornada (mañana y tarde) el Curso “Posturología y Odontología Infantil Integrada. ¿Influye la postura cervical en el sistema estomatognático del paciente infantil? “ Durante el mismo, entre otros aspectos, señaló la importancia que tenía ver la boca bajo todos los ángulos posibles; involucrando en el estudio de la misma a la columna cervical y sus articulaciones, los ligamentos, el cráneo, la musculatura y el sistema nervioso.</p> <p>El Curso “ Orden y Desorden de la Oclusión y su Desarrollo”, estuvo impartido el día 16, por la Dra. Wilma Alexandre Simoës, Profa. del Curso de Especialización en Ortopedia uncional de los Maxilares en la Universidad Cruzeiro do Sul (UNICSUL); especialista en Disfunción Temporo-Mandibular y Dolor Orofacial en Ortopedia Funcional de los Maxilares.</p> <p>Docente de gran capacidad comunicativa, que imparte Cursos por las Universidades más importantes de los cinco continentes, contagió a todos de su entusiasmo por el estudio y la ciencia; señalando, entre otros diversos aspectos, que ética, deontológica y profesionalmente, “la técnica, sin el respaldo de un verdadero y científico estudio carecía de bases realmente fiables”; “que en la oclusión, los contactos dentales se veían influidos por la actividad neuromuscular; que el tratamiento precoz era el único medio de armonizar las caras articulares durante las cinco direcciones de libertad de movimiento de la mandíbula en el espacio; y que dicho tratamiento precoz consiste en educar la musculatura para la Rehabilitación del Programa Neuro-Muscular. Las alteraciones o desórdenes funcionales en la oclusión están ocasionadas por la pérdida de&#160; los Equilibrios existentes en el Aparato Estomatognático. Por la noche, en este día tuvo&#160; lugar la Cena de Gala, donde se entregaron los premios a las mejores comunicaciones y poster y algunos recuerdos a todos los congresistas.</p> <p>El día 17, último del Congreso, tras&#160; una muy interesante&#160; conferencia sobre “Prescripción de antimicrobianos en el ámbito odontológico a niños con enfermedades sistémicas” por parte del Dr. Diz Dios, Titular de Odontología Integral en Pacientes Especiales en la niversidad de Santiago de Compostela, se celebró la Reunión anual SEOII /SEPEAP con una Mesa Redonda sobre “Hábitos Nocivos en l Niños”. Mesa Redonda Presidida por el Dr. Bonal Villanova, Presidente de la SEPEAP.&#160;</p> <p>Intervinieron en animado coloquio, diversos ponentes de distintas especialidades: El Dr. Redondo Romero Especialista en Pediatría (Valencia); el Dr. Rocabado Saetón, Kinesiólogo (Chile); el Dr. O´Connor Reina Otorrinolaringólogo (Sevilla); el Dr. Jaque Faure Catedrático de Ortodoncia en&#160; la Universidad de Toulouse (Francia); el Catedrático de Psicobiología de la Universidad Complutense de Madrid Dr. Fernández&#160; Frías; la profesora García Rodríguez, Foniatra del Hospital Virgen del Rocío y la Dra. Domínguez Reyes Profesora de Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de la Universidad de Sevilla.&#160;&#160;&#160;&#160;</p> <p>&#160;Este Congreso se clausuró haciendo hincapié en la necesidad de que todos los que nos preocupamos por la salud en el niño lleguemos a hablar “el mismo idioma” para lograr lo que la Sociedad Española de Odontología Infantil hace años viene pregonando: que no se trata de unir especialistas, sino de integrar para lograr la formación de equipos multidisciplinares e interprofesionales que atiendan al pequeño paciente de una forma secuencial y verdaderamente integrada. Por todo la&#160; SEOII fue muy elogiada por sus esfuerzos verdaderamente integradores.&#160;</p> <p>La organización quiso así mismo agradecer a todos los ponentes nacionales y extranjeros su inestimable colaboración y entrega, auténticos motores del éxito del Congreso; a los participantes y asistentes su presencia&#160; y a las casas comerciales su aportación. A las revistas que&#160; han contribuido a su difusión. A todos gracias y hasta el próximo Congreso.</p> <h2>Libro del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/71-i-congreso/LIBRO-portada-i-congreso-internacional-2007.pdf\">Libro portada [PDF]</a></b> | <b><a href=\"http://resources/upload/link/71-i-congreso/LIBRO-i-congreso-internacional.pdf\">Libro completo [PDF]</a><br />   </b></li>   <li>Descargar:<b> <a href=\"resources/upload/link/71-i-congreso/PROGRAMA-i-congreso-internacional-2007.pdf\">Programa [PDF]</a></b></li> </ul> <p></p> <p></p>','I Congreso Internacional y V Nacional en Sevilla 2007','','publish','open','open','','la-sociedad-espanola-de-odontologia-infantil-integrada-seoii-i-congreso-internacional-y-v-nacional-en-sevilla','','','2016-03-14 16:48:32','2016-03-14 15:48:32','',0,'http://seoii.davidsantiago.net/events/la-sociedad-espanola-de-odontologia-infantil-integrada-seoii-i-congreso-internacional-y-v-nacional-en-sevilla/',0,'event','',0),(475,1,'2010-08-30 09:27:30','2010-08-30 07:27:30','<p>Los días <strong>17 al 20 de febrero de 2011</strong> se celebró el <strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada.</strong></p> <h3><strong>Acreditación de las Actividades Científicas</strong></h3> <ul>   <li><strong>Hasta 1,5 Créditos de Libre Configuración, Universidad de Murcia.<br />   </strong></li>   <li><strong>Hasta 3 Créditos de Libre Configuración, Universidad de Sevilla.</strong></li> </ul> <p>&#160;</p> <p><img height=\"156\" width=\"643\" src=\"resources/upload/image/73/banner.jpg\" alt=\"\" /></p> <p>En ciencias de la salud, <strong>los conocimientos </strong>no son compartimentos estancos, sino aspectos diferentes que<strong> deben ser integrados.<br /> </strong><strong>El niño es un ser dinámico que está en continuo crecimiento y desarrollo</strong> tanto físico como psíquico y social.<br /> Odontológicamente<strong> ha de ser visto, diagnosticado y tratado como un todo.</strong>&#160;</p> <p><strong>Congreso Multidisciplinar, Interdisciplinar e Interprofesional, </strong>en el cual se abordará al niño y adolescente en crecimiento y desarrollo.</p> <p>A través de ponencias, talleres prácticos y mesas redondas, globalmente se presentarán los últimos avances y conocimientos científicos-técnicos&#160;más actuales dentro de la <strong>Odontología Infantil.</strong></p> <p>Se integran materias como la<strong> Neurofisiología, Ortodoncia, &#160;Ortopedia Funcional, Radiología 3D, Pediatría, &#160;Otorrinolaringología, Logopedia, Fisioterapia, Osteopatía, Psicología,</strong> entre otras disciplinas en Ciencias de la Salud.</p> <p>Compartiremos conceptos e ideas como también distintas perspectivas de protocolos de actuación dentro de la Odontología en el niño.</p> <p>&#160;Para los alumnos de pre-grado de las distintas carreras de las Ciencias de la Salud, las Universidades de Murcia y Sevilla, concedieron hasta 1.5 y 3 créditos de Libre Configuración respectivamente.</p> <p>&#160;</p> <h3>Conclusiones del congreso</h3> <p>&#160;</p> <p><img alt=\"\" src=\"http://seoii.es/admin/index.php/resources/view/246\" /></p> <p>El evento estuvo constituido por cuatro Mesas Redondas y cuatro Talleres dedicados a Odonto-Estomatólogos y otros profesionales de las Ciencias de la Salud.</p> <p>Dentro de la Mesa Redonda, <i><b>“Tratamiento del niño en crecimiento y desarrollo. Visión global”</b></i>, (coordinada por la Dra. Domínguez Reyes, Profa Titular de Odontología Infantil y Ortodoncia Integrada en de la U. de Sevilla) la Dra. Marie- Josèphe Deshayes, Médico Estomatólogo y Paleontóloga, expuso dos temas: <i>Crecimiento craneal: vínculos con la dentición primaria; y Tratamientos precoces antes de los seis años de edad.</i></p> <p>Con ambas ponencias pudimos comprender mejor las fuerzas que dentro de la base craneal conducen el desarrollo facial hacia oclusiones específicas; y además, ver cómo, diagnosticando en el recién nacido pequeñas asimetrías faciales, se podía pronosticar y prevenir futuras asimetrías faciales de crecimiento y desórdenes en la ATM.</p> <p>El Dr.Yves Castaing Haerïng, Lcdo. en Fisioterapia y Doctor en Osteopatía por la Universidad de Medicina  de Montreal y Lyón, desarrolló la ponencia <i>“Osteopatía Craneal. Su influencia sobre la Oclusión durante el Crecimiento y Desarrollo en el Niño”.</i> En ella expuso que, la oclusión y, en general, la Odontología infantil, han evolucionado hasta tal punto, que, hoy, la misma, no puede considerarse separada del contexto general del cuerpo.</p> <p>La conferencia <i>“</i><i>Odontología en el niño: Futuro Funcional</i><i>”</i>, del Dr. Michael Gorbonos, Doctor of Dental Medicine DMD Medical University of Southen Africa, Medunsa, Rep. of South Africa y profesor visitante de Ortodoncia en Universidad Autónoma del Estado de Mexico, no solo señaló que la terapia funcional hace posible tra­tar problemas de manera más fácil y racional, sino que destacó la necesidad de crear una plataforma internacional para la do­cumentación, educación y conservación de las técnicas ortopédicas funcionales.</p> <p><b>La Segunda mesa redonda bajo el epígrafe general </b><i><b>de “La alimentación en el niño y sus repercusiones clínicas”, </b></i>estuvo constituida por los Drs. Juán Madrid Conesa; Cristina Cardoso Silva; Leopoldo Becerra Posada y Concepción López Soler.</p> <p>Moderada por la Profa. Elena Barbería (Catedrático de Odontopediatría en la U. Complutense de Madrid) y la Dra. Margarita Varela Morales (Jefe de la Unidad de Ortodoncia en la Fundación Jiménez Díaz de Madrid), los ponentes desarrollaron, respectivamente, “<i>Alimentar bien a nuestros hij@s: una asignatura pendiente”; “Alimentación y Nutrición: importancia de la salud bucal de los niños”;</i><b> </b><i>“Prevención de la caries desde el nacimiento. Generación Caries Cero”; y “Aspectos Psicológicos de la Odontología infantil y adolescente”</i></p> <p>En esta mesa redonda se recogieron los diferentes aspectos de la alimentación actual en los niños, las causas de la mala alimentación actual y las formas de corregir y mejorarla, una magnífica, clara y amena exposición del Dr. Madrid, en la que también mostró como se puede enseñar a comer correctamente a la población infantil mediante juegos. La Dra. Cardoso señaló que los cuidados de la salud oral deben comenzar ya desde el embarazo con educación a las futuras madres y su entorno.</p> <p>El Dr. Becerra (Odontopediatra por la U. de los Ángeles) expuso, por primera vez en España, su más que interesante iniciativa de la Cartilla odontológica para el bebé con objeto de obtener generaciones caries cero; y la Dra. Soler, los distintos aspectos y manifestaciones de la conducta infantil en el gabinete dental, aportando estrategias racionales para el control de la conducta y comprensión psicológica de las distintas situaciones.</p> <p>Moderada por los Drs. Luis A. Bravo (Prof. Titular de Ortodoncia en la U. Murcia) y el Prof. Joaquín de Nova (Titular de Odontopediatría en la U. Complutense de Madrid) tuvo lugar la tercera mesa redonda bajo el título general de “<i><b>Abordaje Odontológico-Clínico en situaciones de compromiso.</b></i></p> <p>Los “<i>Traumatismos en dentición temporal y sus efectos en la dentición definitiva”</i> fueron expuestos por el Dr. García Ballesta de la Universidad de Murcia; la “<i>Revisión de la Oligodoncia no sindrómica” </i>por el Dr. Arturo Sánchez Pérez; “<i>En busca del Equilibrio estético funcional” </i>por el Dr<i>. A</i>ntonio Matos da Fonseca, Cirujano Maxilo-Facial en la U. de Lisboa y<b> </b>el “<i>Presente y futuro de la imagen. Imagen 3D en Odontología”</i> por el Dr. Vicente Hernández Soler.</p> <p>Las cuatro ponencias, de alto nivel científico, constituyeron una total puesta al día de los diversos temas y los diferentes agentes de distinta naturaleza que pueden desviar el curso del crecimiento cráneo-facial en el niño.</p> <p>La cuarta y última Mesa Redonda, <i><b>Relaciones Clínicas Sistema Estomatognático / vías aéreas</b></i><b>”</b> fue desarrollada por la Dra. Yolanda Cerezo del Olmo<b>,</b> Especialista en Pediatría, que disertó sobre las<b> </b><i>“Patologías más frecuentes en el niño que pueden implicar alteraciones del sistema estomatognático”; </i>la Dra. Concepción Maeztu Sardiña, que habló sobre los <i>“Trastornos respiratorios del sueño (SAOS) y su abordaje Neurofisiológico en niños y adolescentes”.</i></p> <p>Con “<i>Ortodoncia y ORL infantil. La importancia de trabajar en equipo”</i>,<i> el Dr.</i><b> </b>Carlos Escobar Sánchez (Otorrinolaringólogo Prof. en la Facultad de Murcia) señaló las íntimas relaciones que puede tener la ortodoncia y las afecciones otorrinolaringológicas y el<i> </i>Prof. Juan Cobo Planas, (Catedrático de Ortodoncia en la Universidad de Oviedo) que disertó sobre “<i>Ortopedia Maxilar y Vías Aéreas Superiores”. En esta </i> ponencia, expuso las relaciones y efectos de las afecciones de las vías aéreas superiores sobre el desarrollo normal y  posibles anomalías del Sistema Estomatognático, destacando que el trabajo multidisciplinar e interprofesional, en muchas ocasiones, era más que necesario.</p> <p>Esta mesa redonda fue moderada por los Drs. Ustrell, Prof. Titular de Ortodoncia. U.de Barcelona,  y el Prof. Oñate, Prof. Titular de Pacientes Especiales en la U. de Murcia.</p> <p>Tras cada mesa redonda se estableció un animado coloquio entre moderadores ponentes y congresistas en los que pudo detectarse, no solo la alta participación de los asistentes, sino el gran interés despertado por los temas del Congreso y sus ponentes.</p> <p><b>Los cuatro Talleres </b>dirigidos a Odonto-Estomatólogos y otros profesionales en ciencias de la salud fueron:</p> <p>“<i><b>Taller de  Relación Oclusión- ATM según la Rehabilitación Neuroclusal”, </b></i>impartido por la Dra.Dª. Mercedes Gálvez Jiménez</p> <p>“<i><b>Taller De Disfunción Del Aparato Masticatorio: Diagnóstico Diferencial Oclusal- Osteopático-Visual”</b></i><b> </b>impartido  por Dra. Amaia Iturburu Aranzabal y  D. Donato Martínez Mateo.</p> <p>“<i><b>Taller De Intervención Logopédica Funcional En Los Desordenes Orales”, </b></i>impartido por la Licenciada Sonia Muñoz Rico</p> <p>“<i><b>Taller De Salud Oral En El Paciente En Crecimiento”, </b></i>impartido por<i><b> </b></i>la Dra<i><b>.</b></i></p> <p>Ivanna Camps Pereperez.</p> <p>Estos talleres a los que asistieron diferentes profesionales de las Ciencias de la Salud (odontólogos, fisioterapeutas, pediatras etc,) pusieron al alcance de todos los participantes formas prácticas, distintas maniobras y técnicas que permitían abordar al paciente infantil como un todo, de forma integral y en equipo multidisciplinar.</p> <p>En el Acto de Clausura, tras unas palabras de la Presidenta de la SEOII, se comunicó que la Sede del VIII Congreso Nacional sería Madrid y su organización correspondería a la Dra. Rosa Mourelles, Profesora de la Facultad de Odontología de la U. Complutense de Madrid.</p> <p>Así mismo comunicó el Hermanamiento de nuestra Sociedad con la International Functional Assosiation (IFUNA).</p> <p>La SEOII y el Comité Organizador del Congreso agradecieron a ponentes y congresistas su asistencia y activa participación; a las Instituciones su eficaz apoyo, a los Patrocinadores  Johnson-Johnson e Imper-Ortho, su inestimable colaboración en la realización de este importante evento científico y a los colaboradores, Kin, Ripano, Osteoplac, Maxillaris y Gaceta Dental  su contribución.</p> <p>&#160;</p> <h3 class=\"slideToggle\">Carta de bienvenida</h3> <div class=\"hide\"> <p>Queridos y estimados compañeros:</p> <p>En nombre del Comité Organizador quisiera invitaros al <strong>\"2º Congreso Internacional y 7º Nacional de la Sociedad Española de Odontología Infantil Integrada\"</strong> que se celebrará en<strong>&#160; Murcia del 17 al 20 de Febrero&#160; de&#160; 2011.</strong>&#160; Nuestro&#160; Congreso&#160; versará&#160; sobre&#160; las<strong>&#160; técnicas&#160; más&#160; actuales&#160; e&#160; innovadoras&#160; en&#160; el diagnóstico y tratamiento del niño en crecimiento y desarrollo. </strong>Compartiremos tanto conceptos e ideas como distintas perspectivas de protocolos de actuación dentro de laOdontología del niño.</p> <p>Siendo la <strong>SEOII la primera Sociedad Española e Internacional creada con carácter multidisciplinar e interprofesional,</strong> y aprovechando esta inigualable ocasión, hemos realizado un importante esfuerzo para&#160; ofrecer&#160; a&#160; todos&#160; lo&#160; mejor&#160; y&#160; más&#160; actual&#160; de&#160; la&#160; Odontología&#160; Infantil:&#160; Neurofisiología,&#160; Ortopedia Funcional, Pediatría, Logopedia, Otorrinolaringología, Psicología y Fisioterapia, que comparten nuestro concepto de ver al niño de manera global e integrada.</p> <p><strong>Un&#160;&#160; Congreso&#160;&#160;&#160; para&#160; aprender&#160;&#160;&#160; con&#160; ponencias&#160;&#160;&#160; y&#160; comunicaciones&#160;</strong>&#160;&#160;&#160; que&#160;&#160; reflejan las&#160; inquietudes&#160;&#160; y necesidades de nuestro tiempo<strong>, con talleres prácticos</strong>&#160; que ponen a disposición aprendizajes de alta calidad, y gran actualidad en la integración con otras disciplinas como demanda nuestra sociedad.</p> <p><strong>Os&#160; invito&#160; muy&#160;&#160; cordialmente,&#160;&#160;&#160; con&#160; la seguridad&#160;&#160; de&#160; que&#160;&#160; en&#160; Murcia&#160; os&#160; sentiréis&#160; acogidos por&#160; la&#160; hospitalidad de su gente</strong> y os sorprenderéis por la variedad y riqueza de sus expresiones artísticas,&#160; naturales y gastronómicas, de modo que podremos conjugar ocio y ciencia para conseguir juntos que esteCongreso de laSEOII sea inolvidable para todos nosotros.</p> <p>Un afectuoso saludo</p> <p><strong>María Eugenia Cabaña Muñoz</strong><br /> Presidenta del Comité Organizador</p> </div> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><img height=\"110\" width=\"266\" src=\"resources/upload/image/73/hotel-nelva-murcia.jpg\" alt=\"Hotel Nelva Murcia\" class=\"right bordered\" /></p> <p><strong><strong>Sede del Congreso<br /> </strong></strong>Hotel Nelva<br /> Av. Primero de Mayo, 9&#160;<br /> 30006 Murcia<br /> Tlf.: 968 06 02 00<br /> <a href=\"http://www.hotelmurcianelva.com\"> www.hotelmurcianelva.com</a></p> <p>&#160;</p> <h3>Programa del congreso</h3> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/73/SEOII-programa-congreso-Murcia2011.pdf\">Archivo PDF</a><br /> </b></p> <p>Descargar el cartel:<strong>&#160;<a href=\"resources/upload/image/73/cartel-web.jpg\" target=\"_blank\" rel=\"XprettyPhoto\">Archivo JPG<br /> </a></strong></p> <p>&#160;</p> <h3 class=\"slideToggle\">Ponentes del Congreso</h3> <div class=\"hide\"> <h4><strong>Dra. MERCEDES GÁLVEZ JIMÉNEZ</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Odontólogo y Doctora en Medicina y Cirugía por la Universidad de Granada. Profesora Colaboradora de Prácticas Clínicas en Odontología Infantil Integrada de la Facultad de Odontología de Sevilla. Profesora del Máster de Odontología Infantil Integrada de la Facultad de Odontología de la Universidad de Sevilla, donde imparte enseñanza de Rehabilitación Neuroclusal (RNO) y Ortopedia Funcional de los Maxilares. Formada en esta disciplina bajo la dirección de los Drs. Pedro Planas en Barcelona y Wilma Simoes en Brasil. Coautora en capítulos de libros, es dictante de varios cursos en Hispanoamérica sobre RNO y en Foros españoles de Fisioterapeutas y Foniatras.</p> <hr /> <h4>Dra. ANTONIA DOMÍNGUEZ REYES</h4> <p><strong>Currículum:</strong> Doctor en&#160; Medicina y Cirugía por la Universidad de Sevilla. Especialista en Estomatología. Médico Puericultor. Profesor Titular de&#160; Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de Sevilla. Diploma Universitario en Ortodoncia y Ortopedia Dentofacial por la Universidad Paul Sabatier, Toulouse III (Francia). Directora del Máster Universitario en Odontología Infantil Integrada. Directora del Titulo de Experto Universitario en Tratamiento Global, Secuencial Avanzado en Odontología Infantil. Investigadora responsable en diversos Proyectos de Investigación financiados por la Junta de Andalucía y la Universidad de Sevilla. Profesora Invitada y Realización de Actividades Docentes e Investigadora en la Universidad do Vale do Itajaí de Brasil. Autora de numerosas publicaciones en revistas nacionales e internacionales. Dictante de varios cursos sobre Odontología en el niño y adolescente. Directora de varias Tesis Doctorales, DEA y Tesinas. Autora de diversos capítulos de libros sobre Odontología Infantil Integrada. Fundadora y actual Presidenta de la Sociedad Española de Odontología Infantil Integrada (SEOII). Miembro del Comité Cientifico del Journal of the American Dental Association (JADA) edición española. Miembro del Consejo Asesor de la Revista Claves de Odontología. Dependiente del Círculo Odontológico de Córdoba (Argentina). Revisora de las Revistas Journal of&#160; Contemporary Dental Practice e International Journal of Paediatric Dentistry.</p> <hr /> <h4><strong>Dra. AMAIA ITURBURU ARANZABAL</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum:</strong> Licenciada en Medicina y Cirugía por la UPV en 1981. Diplôme Dòsteopathe (Collegiale Academique de France) 2002. Coordinadora de“Osteopatía Cráneo Sacra” en la Escuela Universitaria de Osteopatía de Murcia. Profesora de Osteopatía Craneal del “Máster Oficial en Osteopatía” de la Universidad Pública de Murcia.<br /> Secretaria de la Fundación Española de Osteopatía (2007).&#160;&#160; Profesora del Master “Experto en terapia Orofacial y Miofuncional”. “Trastornos en la articulación Cráneo Mandibular” en la Universidad Pontificia de Salamanca (Curso 2008-2009; 2009-2010).<br /> Miembro del&#160; SEDCYDO (Sociedad Española de Disfunción Cráneo-mandibular y dolor Orofacial)). Miembro del “European Council of Osteopathic&#160; Education”</p> <hr /> <h4>Sr.&#160;DONATO&#160;MARTÍNEZ MATEO<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Licenciado en Educación Física. INEF Madrid (Universidad Politécnica de Madrid) Cursos 1986/87 al curso 1990/91.<br /> Funcionario de Carrera del Cuerpo Profesores de Enseñanza Secundaria.<br /> Diploma de Osteópata, por la Escuela Europea de Osteopatía (Murcia). 5500 horas lectivas. Murcia. 2002/2008.<br /> Diplôme de Fin de Deuxième Cycle d’Etudes Ostéopathiques, por la Ecole Superieure d’Osteopathie de París, 2008, tras la defensa de su mémoire “Influencia inmediata y a las 48 horas de la técnica rodamiento alternativo de temporales con amplitud descendente sobre parámetros cardiovasculares” en París.<br /> Docente en el Máster Oficial de Osteopatía (Universidad de Murcia) <br /> Actualmente realiza la tesis doctoral en el Dpto de Anatomía Humana y Psicobiología de la Universidad de Murcia, con el título: Influencia de la técnica osteopática “rodamiento alternativo de temporales” sobre la presión arterial y frecuencia cardiaca. Cuantificación del estímulo y elección del protocolo más eficaz.</p> <hr /> <h4><strong>Dra. MARIE-JOSÈPHE DESHAYES</strong></h4> <p><strong>Currículum: </strong>Médica Antropóloga. Miembro de la Sociedad Francesa de Ortopedia Dento-Facial. Miembro del Club Internacional de Morfología Facial. Miembro fundador del Club Telecrane Internacional. Miembro de la Sociedad Antropológica de París. Autora de numerosos cursos, artículos y conferencias. Autora de libros como “Repérages Crâniens” “L\'art de traiter avant 6 ans”&#160;y “Craniofacial Morphogénesis”.</p> <hr /> <h4>Dr. YVES CASTAING HAERÏNG<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Licenciado en Podología en Paris (1978). Graduado en Kinesioterapia y Rehabilitación Funcional en la Facultad de Medicina de Burdeos (Francia). Doctor en Osteopatía por la Universidad de Medicina&#160; de Montreal (1984) y la Facultad de Medicina de Lyón (Francia, 1986). Sus investigaciones y trabajos en ese ámbito, le han conducido a una verdadera especialización en Osteopatía Craneal Infantil. Posee el Diploma Universitario en Fukuoka (Japón) y el de Acupuntor por la Facultad de Medicina de Burdeos. Actualmente, además de ser miembro del Colegio de Osteópatas de Francia y España, trabaja en colaboración con centros de maternidad franceses (Perpignan, Bordeaux, Toulouse) y españoles (Madrid y Barcelona). Autor de diversos artículos en Francia, también es autor del Libro, en español, “Osteopatía Craneal usted y su bebe”. En la actualidad transmite el resultado de sus investigaciones y experiencias sobre la osteopatía a través de conferencias y seminarios internacionales.</p> <hr /> <h4>Dr. DAVID SUÁREZ QUINTANILLA<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina por la Universidad de Santiago de Compostela. Especialista en Estomatología (Universidad de Oviedo). Máster Europeo en Ortodoncia y Ortopedia Dentofacial (Universidad de Valencia). Catedrático de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Councillor&#160; y&#160; Elect President 2012 de la European Orthodontic Society <br /> Diplomado de la Sociedad Española de Ortodoncia. Miembro de la International Academy of Dentistry , SEDO, AESOR, WFO , AIO, AAO y otras sociedades científicas. Miembro fundador del European&#160; Orthodontic Teacher´s Forum&#160; (EOTF) y de la Sociedade Galega de Ortodoncia (SGO). Académico Corresponsal desde 1996 de la Real Academia de Medicina y Cirugía de Galicia. Premio de la Real Academia de Medicina y Cirugía de España. Responsable de varios proyectos de investigación financiados. Director de numerosas Tesis Doctorales y artículos publicados en revistas nacionales y extranjeras<br /> Autor de varios libros y capítulos de libros. Creador de la Técnica de Ortodoncia Straight Wire Low Friction (SWLF) en la RMO de Denver (EEUU). Ha impartido cursos en diversas&#160; Universidades y países.</p> <hr /> <h4>Dr. MICHAEL GORBONOS<strong><br /> </strong></h4> <p><strong>Currículum: </strong>1990 University of Timishoara (Romania). Doctor of Dental Medicine DMD (1995) Medical University of Southen Africa, Medunsa, Rep. of South&#160;&#160; Africa. Master of Dental Science MDS. 2008. Visiting Professor&#160; at the Department of&#160; Orthodontic, Universidad Autónoma del Estado De Mexico, Mexico.Teaching and Academic Experience.1991-1996 Senior Lecturer at the Department of Orthodontics and Pedodontics University of Medunsa South Africa. President of IFUNA International Functional Association (2007).&#160; Presisident of I International Congress of Ifuna November (Paris. France), (2008) President of II International Congress of Ifuna October (2008) University of Barcelona, Spain, (2009) President of III International Congress of Ifuna October&#160; 2009 University of Torin, Italy. 2010 Chief Editor - Electronic Journal of Ifuna- IFUNA VIEW. Lecturering worldwide Languages: English, Hebrew, Russian, Spanish and Romanian.</p> <hr /> <h4>Sra. SONIA MUÑOZ RICO<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Bachelor of Science with Honours in Logopedics. The University of Manchester, Inglaterra. Homologado en España como Licenciatura en Logopedia. Profesora Colaboradora Honoraria de la Universidad de Murcia. Logopeda de la ADFY (Asociación de Discapacitados Físicos de Yecla). Colaboradora en diferentes programas de divulgación logopédica. Directora del Centro de Logopedia, Estimulación y Reeducación Neuro-Sensorial C.L.E.R.N. de Yecla (Murcia).&#160;</p> <hr /> <h4>Dra. MARÍA&#160;EUGENIA&#160;CABAÑA&#160;MUÑOZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Odontóloga por la Universidad Nacional de Córdoba, Argentina.<br /> Licenciada en Odontología por la Universidad de Granada, España.<br /> Diploma Universitario de Ortodoncia y Ortopedia Dentofacial.<br /> Université Paul Sabatier. Faculté de Chirurgie Dentaire. Toulouse III. Francia.<br /> Proyecto de investigación sobre Microimplantes en Ortodoncia en la Universidad de Murcia.<br /> Ponente en Cursos y Conferencias Nacionales e Internacionales sobre Microimplantes y Ortodoncia.<br /> Profesora Colaboradora del Master de Ortodoncia y Ortopedia Dento-Facial de la Universidad de Murcia.<br /> Presidenta del 1º Congreso Europeo de Microimplantes, Murcia, España.<br /> Miembro de SEDO, SEDCYDO, SEOII, AESOR, AAO, EOS, WFO.</p> <hr /> <h4>Dra. CATALINA CANALDA ALFARA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Barcelona (1972). Médico Estomatólogo. Ortodoncista con práctica en niños y adultos de los trastornos de la Oclusión y Disfunción Cráneo Mandibular (D.C.M.). Colabora con el Profesor Pedro Planas desde 1979. Desde 1984 hasta 1994 ejercicio en asociación con el Profesor Pedro Planas. Desde 1994 ejerce en asociación y comparte la dirección de Dentoclinic&#160; con el Dr. Carlos de Salvador Planas. Miembro del&#160; C.I.R.N.O (Club Internacional de Rehabilitación Neuro Oclusal).Miembro de la Asociación Española Pedro Planas de R.N.O. (A.E.P.P.) Miembro de la S.F.O.D.F.(Sociedad de Ortopedia Dento Facial Francesa). Miembro fundador del C.E.R.N.O. (Club de Enseñanza de Rehabilitación Neuro Oclusal). Miembro de Honor de la Sociedad de Ortopedia Funcional de los Maxilares de Venezuela. Conferenciante invitada en varios países de Europa y América donde además ha impartido e imparte Cursos de divulgación y talleres de R.N.O. primero con el Dr. Pedro Planas y más tarde con el Dr. Carlos de Salvador Planas, (1987-2010).&#160;</p> <hr /> <h4>Dra. IVANNA CAMPS PEREPEREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía (1989) y Odontología (1992) por la Universidad de Valencia. Ortodoncista (Valencia1994). Profesora del Máster de Ortodoncia Facultad de Medicina y Odontología de la Universidad de Valencia (2005-2009). Profesora del Máster de Ortodoncia CEU Universidad Cardenal Herrera (Valencia) desde 2009.</p> <hr /> <h4>Dr. JUAN MADRID CONESA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en medicina y Cirugía. Especialista en Endocrinología y Nutrición. Endocrinólogo y Nutricionista en el Hospital Universitario Virgen de la Arrixaca desde hace más de 25 años, es autor de diversas comunicaciones y publicaciones científicas en Congresos y Revistas nacionales e internacionales. Autor de numerosos libros sobre la diabetes, el sobrepeso, la obesidad&#160; y otros problemas endocrinológicos y nutricionales en niños y adultos. Colaborador habitual en numerosas publicaciones y actividades de la Consejería de Sanidad de la Comunidad de Murcia. Asiduo participante en actividades sanitarias de divulgación en diversos medios de&#160; comunicación.</p> <hr /> <h4>Dra. CRISTINA CARDOSO SILVA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina Dentaria por el “Instituto Superior de Ciencias da Saúde – Norte” de Portugal. Máster en Odontopediatría (Facultad de Odontología. Universidad Complutense de Madrid). Máster en Ciencias Odontológicas de la Facultad de Odontología (Universidad Complutense de Madrid). Doctor en&#160; Odontología por la Facultad de Odontología de la Universidad Complutense de Madrid. Asistente invitada de Odontopediatria en la “Faculdade de Medicina Dentária” de la Universidade do Porto (Portugal). Miembro del equipo investigador del “Programa de Atención Odontológica Integral a pacientes en edad infantil” (Facultad de Odontología, Universidad Complutense de Madrid). Autora y coautora de diversas publicaciones en revistas nacionales e internacionales. Premio Revista “Dental Practice” al mejor artículo en español y Premio Revista “JADA – Edición Española” al mejor artículo en español (2007 /2008). Miembro de la “International Association of Paediatric Dentistry”e “International Association of Dental Traumatology”.</p> <hr /> <h4>Dr. LEOPOLDO BECERRA POSADA</h4> <p><strong>Currículum: </strong>Cirujano Dentista.&#160; Universidad Tecnológica de México, UNITEC. Certificado en Odontopediatría, Universidad de Los Ángeles, California. UCLA. Certificado en Niños con Retraso Mental y Discapacitados. Universidad de Los Ángeles, California. UCLA – Neuro Psychiatric Institute. Master en Ortodoncia. Universidad Intercontinental. UIC. México, D.F. Diplomado en Gestión, Dirección, Mercadotecnia y Administración Hospitalaria. Universidad La Salle – Hospital Médica Sur. México, D.F. Diplomado en Técnica Roth Williams. Universidad Nacional Autónoma de México. UNAM. Diplomado en Ortodoncia y Cirugía Ortognática. Universidad Nacional Autónoma de México. UNAM.</p> <hr /> <h4>Dra. CONCEPCIÓN LÓPEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Dra. en Psicología (1986). Responsable de la Consulta de Psicología Clínica en el Hospital Virgen de la Arrixaca desde 1988. Profesora Vinculada Clínica, en el Hospital U. V. Arrixaca desde julio 2006. Responsable de la Unidad Asistencial de Psicología Clínica en Hospital Morales Meseguer (1993- 1996). Profesora Asociada a tiempo completo de Psicología Medica en la Facultad de Medicina de la Universidad de Murcia (1982- 1986). Profesora Titular de Personalidad Evaluación y Tratamientos Psicológicos en la Facultad de Psicología. Especialista en Psicología Clínica (1998). Directora del Centro de Orientación y Estudios Psicológicos (COEP) de la Universidad de Murcia (1990- 1994). Directora del Curso Psicología Clínica I Escuela de Práctica Psicológica. Miembro de la Comisión Nacional de Psicología Clínica (Ministerio de Sanidad 1999- 2006). Presidenta de la Asociación para el Desarrollo de la Salud Mental en Infancia y juventud “Quiero Crecer” (desde 2008). Investigadora titular y participante en diversos proyectos, es autora de diversas publicaciones en Revistas Internacionales y coautora en varios libros sobre psicología infantil.</p> <hr /> <h4>Dra. ELENA BARBERIA LEACHE<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Universidad de Navarra. Doctor en Medicina y Cirugía UCM. Médico Estomatólogo UCM y Doctor en Odontología UCM. Especialización en Odontopediatría. Especialización en Ortodoncia UCM. Profesor en la U.C.M.<br /> Catedrático de Universidad desde 1989. Departamento de Profilaxis, Odontopediatría y Ortodoncia. <br /> Directora del Curso de Especialización en Odontopediatría: 1979-88.<br /> Directora del Máster de Odontopediatría: 1988- actualidad.<br /> Participación como investigadora Principal o Investigadora en 24 proyectos financiados. En la actualidad, actividad clínica en el “Programa de Atención Odontológica a Pacientes en Edad Infantil” de la Universidad Complutense de Madrid. Directora de más de veinte Tesis Doctorales, Tesinas y&#160; trabajos para Diploma de Estudios Avanzados. Con más de 150 publicaciones en revistas nacionales e internacionales, además, es autora de varios libros y atlas sobre Odontopediatría para Odonto-Estomatólogos y Pediatras. Socio de Honor de la Asociación Española De Pediatría. Director Asociado del Journal of the American Dental Association (JADA), edición española. Editor Asociado para España del European Journal of Pediatric Dentistry. Marzo 2006. Revisora científica del European Journal of Pediatric Dentistry. Enero 2006. Revisor científico del European Journal of Dentistry. Enero 2008. Dictante, de numerosos cursos, conferencias y comunicaciones Nacionales y Extranjeras.</p> <hr /> <h4>Dra. MARGARITA VARELA MORALES<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Médico, especialista en Medicina Interna, Estomatología y Ortodoncia.<br /> Jefe de la Unidad de Ortodoncia y Directora del Programa de Postgrado de Ortodoncia de la Fundación Jiménez Díaz. Autora de&#160; libros y capítulos de libros&#160; sobre problemas bucodentales en Pediatría, Ortodoncia interdisciplinar y otros textos pediátricos.<br /> Profesora Honoraria del Dpto. de Pediatría de la Facultad de Medicina de la Universidad Autónoma de Madrid. Numerosas&#160; publicaciones en revistas nacionales e internacionales y Dictante y Organizadora de Conferencias y Cursos de formación dirigidos a ortodoncistas y a pediatras.</p> <hr /> <h4>Dr. CARLOS GARCÍA BALLESTA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Profesor Titular de Odontopediatría en la Facultad Odontología de la Universidad de Murcia. Académico de Número de la Real Academia de Medicina y Cirugía de Murcia. Ex-Presidente de la Sociedad Española de Odontopediatría. Premio de la Sociedad Española de Odontopediatría (once ocasiones), Sociedad Española de Periodoncia, Sociedad Española de Odontología Preventiva y Comunitaria (siete ocasiones), Sociedad Española de Estomatología, Real Academia de Medicina y Cirugía de Murcia (tres concursos de premios) y Real&#160; Academia Nacional de Medicina (Premio Prof. Juan Pedro Moreno). Con 130 trabajos publicados, 183 comunicaciones en congresos nacionales e internacionales, es autor o coautor de once libros sobre Odontopediatría. En el campo de la investigación, es Director&#160; de varios proyectos sobre traumatología dental financiados por el Fondo de&#160; Investigación&#160; Sanitaria - Unión Europea&#160; (FIS- FEDER), siendo, además, Evaluador Internacional de Universidades.</p> <hr /> <h4>Dr. ARTURO SÁNCHEZ PÉREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina y Cirugía por la Universidad de Murcia.<br /> Medico Diplomado en Medicina del Trabajo (Murcia 1985).<br /> Medico especialista en Medicina deportiva (Murcia 1986).<br /> Medico especialista en Estomatología por la Universidad de Murcia (1988). Master en implantología y periodoncia por la Universidad de París VII 1992. Profesor encargado de Periodoncia desde 1993.<br /> Profesor Asociado a tiempo completo desde 2005.<br /> Vocal por la Región de Murcia del Centro de Estudios de la III Región.<br /> Presidente del Grupo de Estudios Murciano Odontoestomatológicos.<br /> Vicedecano de Odontología desde 2006.<br /> Autor o colaborador de 10 Libros de la especialidad.<br /> Autor de 44 publicaciones de la especialidad en revistas Nacionales e Internacionales. Dictante de&#160; 112 comunicaciones a Congresos. Dictante de 61 cursos. Director de 4 tesis doctorales todas con premio otorgado.</p> <hr /> <h4>Dr. ANTONIO MATOS DA FONSECA<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Médico egresado de la&#160; Facultad de Medicina de Lisboa (1977). <br /> Especialista en Cirugía Maxilofacial. Hospital de S. José. Lisboa.<br /> Director de la “Clínica da Face”. Lisboa. Fellow of the European Board of Maxillofacial Surgery. Consultor del Hospital Pediátrico de D. Estefanía. Lisboa. (1998-2002). Consultor del Hospital Fernando da Fonseca. Amadora – Sintra. Miembro de la Sociedad de las Ciencias Médicas de Lisboa. Miembro de la Sociedad Portuguesa de Cirugía Cráneo-Maxilo-Facial. Miembro de la Sociedad Española de Cirugía Oral y Maxilofacial. Miembro de la Sociedad Portuguesa de Cirugía Plástica Reconstructiva y Estética. Miembro de la “International Association of Oral and Maxillofacial Surgeons”. Miembro de la Federación Ibero-Latino-Americana de Cirugía Plástica. Fellow of the International College of Surgeons. Profesor Titular de Terapéutica Especial del “Instituto Superior de Ciências da Saúde”.&#160; Portugal. (2003-2007). Profesor Honorario de la&#160; Universidad Alfonso X El Sabio - Madrid. Profesor del Posgrado de Cirugía Oral de la Universidad Lusófona - Lisboa. Profesor del Posgrado de Cirugía del CETAO – São Paulo – Brasil. Su actividad se desenvuelve en el campo de las dismorfologías cráneo-faciales. Co-autor del libro “Ortodoncia y Cirugía Ortognática” Diagnóstico y Planificación. Editado en Español, Portugués, Italiano e Inglés.</p> <hr /> <h4>Dr. VICENTE HERNÁNDEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina. Estomatólogo. <br /> Certificate in Orthodontics and Master in Medical Sciences (Harvard U, Boston, USA). Miembro diplomado de la SEDO.<br /> Diplomate of the American and European Board of Orthodontics. <br /> Active member of the Edward Angle Society. Profesor asociado de la Universidad de Valencia.</p> <hr /> <h4>Dr. LUIS&#160; ALBERTO BRAVO GONZÁLEZ<strong><br /> </strong></h4> <p><strong>Currículum:&#160; </strong>Doctor en Medicina y Cirugía. Especialista en Estomatología. Profesor Titular de Ortodoncia de la Universidad de Murcia. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Murcia.<br /> Miembro Diplomado de la SEDO. Miembro Diplomado del European Board of Orthodontists. Miembro Activo de la Sociedad Europea de Angle</p> <hr /> <h4>Dr. JOAQUÍN DE NOVA GARCÍA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Prof. Titular de Odontopediatría de la Universidad Complutense de Madrid (UCM).<br /> Director del Título Propio (UCM): Especialista en Atención Odontológica Integrada en el niño con necesidades especiales.<br /> Vocal de la SEOII.</p> <hr /> <h4>Dra. YOLANDA CEREZO DEL OLMO<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Murcia. Especialista en pediatría. Formación en el H. San Juan. Con diversas comunicaciones en Congresos de Pediatría, ejerce la especialidad en el Servicio de Salud de la Comunidad de Murcia.</p> <hr /> <h4>Dra. CONCEPCIÓN MAEZTU SARDIÑA</h4> <p><strong>Currículum:</strong> Licenciada en Medicina Y Cirugía. Facultad de Medicina de la Universidad de Navarra 1975-1981. Especialista en Neurofisiología Clínica vía MIR. C. S. Virgen de la Arrixaca de Murcia, 1982-1986.<br /> Doctora en Medicina Y Cirugía por la Universidad de Murcia.<br /> Master en Medicina Humanitaria (Universidad Miguel Hernández).&#160; Facultativo Especialista en Neurofisiología Clínica (NFLC) del Servicio Murciano de Salud. Médico Jefe de Sección de NFLC, del Servicio Murciano de Salud. Diferentes Comunicaciones y Ponencias en Mesas Redondas en Congresos y Reuniones Científicas. Coordinadora y Participante como docente en diversos cursos. Miembro de diferentes Comisiones del Hospital General Universitario de Murcia. Premio de la Comisión Central de Garantía de Calidad del Hospital Morales meseguer a la Comisión de Historias Clínicas y Documentación y a la Calidad Asistencial 2001. Evaluadora de Actividades Formativas Médicas Especializadas. Evaluadora externa de actividades formativas de SEAFORMEC (Sistema Español de Acreditación de la Formación Médica Especializada) por designación del Colegio Oficial de Médicos de la Región de Murcia, desde 2004.<br /> Evaluadora externa de actividades de formación médica especializada del Servicio Murciano de Salud.</p> <hr /> <h4>Dr. CARLOS ESCOBAR SÁNCHEZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado y Doctor en Medicina y Cirugía por la Universidad de Murcia. Especialista en Otorrinolaringología. Diploma Universitario en Perturbaciones de la Audición y del Lenguaje (Logopedia) y Apto en requerimientos médicos-científicos en el Foreing Medical Graduate Examination Of The United States Of America. Facultativo Especialista de Área del Servicio de Otorrinolaringología del Hospital Universitario \"Morales Meseguer\" de Murcia, ha realizado numerosas estancias en el Extranjero, artículos en revistas científicas nacionales e internacionales y capítulos de libros. Editor de libros como “Orl sin recurrir a pruebas complementarias”, “Hipoacusias Infantiles”, “Sinusitis Crónica Y Poliposis” y “Rinología Básica”. Miembro de la Sociedad de Otorrinolaringología y Patología Cérvico- Facial de la Región de Murcia con el cargo de Secretario General entre 1996-2004.&#160; Sociedad Española de Otorrinolaringología y Patología Cervico- Facial. Cargo de Vocal de la Comisión de protocolos y Estándar durante un mandato. Socio Fundador y Tesorero Español de la Asociación Hispano-Alemana de ORL y Cirugía Cérvico-Facial desde 1998 hasta la fecha. Socio Fundador y Presidente de la Asociación de Médicos ORL DEB.</p> <hr /> <h4>Dr. JUAN COBO PLANAS<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Facultad de Medicina de la Universidad de Zaragoza. Especialista en Estomatología por la Escuela de Estomatología de la Universidad de Oviedo. Doctor en Medicina y Cirugía (Universidad de Oviedo). Diplomado en Periodoncia Social (University of Illinois). Especialista Universitario en Ortodoncia. Especialista Universitario en Valoración del Daño Buco Dental. Master Universitario en Metodología y Técnicas de Investigación Oral Master Universitario en Metodología y Técnicas de Investigación en Ciencias de la Salud. Catedrático de Ortodoncia de la Facultad de Odontología de la Universidad de Oviedo. Miembro de la American Association of Orthodontists. Director del Programa Máster de Ortodoncia y Ortopedia Dento-Facial.<br /> Director del Programa de Especialistas Universitarios en Ortodoncia, Universidad de Oviedo. Instructor acreditado para la enseñanza de la técnica de Arco Recto,Lawrence F. Andrews Foundation. San Diego (E.E.U.U.). Director de la Escuela de Estomatología, Universidad de Oviedo.&#160; Profesor Colaborador del Programa de Especialización en Ortodoncia de la Facultad de Medicina y Odontología de la Universidad de Valencia. Coordinador del Proyecto E 5017.&#160; Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996) Coordinador del Proyecto D 5004. Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996). Director del Máster de Ortodoncia y Ortopedia Dento Facial. Universidad de Oviedo. (2002-2005). Director del Título de Especialista Universitario en Ortodoncia. (Actualidad). Director del Máster Oficial de Ortodoncia y Ortopedia Dentofacial. Director y autor de numerosas Tesis Doctorales, comunicaciones y ponencias.</p> <hr /> <h4>Dr. RICARDO E. OÑATE SÁNCHEZ</h4> <p><strong>Currículum: </strong>Especialista en Estomatología.<br /> Licenciado en Medicina y Cirugía.<br /> Profesor Titular de la Universidad de Murcia.<br /> Responsable de la Unidad Docente de Pacientes Especiales en la Licenciatura de Odontología.<br /> Secretario del Departamento de Dermatología, Estomatología,<br /> Radiología y Medicina Física de la Facultad de Medicina y Odontología de la Universidad de Murcia.</p> <hr /> <h4>Dr. JOSÉ Mª USTRELL<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado, Doctor en Medicina y Cirugía y especialista en Estomatología, por la Universidad de Barcelona (UB). Profesor Titular de Ortodoncia en la Facultad de Odontología de la Universidad de Barcelona. Coordinador del \"Mestrado na especialidade de Ortodontia\" en el Instituto Superior de Ciências da Saúde-Norte de Gandra y Miembro del Comité Técnico del \"Mestrado de Ortodontia e Cirurgia Ortognática\" en la Universidade de Porto (Portugal) (2005). Miembro correspondiente de la Reial Acadèmia de Medicina de Catalunya (RAMC). Vocal de la Acadèmia de Ciències Mèdiques de Catalunya i Balears. Presidente de la Comisión de Salud Bucodental de la Generalitat de Catalunya. Tesorero del Groupement International pour la Recherche Scientifique en Stomatologie et Odontologie. Miembro fundador y vicepresidente de la Sociedad Española de Odontologia Infantil Integrada. Autor de varios libros sobre Ortodoncia e historia de la Odontología. Director de numerosas y autor de publicaciones es dictante de varios Cursos y responsable de varias líneas de investigación. Ostenta el premio Lauréat du prix (1995), Mention spécial (1997) del GIRSO y legado Prof. Lluís Sayé (1999) de la RAMC.</p> <p>&#160;</p> </div> <p>&#160;</p> <h3>Galería de fotos del congreso</h3>','Murcia 2011: II Congreso Internacional, VII Congreso Nacional de Odontología Infantil Integrada \"El niño en Crecimiento y Desarrollo\"','','publish','open','open','','vii-nacional-ii-internacional-congreso-de-odontologia-infantil-integrada','','','2016-03-14 16:48:33','2016-03-14 15:48:33','',0,'http://seoii.davidsantiago.net/events/vii-nacional-ii-internacional-congreso-de-odontologia-infantil-integrada/',0,'event','',0),(476,1,'2010-10-08 14:11:57','2010-10-08 12:11:57','<p>Los días <strong>17 al 20 de febrero de 2011</strong> se celebrará el <strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada.</strong><strong><br /> </strong></p> <p>Congreso multidisciplinar e interprofesional<br /> En ciencias de la salud, <strong>los conocimientos </strong>no son compartimentos estancos, sino aspectos diferentes que <strong>deben ser integrados.</strong><br /> <strong>El niño es un ser dinámico que está en continuo crecimiento y desarrollo </strong>tanto físico como psíquico y emocional.<br /> Odontológicamente <strong>ha de ser visto, diagnosticado y tratado como un todo.</strong></p> <p>&#160;</p> <hr /> <p>&#160;</p> <h2>Programa</h2> <p><em><strong>JUEVES 17 DE FEBRERO MAÑANA</strong></em><br /> <strong>09.00 - 14.00</strong>&#1