a-del-congreso/',0,'event','',0),(478,1,'2010-12-21 23:40:42','2010-12-21 22:40:42','<p><img src=\"resources/upload/image/78-iii-encuentro/III-Encuentro-Multidisciplinar.jpg\" class=\"left bordered\" style=\"width: 303px; height: 422px;\" alt=\"\" />El pasado 6 de Mayo, ha tenido lugar en Sevilla, el ya clásico y anual encuentro multidisciplinar e interprofesional  de la Sociedad Española de Odontología Infantil integrada (SEOII) – Sociedad Española de Pediatría Extrahospitalaria y Atención primaria (SEPEAP); un Encuentro Multidisciplinar que, como en años anteriores, volvió a constituir un verdadero éxito de asistencia y participación.</p> <p>Dada a las numerosas inscripciones registradas y al limitado aforo del salón de actos de la Real Academia de Medicina y Cirugía de Sevilla (lugar habitual de celebración de estos encuentros), este año, las diferentes mesas redondas y conferencias tuvieron lugar en los salones del Centro Cultura El Monte, los cuales fueron cedidos desinteresadamente por dicha prestigiosa Institución Sevillana.</p> <p>El acto, inaugurado por el Dr. D. José Luis Bonal Villanueva (Presidente de la SEPEAP) el Dr. del Pozo Machuca (Dtor. de Pediatría Integral) los Drs. Barbería Leache y Cabrera Suárez (asesores científicos de la SEOII) comenzó con una palabras a cargo de la Dra. Domínguez Reyes, Presidente de la SEOII, “In Memoriam” del prestigioso pediatra Prof. D. Antonio González- Meneses González-Meneses, presidente, hasta Marzo, de la Real Academia de Medicina y Cirugía de Sevilla. En sus palabras, la Dra. Domínguez no solo glosó los muchos méritos de esta figura de la Pediatría Española y Sevillana, sino que, expuso, además, la preocupación que este pediatra había manifestado siempre, por una asistencia al niño con verdadero perfil bio-psico-social.</p> <p>La Conferencia inaugural corrió a cargo de la Prfa. Dª Elena Barbería Leache, Catedrático de Odontopediatría en la Facultad de Odontología de la U.  Complutense de Madrid, la cual expuso su visión de la <b>Odontología Infantil Integrada como ciencia y arte.</b> Una visión que afianza la necesidad de una atención odontológica específica en el niño con carácter multidisciplinar e interprofesional.</p> <p>La primera mesa redonda (<b>Enfermedades Oncológicas</b>) moderada por el Dr. Cabrera Suárez, tuvo como ponentes a los Drs. D Francisco Vela Casas, Prof. Adjunto de la Unidad Hemato-Oncológica de Pediatría en el Hospital Virgen Macarena, y al Dr. Galán González Prf. Asociado de la Facultad de Odontología de la U. de Sevilla. Ambos ponentes expusieron, respectivamente, las complicaciones oro-faciales de cáncer infantil y sus tratamientos, y las pautas odontológicas preventivas y paliativas a seguir en niños con problemas oncológicos.</p> <p>En la segunda mesa redonda (<b>Erupción dentaria</b>) moderada por la Dra. Elena Barbería, los ponentes Dr. D. Antonio González-Meneses López (Pediatra Especialista en Dismorfología y Genética clínica) y el Dr. D. José Mª Ustrell i Torrent ( Prof. Titular de Ortodoncia de  la Facultad de Odontología de la U. de Barcelona), analizaron no solo la erupción dentaria normal y patológica, sino las enfermedades infantiles que podían incidir de alguna forma sobre  la dicha erupción.</p> <p>La tercera mesa redonda <b>Manejo del niño con alteraciones de la conducta</b>), moderada por la Dra. Domínguez Reyes, estuvo a cargo de los  Profs. Ignacio Gómez de erreros (Prof. Titular de Pediatría y Jefe de Servicio de Pediatría en el Hospital Virgen del Rocío) y el Dr. D. Joaquín de Nova, Prof. Titular de la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p></p> <p>El Prof. Gómez de Terreros habló sobre las Conductas disociales y las bases neurobiológicas de la violencia y el Dr. de Nova sobre el Comportamiento como factor determinante de la atención dental infantil.</p> <p>Todas las mesas redondas, expuestas con gran brillantez por sus participantes, tuvieron como colofón, interesantes y muy animados coloquios en los que una vez más se puso de manifiesto el interés que tanto Pediatras como Odontólogos (jóvenes y menos jóvenes) muestran por estos temas que la sociedad detecta como importantes y gran actualidad.</p> <p>Tras el altísimo nivel de las Mesas Redondas y sus ponentes, en el capítulo de conferencias, los Drs. Elías Casals (Prof. Asociado de Odontología Preventiva y Comunitaria de la U. de Barcelona)  y el Dr. D. Emilio Lledó (Coordinador del PADA en Sevilla), y con el mismo nivel, expusieron con sistemática claridad los problemas de la Higiene dental y su prevención, así como la Realidad de la Odontología en el Plan Andaluz de salud Bucodental, temas que motivaron intensa participación y numerosas preguntas por parte de los asistentes al encuentro.</p> <p>La Conferencia de Clausura estuvo a cargo del Dr. del Pozo Machuca (Director de la Revista Pediatría Integral y Pediatra extrahospitalario de Sevilla) quien de una manera brillante, clara y amena supo exponer los problemas actuales de la Adolescencia, a la vez que apuntaba reflexiones para una mejor compresión y tratamiento del joven con problemas.</p> <p>Agradeciendo a la Sociedad Española de Pediatría Extra-Hospitalaria y Atención Primaria su participación y patrocinio en este III Encuentro Multidisciplinar; y a las entidades Pfizer,  Dentaid, Pierre-Fabre, Normon y Fundación El Monte su colaboración, la Dra. Domínguez Reyes por la SEOII y el Dr. del Pozo Machuca por la SEPEAP clausuraron este tercer encuentro, recordando que:</p> <p><b>El V Congreso Nacional y I Internacional de la Sociedad Española de Odontología Infantil Integrada </b>tendrá lugar los día 14 a 18 de Marzo del 2007 en Sevilla. Evento para el que se cuenta con un Curso a cargo de la Dra. Wilma Simoes (Brasil), otro del Dr. Rocabado (EEUU) y cursos de RCP infantil y Microimplantes; además de conferencias por Odontólogos y Pediatras Españoles y Extranjeros.</p> <h2>Tríptico del encuentro</h2> <p>Descargar <a href=\"resources/upload/link/78-iii-encuentro/seoii-triptico-cara.pdf\"><strong>tríptico cara</strong></a> | descargar <a href=\"resources/upload/link/78-iii-encuentro/seoii-triptico-dorso.pdf\"><strong>tríptico dorso</strong></a><strong><br /> </strong></p>','III Encuentro Multidisciplinar de Ondontología Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','iii-encuentro-multidisciplinar-de-ondontologia-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:34','2016-03-14 15:48:34','',0,'http://seoii.davidsantiago.net/events/iii-encuentro-multidisciplinar-de-ondontologia-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(479,1,'2011-01-07 18:31:23','2011-01-07 17:31:23','<p>II Congreso de la Sociedad Española de Odontología Infantil Integrada</p> <p>X Congreso de la Asociación Gallega de Higienistas Dentales</p> <p>Santiago de Compostela 15 y 16 de noviembre de 2002</p> <p>Jornadas Luso-Espanholas de Medicina Dentária Infantil</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/84-ii-congreso-sevilla-2007/triptico-1.jpg\" target=\"_blank\">portada [JPG]</a></b> | <b><a href=\"resources/upload/link/84-ii-congreso-sevilla-2007/triptico-2.jpg\" target=\"_blank\">interior [JPG]</a></b></li> </ul>','II Congreso Nacional Santiago de Compostela 2002','','publish','open','open','','ii-congreso-santiago-de-compostela-2002','','','2016-03-14 16:48:35','2016-03-14 15:48:35','',0,'http://seoii.davidsantiago.net/events/ii-congreso-santiago-de-compostela-2002/',0,'event','',0),(480,1,'2011-01-07 19:29:04','2011-01-07 18:29:04','<p>I Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria</p> <p>Sevilla, 20 de marzo de 2003</p> <p>Con la colaboración de la Sección de Pediatría Extrahospitalaria de Sevilla y de la Asociación de Pediatras de Atención Primaria de Sevilla</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a target=\"_blank\" href=\"resources/upload/link/86-sevilla-2003/SEOII-i-encuentro-sevilla-2003-triptico.pdf\">portada e interior [PDF]</a></b></li> </ul>','I Encuentro Multidisciplinar Sevilla 2003','','publish','open','open','','i-encuentro-multidisciplinar-sevilla-2003','','','2016-03-14 16:48:35','2016-03-14 15:48:35','',0,'http://seoii.davidsantiago.net/events/i-encuentro-multidisciplinar-sevilla-2003/',0,'event','',0),(481,1,'2011-01-07 21:19:05','2011-01-07 20:19:05','<p>II Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria</p> <p>Sábado 13 de marzo de 2004</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a target=\"_blank\" href=\"resources/upload/link/87/II-Encuentro-2004-Sevilla-portada.jpg\">portada [JPG]</a></b> | <b><a target=\"_blank\" href=\"http://resources/upload/link/87/II-Encuentro-2004-Sevilla-interior.jpg\">interior [JPG]</a><br />   </b></li> </ul> <p></p>','II Encuentro Sevilla 2004','','publish','open','open','','ii-encuentro-sevilla-2004','','','2016-03-14 16:48:35','2016-03-14 15:48:35','',0,'http://seoii.davidsantiago.net/events/ii-encuentro-sevilla-2004/',0,'event','',0),(482,1,'2011-01-12 17:32:49','2011-01-12 16:32:49','<p>I Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</p> <p>Sevilla, 5 y 6 de octubre de 2001</p> <p>Declarado de Interés Científico Sanitario por la Consejería de Salud de la Junta de Andalucía</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/88/SEOII-I-Congreso-tapa.jpg\" target=\"_blank\">portada [JPG]</a></b> | <b><a href=\"resources/upload/link/88/SEOII-I-Congreso-interior.jpg\" target=\"_blank\">interior [JPG]</a></b></li> </ul> <p></p>','I Congreso Nacional Sevilla 2001','','publish','open','open','','i-congreso-nacional-sevilla-2001','','','2016-03-14 16:48:35','2016-03-14 15:48:35','',0,'http://seoii.davidsantiago.net/events/i-congreso-nacional-sevilla-2001/',0,'event','',0),(483,1,'2011-01-12 19:35:21','2011-01-12 18:35:21','<p>III Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</p> <p>Hotel Alimara, Barcelona, 6 al 8 de noviembrede 2003</p> <p>Con el soporte de la Academia de Ciencias Médicas de Cataluña e islas&#160; Baleares y el reconocimiento de interés sanitario de la Generalitat de Catalunya</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a target=\"_blank\" href=\"resources/upload/link/93/III-Congreso-2003-Barcelona-portada.jpg\">portada [JPG]</a></b> | <b><a target=\"_blank\" href=\"resources/upload/link/93/III-Congreso-2003-Barcelona-interior.jpg\">interior [JPG]</a></b></li> </ul>','III Congreso Nacional Barcelona 2003','','publish','open','open','','iii-congreso-nacional-barcelona-2003','','','2016-03-14 16:48:35','2016-03-14 15:48:35','',0,'http://seoii.davidsantiago.net/events/iii-congreso-nacional-barcelona-2003/',0,'event','',0),(484,1,'2011-01-12 20:16:13','2011-01-12 19:16:13','<p>IV&#160;Congreso de la Sociedad Española de Odontología Infantil Integrada</p> <p>Madrid, 11 y 12 de marzo de 2005</p> <p>Primer año que se solicitan y conceden acreditaciones, desde este momento, para&#160; todas las actividades se solicitaron y concedieron créditos de Formación Continuada (para Profesionales) y de Libre Configuración (para los alumnos de las Licenciatura).</p> <p>Este es un dato a destacar, dado que para ello, la actividad necesita reunir una serie de requisitos para su aceptación y su elaboración y la solicitud ha de ser realizada de modo minucioso y lleva mucho tiempo y trabajo.</p> <h2>Tríptico del congreso y programa</h2> <ul>   <li>Descargar:<b> <a href=\"resources/upload/link/94/IV-Congreso-Madrid-2005-portada.jpg\" target=\"_blank\">portada [JPG]</a></b> | <b><a href=\"resources/upload/link/94/IV-Congreso-Madrid-2005-interior.jpg\" target=\"_blank\">interior [JPG]</a></b></li> </ul>','IV Congreso Nacional Madrid 2005','','publish','open','open','','iv-congreso-nacional-madrid-2005','','','2016-03-14 16:48:36','2016-03-14 15:48:36','',0,'http://seoii.davidsantiago.net/events/iv-congreso-nacional-madrid-2005/',0,'event','',0),(485,1,'2011-03-18 15:47:29','2011-03-18 14:47:29','<p>Los días <strong>14 al 16 de marzo de 2013</strong> se celebró en Madrid el <strong>III Congreso&#160; Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada.</strong><strong><br /> </strong></p> <ul>   <li>Ver <a href=\"http://seoii.es/es/96/iii-congreso-internacional-viii-congreso-nacional-de-odontologia-infantil-integrada-madrid-2013#premios_congreso\"><strong>Premios de Comunicaciones del Congreso</strong></a></li> </ul> <p><img alt=\"\" src=\"resources/upload/image/96-madrid2013/presentacion-seoii-madrid2013.jpg\" /></p> <h3>Presentación</h3> <p align=\"justify\">Queridos y estimados compañeros,</p> <p align=\"justify\">Como Presidenta del Comité Organizador, me gustaría invitaros a  participar en el <strong>3er  Congreso&#160; Internacional&#160; y&#160; 8º  Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</strong> que  tendrá lugar del 14 al 16 de Marzo de 2013, en la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p align=\"justify\">En esta ocasión, trataremos temas de relevante  actualidad e impacto  que nos serán útiles en nuestro día a día, por  esta razón nos centraremos en  aquellos aspectos más novedosos en la  atención odontológica infantil a través  de mesas redondas, talleres y  cursos intracongreso.</p> <p align=\"justify\">Contaremos para ello con la colaboración de  diversos profesionales de  reconocido prestigio, tanto nacional como  internacional, pertenecientes a  distintos&#160; ámbitos de las Ciencias de  la  Salud.</p> <p align=\"justify\">Todo esto conforma un Congreso de carácter  multidisciplinar e  interprofesional, característica distintiva de  nuestra Sociedad (SEOII) que  esta comprometida con la innovación y la  mejora continuada, enriquecido por las  aportaciones de los  participantes realizadas mediante comunicaciones  presenciales y/o  pósters virtuales.</p> <p align=\"justify\">Nos gustaría contar con vuestra asistencia y a la  vez animaros a  recorrer Madrid,&#160; a disfrutar&#160; de una ciudad donde os  encontraréis en  vuestra casa. Madrid ofrece una gran diversidad  cultural, gastronómica y de  ocio, todo esto unido, a su vida en la  calle y a la forma  en que sus habitantes acogen al visitante.</p> <p align=\"justify\">En el convencimiento de que estos días que vamos a  disfrutar van a ser  inolvidables, os animo a compartir conocimientos y  amistades, lo que nos  ayudará a ser mejores profesionales y sobre todo  mejores personas.</p> <p align=\"left\">Esperando  contar con tu  presencia, recibe un&#160; fuerte abrazo</p> <p><strong>Dra. Mª Rosa Mourelle Martínez<br /> Presidenta Comité Organizador del 3er Congreso Internacional  y <br /> 8º Congreso  Nacional de la <br /> Sociedad Española de Odontología Infantil Integrada.</strong></p> <p>&#160;</p> <h3 id=\"premios_congreso\">Premios de Comunicaciones que se entregarán en el Congreso</h3> <ul>   <li><strong>Premio Dra. Rocio Cortés a la MEJOR COMUNICACIÓN ORAL presentada por un odontólogo o estomatólogo al 3º Congreso Internacional 8º Nacional de la SEOII</strong><br />   La Sociedad Española de Odontología Infantil Integrada patrocinado por las Dras. Mº del Carmen Martín de Agar y Blanca Loscertales Martín de Agar convocan el “PREMIO DRA. ROCIO CORTÉS” A LA MEJOR COMUNICACIÓN ORAL presentada por un Post-Graduado en Odontología o Estomatología sobre ODONTOLOGÍA INFANTIL al 3º Congreso Internacional 8º Nacional de la SEOII que tendrá lugar en Madrid desde el 14 al 16 de marzo de 2013. <br />   <a href=\"http://seoii.es/file/326\"><em>Descargar las bases</em></a></li>   <li><strong>Premio Dr. González-Meneses a la MEJOR COMUNICACIÓN al 3º Congreso </strong><strong><strong>Internacional </strong>8º Nacional de la SEOII</strong><br />   La Sociedad Española de Odontología Infantil Integrada convoca el “Premio DR. GONZÁLEZ-MENESES” A LA MEJOR COMUNICACIÓN ORAL presentada por un Post-Graduado en Odontología, Estomatología, Pediatría u otras Ciencias de la Salud sobre tema MULTIDISCIPLINAR en Odonto-Estomatología Infantil al 3º Congreso Internacional 8º Nacional de la SEOII que tendrá lugar en Madrid desde el 14 al 16 de marzo de 2013. <br />   <a href=\"http://seoii.es/file/327\"><em>Descargar las bases</em></a></li> </ul> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Facultad de Odontología</strong><br /> Universidad Complutense de Madrid - Ciudad Universitaria<br /> 28040 Madrid - Tel.+ 34 914520400</p>','Madrid 2013: III Congreso Internacional, VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada','','publish','open','open','','iii-congreso-internacional-viii-congreso-nacional-de-odontologia-infantil-integrada-madrid-2013','','','2016-03-14 16:48:36','2016-03-14 15:48:36','',0,'http://seoii.davidsantiago.net/events/iii-congreso-internacional-viii-congreso-nacional-de-odontologia-infantil-integrada-madrid-2013/',0,'event','',0),(486,1,'2011-03-28 20:22:35','2011-03-28 18:22:35','<p><img height=\"286\" width=\"200\" alt=\"\" src=\"http://seoii.es/resources/276\" class=\"right bordered\" />El día Sábado <strong>28 de Mayo de 2011 </strong>se celebró el <span style=\"font-weight: bold;\">VIII Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria, </span><strong>Sevilla</strong></p> <p>&#160;</p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos 0,92 Créditos de Formación Continuada y 1 Crédito de Libre Configuración para los alumnos de la Universidad de Sevilla.</strong></li>   <li><strong>Se entregará certificado de asistencia con créditos.</strong></li> </ul> <p>&#160;</p> <h3>Conclusiones</h3> <p>El pasado 28 de Mayo tuvo lugar en Sevilla el anual Encuentro Multidisciplinar e Interprofesional&#160; de&#160;la&#160; Sociedad Española de Odontología Infantil integrada (SEOII), Sociedad Española de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). Un Encuentro Multidisciplinar que, como en años anteriores, volvió a constituir un verdadero éxito de participación y comunicaciones científicas.</p> <p>En esta ocasión el tema monográfico a desarrollado fue “El maltrato infantil” y a él asistieron como ponentes y participantes Odontólogos, Estomatólogos, Pediatras, Psicólogos y Maestros.</p> <p>El acto fue inaugurado por el&#160; Ilmo. Sr. D. Ignacio Gómez de Terreros (Vicedecano de Hospitales de Sevilla y Presidente del Consejo Andaluz de asuntos de Menores);&#160;el Dr. José Luís Bonal Villanueva (Presidente de la SEPEAP),&#160;el Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca (Presidente honorífico de la SEPEAP) y&#160;la Dra. Antonia Domínguez Reyes (Presidenta de la SEOII).</p> <p>Reconocido por&#160;la Dirección General&#160; de Calidad Investigación y Gestión del Conocimiento con 0,92 créditos de Formación Continuada, y por la Universidad de Sevilla con 1 crédito de Libre Configuración, el tema de esta VIII reunión, se desarrolló en dos mesas redondas: <br /> En la primera, moderada por D. Rafael Muriel Fernández, trató&#160;la “Promoción y Recuperación en la intervención ante el maltrato infantil”. La segunda mesa redonda versó sobre “La incorporación de las voces infantiles en las políticas de salud”. Fue moderada por D. Antonio Garrido Porras y en ella se abordaron los distintos aspectos que supone la atención frente al maltrato: gestión, sanidad (“Opiniones infantiles a la vivencia hospitalaria”); “Análisis Cualitativo” y aspectos educacionales, presentándose, además, la llamada “Red Sabia” (Salud y buen trato a la infancia y adolescencia en Andalucía)</p> <p>Las comunicaciones, desarrolladas por diferentes profesionales de las distintas áreas de la salud, fueron muy comentadas por su actualidad y alto nivel.</p> <p>La Conferencia de Clausura estuvo a cargo del Dr. D. Ignacio Gómez de Terreros Sánchez y versó sobre estuvo centrada en “La convención sobre los derechos del niño en marcha. Nuestros avances y retos en 20 años de aplicación”.</p> <p>El Dr. D. José del Pozo Machuca, explicó&#160; la trayectoria de estas reuniones y el importante reconocimiento a su calidad científica. Reconocimiento que ha trascendido el ambiente universitario para integrarse en la sociedad y práctica profesional diaria. El Dr. Joaquín Ortiz Tardío, señaló la fundamental importancia que estos Encuentros Multidisciplinares tienen en la formación de todo profesional atento a la salud general del niño.</p> <p>La Dra. Domínguez Reyes, tras señalar que ya se está preparando el próximo Encuentro y que en Madrid en el 2013 tendrá lugar el próximo Congreso Nacional agradeció a la Universidad, a la Agencia de Acreditación y a las Sociedades SEPEAP y SPAOYEX su participación y patrocinio en este VIII Encuentro Multidisciplinar; a todos los ponentes su participación altruista; a las entidades Jonson &amp; Johnson, Ivoclar-Vivadent, Ortolan Dental, Elgydium y a la Fundación Cajasol su colaboración y a todos los asistentes su inquietud por aprender cada día un poco más a cerca del niño y su entorno, tras lo cual el Dr. Gómez de Terreros dio por clausurado el VIII Encuentro Multidisciplinar de la SEOII /SEPEAP/SPAOYEX.&#160;</p> <p><strong>&#160;&#160; </strong></p> <h3>Lugar de celebración</h3> <p><strong><strong>Sede del Congreso<br /> </strong></strong>Centro Cultural CAJASOL<br /> C/ Laraña nº 4 ( Sevilla)</p> <p><strong>&#160;&#160; </strong></p> <h3>Programa del congreso</h3> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/97-viii-sevilla2011/SEOII-VIII-Encuentro-Programa.pdf\">Archivo PDF</a></b></p> <p>&#160;</p> <h3 class=\"slideToggle\">Comité científico</h3> <div class=\"hide\"> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>Antonio F. Galán González</li>   <li>Ignacio Gómez de Terreros Sánchez</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del&#160; Pozo Machuca</li>   <li>Comité Organizador:</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> </div> <h3 class=\"slideToggle\">Comité Organizador:</h3> <div class=\"hide\"> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> </div> <h3 class=\"slideToggle\">Ponentes y participantes</h3> <div class=\"hide\"> <ul>   <li>Dr. D. José Luis Bonal Villanueva (Pediatra extrahospita-lario. Presidente de la SEPEAP)</li>   <li>Dª Ángeles Caballero Trigo (Trabajadora Social. HUS Valme).</li>   <li>Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).</li>   <li>Dª Isabel Escalona Labella (Jefa de Servicio de Promoción de la Salud y Participación Social. Subdirección General&#160; de Promoción de la Salud y Participación Social.&#160; Consejería de Salud. Junta de Andalucía).</li>   <li>D. Antonio Garrido Porras (Asesor Técnico Consejería de Salud).</li>   <li>Dr. D. Juan Gil Arrones (Pediatra. HUS Valme).</li>   <li>Dr. D. Ignacio Gómez de Terreros Sánchez (Profesor Titular de Pediatría. U. de Sevilla. Jefe Servicio de Pediatría Hospital Infantil Universitario Virgen del Rocío)</li>   <li>Dr. D. Mariano Hernán García (Profesor de Promoción de la Salud y Salud Pública en la Escuela Andaluza de Salud Pública. Master en Salud Pública y Gestión Sanitaria).</li>   <li>D. Pedro Jaén Rincón (Psicólogo. Presidente de ADIMA).</li>   <li>Dr. D. Jesús Jiménez Morago (Profesor de Psicología Evolutiva. Universidad de Sevilla).</li>   <li>Dra. Dª Carmen de Manuel Vicente (Psicóloga clínica. USMIJ Puerta del Mar).</li>   <li>Dr. D. Rafael Muriel Fernández (Asesor Técnico del Servicio Socio Sanitario. Secretaria General de Participación Pública. Conserjería de Salud Junta de Andalucía).</li>   <li>Dr. D. Joaquín Ortiz Tardío (Jefe de Servicio de Pediatría del Hospital de Jerez&#160; de la Frontera. Presidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).</li> </ul> </div> <p>&#160;</p> <h3>Galería de fotos del congreso</h3> <p><strong>1º Foto: Mesa Inagural de izquierda a derecha</strong><br /> - Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).<br /> - Dr. D. Joaquín Ortiz Tardío (Jefe de Servicio de Pediatría del Hospital de Jerez&#160; de la Frontera. Presidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).<br /> - Dr. D. Ignacio Gómez de Terreros Sánchez (Profesor Titular de Pediatría. U. de Sevilla. Jefe Servicio de Pediatría Hospital Infantil Universitario Virgen del Rocío)<br /> - Dr. D. José Luis Bonal Villanueva (Pediatra extrahospitalario. Presidente de la SEPEAP)<br /> - Dr. D. José del Pozo Machuca ( Vicepresidente de la Sociedad de Pediatría de Andalucía Occidental y Extremadura).</p> <p><strong>2º foto: Ponentes Primera Mesa Redonda (de izquierda a derecha)</strong><br /> - Dr. D. Rafael Muriel Fernández (Pediatra.Asesor Técnico. Consejería de Salud).<br /> - Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil y Ortodoncia Integrada. Universidad de Sevilla. Presidente de la SEOII).<br /> - Dra. Dª Carmen de Manuel Vicente (Psicóloga clínica. USMIJ Puerta del Mar).<br /> - Dr. D. Jesús Jiménez Morago (Profesor Titular de Psicología Evolutiva. Universidad de Sevilla).</p>','Sevilla 2011: VIII Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','viii-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:36','2016-03-14 15:48:36','',0,'http://seoii.davidsantiago.net/events/viii-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(487,1,'2011-05-19 01:08:39','2011-05-18 23:08:39','<p>Los días <strong>17 al 20 de febrero de 2011</strong> se celebró el <strong>2º Congreso Internacional y 7º Nacional de Odontología Infantil Integrada.</strong></p> <h2><strong>Acreditación de las Actividades Científicas</strong></h2> <ul>   <li><strong>Hasta 1,5 Créditos de Libre Configuración, Universidad de Murcia.<br />   </strong></li>   <li><strong>Hasta 3 Créditos de Libre Configuración, Universidad de Sevilla.</strong></li> </ul> <p>&#160;</p> <p><img height=\"156\" width=\"643\" alt=\"\" src=\"resources/upload/image/73/banner.jpg\" /></p> <p>En ciencias de la salud, <strong>los conocimientos </strong>no son compartimentos estancos, sino aspectos diferentes que<strong> deben ser integrados.<br /> </strong><strong>El niño es un ser dinámico que está en continuo crecimiento y desarrollo</strong> tanto físico como psíquico y social.<br /> Odontológicamente<strong> ha de ser visto, diagnosticado y tratado como un todo.</strong>&#160;</p> <p><strong>Congreso Multidisciplinar, Interdisciplinar e Interprofesional, </strong>en el cual se abordará al niño y adolescente en crecimiento y desarrollo.</p> <p>A través de ponencias, talleres prácticos y mesas redondas, globalmente se presentarán los últimos avances y conocimientos científicos-técnicos&#160;más actuales dentro de la <strong>Odontología Infantil.</strong></p> <p>Se integran materias como la<strong> Neurofisiología, Ortodoncia, &#160;Ortopedia Funcional, Radiología 3D, Pediatría, &#160;Otorrinolaringología, Logopedia, Fisioterapia, Osteopatía, Psicología,</strong> entre otras disciplinas en Ciencias de la Salud.</p> <p>Compartiremos conceptos e ideas como también distintas perspectivas de protocolos de actuación dentro de la Odontología en el niño.</p> <p>&#160;Para los alumnos de pre-grado de las distintas carreras de las Ciencias de la Salud, las Universidades de Murcia y Sevilla, concedieron hasta 1.5 y 3 créditos de Libre Configuración respectivamente.</p> <p>&#160;</p> <h1>Conclusiones del congreso</h1> <p><img src=\"http://seoii.es/admin/index.php/resources/view/246\" alt=\"\" /></p> <p>El evento estuvo constituido por cuatro Mesas Redondas y cuatro Talleres dedicados a Odonto-Estomatólogos y otros profesionales de las Ciencias de la Salud.</p> <p>Dentro de la Mesa Redonda, <i><b>“Tratamiento del niño en crecimiento y desarrollo. Visión global”</b></i>, (coordinada por la Dra. Domínguez Reyes, Profa Titular de Odontología Infantil y Ortodoncia Integrada en de la U. de Sevilla) la Dra. Marie- Josèphe Deshayes, Médico Estomatólogo y Paleontóloga, expuso dos temas: <i>Crecimiento craneal: vínculos con la dentición primaria; y Tratamientos precoces antes de los seis años de edad.</i></p> <p>Con ambas ponencias pudimos comprender mejor las fuerzas que dentro de la base craneal conducen el desarrollo facial hacia oclusiones específicas; y además, ver cómo, diagnosticando en el recién nacido pequeñas asimetrías faciales, se podía pronosticar y prevenir futuras asimetrías faciales de crecimiento y desórdenes en la ATM.</p> <p>El Dr.Yves Castaing Haerïng, Lcdo. en Fisioterapia y Doctor en Osteopatía por la Universidad de Medicina  de Montreal y Lyón, desarrolló la ponencia <i>“Osteopatía Craneal. Su influencia sobre la Oclusión durante el Crecimiento y Desarrollo en el Niño”.</i> En ella expuso que, la oclusión y, en general, la Odontología infantil, han evolucionado hasta tal punto, que, hoy, la misma, no puede considerarse separada del contexto general del cuerpo.</p> <p>La conferencia <i>“</i><i>Odontología en el niño: Futuro Funcional</i><i>”</i>, del Dr. Michael Gorbonos, Doctor of Dental Medicine DMD Medical University of Southen Africa, Medunsa, Rep. of South Africa y profesor visitante de Ortodoncia en Universidad Autónoma del Estado de Mexico, no solo señaló que la terapia funcional hace posible tra­tar problemas de manera más fácil y racional, sino que destacó la necesidad de crear una plataforma internacional para la do­cumentación, educación y conservación de las técnicas ortopédicas funcionales.</p> <p><b>La Segunda mesa redonda bajo el epígrafe general </b><i><b>de “La alimentación en el niño y sus repercusiones clínicas”, </b></i>estuvo constituida por los Drs. Juán Madrid Conesa; Cristina Cardoso Silva; Leopoldo Becerra Posada y Concepción López Soler.</p> <p>Moderada por la Profa. Elena Barbería (Catedrático de Odontopediatría en la U. Complutense de Madrid) y la Dra. Margarita Varela Morales (Jefe de la Unidad de Ortodoncia en la Fundación Jiménez Díaz de Madrid), los ponentes desarrollaron, respectivamente, “<i>Alimentar bien a nuestros hij@s: una asignatura pendiente”; “Alimentación y Nutrición: importancia de la salud bucal de los niños”;</i><b> </b><i>“Prevención de la caries desde el nacimiento. Generación Caries Cero”; y “Aspectos Psicológicos de la Odontología infantil y adolescente”</i></p> <p>En esta mesa redonda se recogieron los diferentes aspectos de la alimentación actual en los niños, las causas de la mala alimentación actual y las formas de corregir y mejorarla, una magnífica, clara y amena exposición del Dr. Madrid, en la que también mostró como se puede enseñar a comer correctamente a la población infantil mediante juegos. La Dra. Cardoso señaló que los cuidados de la salud oral deben comenzar ya desde el embarazo con educación a las futuras madres y su entorno.</p> <p>El Dr. Becerra (Odontopediatra por la U. de los Ángeles) expuso, por primera vez en España, su más que interesante iniciativa de la Cartilla odontológica para el bebé con objeto de obtener generaciones caries cero; y la Dra. Soler, los distintos aspectos y manifestaciones de la conducta infantil en el gabinete dental, aportando estrategias racionales para el control de la conducta y comprensión psicológica de las distintas situaciones.</p> <p>Moderada por los Drs. Luis A. Bravo (Prof. Titular de Ortodoncia en la U. Murcia) y el Prof. Joaquín de Nova (Titular de Odontopediatría en la U. Complutense de Madrid) tuvo lugar la tercera mesa redonda bajo el título general de “<i><b>Abordaje Odontológico-Clínico en situaciones de compromiso.</b></i></p> <p>Los “<i>Traumatismos en dentición temporal y sus efectos en la dentición definitiva”</i> fueron expuestos por el Dr. García Ballesta de la Universidad de Murcia; la “<i>Revisión de la Oligodoncia no sindrómica” </i>por el Dr. Arturo Sánchez Pérez; “<i>En busca del Equilibrio estético funcional” </i>por el Dr<i>. A</i>ntonio Matos da Fonseca, Cirujano Maxilo-Facial en la U. de Lisboa y<b> </b>el “<i>Presente y futuro de la imagen. Imagen 3D en Odontología”</i> por el Dr. Vicente Hernández Soler.</p> <p>Las cuatro ponencias, de alto nivel científico, constituyeron una total puesta al día de los diversos temas y los diferentes agentes de distinta naturaleza que pueden desviar el curso del crecimiento cráneo-facial en el niño.</p> <p>La cuarta y última Mesa Redonda, <i><b>Relaciones Clínicas Sistema Estomatognático / vías aéreas</b></i><b>”</b> fue desarrollada por la Dra. Yolanda Cerezo del Olmo<b>,</b> Especialista en Pediatría, que disertó sobre las<b> </b><i>“Patologías más frecuentes en el niño que pueden implicar alteraciones del sistema estomatognático”; </i>la Dra. Concepción Maeztu Sardiña, que habló sobre los <i>“Trastornos respiratorios del sueño (SAOS) y su abordaje Neurofisiológico en niños y adolescentes”.</i></p> <p>Con “<i>Ortodoncia y ORL infantil. La importancia de trabajar en equipo”</i>,<i> el Dr.</i><b> </b>Carlos Escobar Sánchez (Otorrinolaringólogo Prof. en la Facultad de Murcia) señaló las íntimas relaciones que puede tener la ortodoncia y las afecciones otorrinolaringológicas y el<i> </i>Prof. Juan Cobo Planas, (Catedrático de Ortodoncia en la Universidad de Oviedo) que disertó sobre “<i>Ortopedia Maxilar y Vías Aéreas Superiores”. En esta </i> ponencia, expuso las relaciones y efectos de las afecciones de las vías aéreas superiores sobre el desarrollo normal y  posibles anomalías del Sistema Estomatognático, destacando que el trabajo multidisciplinar e interprofesional, en muchas ocasiones, era más que necesario.</p> <p>Esta mesa redonda fue moderada por los Drs. Ustrell, Prof. Titular de Ortodoncia. U.de Barcelona,  y el Prof. Oñate, Prof. Titular de Pacientes Especiales en la U. de Murcia.</p> <p>Tras cada mesa redonda se estableció un animado coloquio entre moderadores ponentes y congresistas en los que pudo detectarse, no solo la alta participación de los asistentes, sino el gran interés despertado por los temas del Congreso y sus ponentes.</p> <p><b>Los cuatro Talleres </b>dirigidos a Odonto-Estomatólogos y otros profesionales en ciencias de la salud fueron:</p> <p>“<i><b>Taller de  Relación Oclusión- ATM según la Rehabilitación Neuroclusal”, </b></i>impartido por la Dra.Dª. Mercedes Gálvez Jiménez</p> <p>“<i><b>Taller De Disfunción Del Aparato Masticatorio: Diagnóstico Diferencial Oclusal- Osteopático-Visual”</b></i><b> </b>impartido  por Dra. Amaia Iturburu Aranzabal y  D. Donato Martínez Mateo.</p> <p>“<i><b>Taller De Intervención Logopédica Funcional En Los Desordenes Orales”, </b></i>impartido por la Licenciada Sonia Muñoz Rico</p> <p>“<i><b>Taller De Salud Oral En El Paciente En Crecimiento”, </b></i>impartido por<i><b> </b></i>la Dra<i><b>.</b></i></p> <p>Ivanna Camps Pereperez.</p> <p>Estos talleres a los que asistieron diferentes profesionales de las Ciencias de la Salud (odontólogos, fisioterapeutas, pediatras etc,) pusieron al alcance de todos los participantes formas prácticas, distintas maniobras y técnicas que permitían abordar al paciente infantil como un todo, de forma integral y en equipo multidisciplinar.</p> <p>En el Acto de Clausura, tras unas palabras de la Presidenta de la SEOII, se comunicó que la Sede del VIII Congreso Nacional sería Madrid y su organización correspondería a la Dra. Rosa Mourelles, Profesora de la Facultad de Odontología de la U. Complutense de Madrid.</p> <p>Así mismo comunicó el Hermanamiento de nuestra Sociedad con la International Functional Assosiation (IFUNA).</p> <p>La SEOII y el Comité Organizador del Congreso agradecieron a ponentes y congresistas su asistencia y activa participación; a las Instituciones su eficaz apoyo, a los Patrocinadores  Johnson-Johnson e Imper-Ortho, su inestimable colaboración en la realización de este importante evento científico y a los colaboradores, Kin, Ripano, Osteoplac, Maxillaris y Gaceta Dental  su contribución.</p> <p>&#160;</p> <h1>Carta de bienvenida</h1> <p>Queridos y estimados compañeros:</p> <p>En nombre del Comité Organizador quisiera invitaros al <strong>\"2º Congreso Internacional y 7º Nacional de la Sociedad Española de Odontología Infantil Integrada\"</strong> que se celebrará en<strong>&#160; Murcia del 17 al 20 de Febrero&#160; de&#160; 2011.</strong>&#160; Nuestro&#160; Congreso&#160; versará&#160; sobre&#160; las<strong>&#160; técnicas&#160; más&#160; actuales&#160; e&#160; innovadoras&#160; en&#160; el diagnóstico y tratamiento del niño en crecimiento y desarrollo. </strong>Compartiremos tanto conceptos e ideas como distintas perspectivas de protocolos de actuación dentro de laOdontología del niño.</p> <p>Siendo la <strong>SEOII la primera Sociedad Española e Internacional creada con carácter multidisciplinar e interprofesional,</strong> y aprovechando esta inigualable ocasión, hemos realizado un importante esfuerzo para&#160; ofrecer&#160; a&#160; todos&#160; lo&#160; mejor&#160; y&#160; más&#160; actual&#160; de&#160; la&#160; Odontología&#160; Infantil:&#160; Neurofisiología,&#160; Ortopedia Funcional, Pediatría, Logopedia, Otorrinolaringología, Psicología y Fisioterapia, que comparten nuestro concepto de ver al niño de manera global e integrada.</p> <p><strong>Un&#160;&#160; Congreso&#160;&#160;&#160; para&#160; aprender&#160;&#160;&#160; con&#160; ponencias&#160;&#160;&#160; y&#160; comunicaciones&#160;</strong>&#160;&#160;&#160; que&#160;&#160; reflejan las&#160; inquietudes&#160;&#160; y necesidades de nuestro tiempo<strong>, con talleres prácticos</strong>&#160; que ponen a disposición aprendizajes de alta calidad, y gran actualidad en la integración con otras disciplinas como demanda nuestra sociedad.</p> <p><strong>Os&#160; invito&#160; muy&#160;&#160; cordialmente,&#160;&#160;&#160; con&#160; la seguridad&#160;&#160; de&#160; que&#160;&#160; en&#160; Murcia&#160; os&#160; sentiréis&#160; acogidos por&#160; la&#160; hospitalidad de su gente</strong> y os sorprenderéis por la variedad y riqueza de sus expresiones artísticas,&#160; naturales y gastronómicas, de modo que podremos conjugar ocio y ciencia para conseguir juntos que esteCongreso de laSEOII sea inolvidable para todos nosotros.</p> <p>Un afectuoso saludo</p> <p><strong>María Eugenia Cabaña Muñoz</strong><br /> Presidenta del Comité Organizador</p> <p>&#160;</p> <h1>Lugar de celebración</h1> <p><img height=\"110\" width=\"266\" class=\"right bordered\" alt=\"Hotel Nelva Murcia\" src=\"resources/upload/image/73/hotel-nelva-murcia.jpg\" /></p> <p><strong><strong>Sede del Congreso<br /> </strong></strong>Hotel Nelva<br /> Av. Primero de Mayo, 9&#160;<br /> 30006 Murcia<br /> Tlf.: 968 06 02 00<br /> <a href=\"http://www.hotelmurcianelva.com\"> www.hotelmurcianelva.com</a></p> <p>&#160;</p> <h1>Formulario de inscripción y alojamiento&#160;</h1> <p><strong>Secretaría Técnica - VIAJES EL CORTE INGLES</strong><br /> Departamento &#160;de Congresos<br /> C/ Catedrático Eugenio Úbeda Romero, 6 • 30008 Murcia • Spain<br /> Teléfono +34 968-272390 • FAX +34 968-249721<br /> e-Mail: congresosmurcia@viajeseci.es</p> <p>Descarga el formulario de inscripción y alojamiento: <a href=\"http://seoii.es/resources/upload/link/73/SEOII-Formulario-de-Inscripcion.pdf\"><strong>Archivo PDF</strong></a></p> <p>&#160;</p> <h1>Programa del congreso</h1> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/73/SEOII-programa-congreso-Murcia2011.pdf\">Archivo PDF</a><br /> </b></p> <p>Descargar el cartel:<strong>&#160;<a rel=\"XprettyPhoto\" target=\"_blank\" href=\"resources/upload/image/73/cartel-web.jpg\">Archivo JPG<br /> </a></strong></p> <p>&#160;&#160;</p> <h1>Envío de comunicaciones</h1> <p>Las personas que deseen enviar sus comunicaciones al congreso pueden hacerlo a través de dirección de correo electrónico <strong><a href=\"mailto:comunicaciones@seoii.es?subject=Comunicaciones\">comunicaciones@seoii.es</a></strong></p> <p>Se ha prorrogado la entrega de <strong>comunicaciones hasta el día 15 de enero</strong><strong> de 2011</strong></p> <p>Descargar las instrucciones para la preparación y envío de comunicaciones orales:<strong>&#160;<a href=\"http://seoii.es/resources/upload/link/73/SEOII-Normas-de-comunicaciones.pdf\">Archivo PDF</a></strong></p> <p>&#160;</p> <h1>Ponentes del Congreso</h1> <h4><strong>Dra. MERCEDES GÁLVEZ JIMÉNEZ</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Odontólogo y Doctora en Medicina y Cirugía por la Universidad de Granada. Profesora Colaboradora de Prácticas Clínicas en Odontología Infantil Integrada de la Facultad de Odontología de Sevilla. Profesora del Máster de Odontología Infantil Integrada de la Facultad de Odontología de la Universidad de Sevilla, donde imparte enseñanza de Rehabilitación Neuroclusal (RNO) y Ortopedia Funcional de los Maxilares. Formada en esta disciplina bajo la dirección de los Drs. Pedro Planas en Barcelona y Wilma Simoes en Brasil. Coautora en capítulos de libros, es dictante de varios cursos en Hispanoamérica sobre RNO y en Foros españoles de Fisioterapeutas y Foniatras.</p> <hr /> <h4>Dra. ANTONIA DOMÍNGUEZ REYES</h4> <p><strong>Currículum:</strong> Doctor en&#160; Medicina y Cirugía por la Universidad de Sevilla. Especialista en Estomatología. Médico Puericultor. Profesor Titular de&#160; Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de Sevilla. Diploma Universitario en Ortodoncia y Ortopedia Dentofacial por la Universidad Paul Sabatier, Toulouse III (Francia). Directora del Máster Universitario en Odontología Infantil Integrada. Directora del Titulo de Experto Universitario en Tratamiento Global, Secuencial Avanzado en Odontología Infantil. Investigadora responsable en diversos Proyectos de Investigación financiados por la Junta de Andalucía y la Universidad de Sevilla. Profesora Invitada y Realización de Actividades Docentes e Investigadora en la Universidad do Vale do Itajaí de Brasil. Autora de numerosas publicaciones en revistas nacionales e internacionales. Dictante de varios cursos sobre Odontología en el niño y adolescente. Directora de varias Tesis Doctorales, DEA y Tesinas. Autora de diversos capítulos de libros sobre Odontología Infantil Integrada. Fundadora y actual Presidenta de la Sociedad Española de Odontología Infantil Integrada (SEOII). Miembro del Comité Cientifico del Journal of the American Dental Association (JADA) edición española. Miembro del Consejo Asesor de la Revista Claves de Odontología. Dependiente del Círculo Odontológico de Córdoba (Argentina). Revisora de las Revistas Journal of&#160; Contemporary Dental Practice e International Journal of Paediatric Dentistry.</p> <hr /> <h4><strong>Dra. AMAIA ITURBURU ARANZABAL</strong><strong><strong><br /> </strong></strong></h4> <p><strong>Currículum:</strong> Licenciada en Medicina y Cirugía por la UPV en 1981. Diplôme Dòsteopathe (Collegiale Academique de France) 2002. Coordinadora de“Osteopatía Cráneo Sacra” en la Escuela Universitaria de Osteopatía de Murcia. Profesora de Osteopatía Craneal del “Máster Oficial en Osteopatía” de la Universidad Pública de Murcia.<br /> Secretaria de la Fundación Española de Osteopatía (2007).&#160;&#160; Profesora del Master “Experto en terapia Orofacial y Miofuncional”. “Trastornos en la articulación Cráneo Mandibular” en la Universidad Pontificia de Salamanca (Curso 2008-2009; 2009-2010).<br /> Miembro del&#160; SEDCYDO (Sociedad Española de Disfunción Cráneo-mandibular y dolor Orofacial)). Miembro del “European Council of Osteopathic&#160; Education”</p> <hr /> <h4>Sr.&#160;DONATO&#160;MARTÍNEZ MATEO<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Licenciado en Educación Física. INEF Madrid (Universidad Politécnica de Madrid) Cursos 1986/87 al curso 1990/91.<br /> Funcionario de Carrera del Cuerpo Profesores de Enseñanza Secundaria.<br /> Diploma de Osteópata, por la Escuela Europea de Osteopatía (Murcia). 5500 horas lectivas. Murcia. 2002/2008.<br /> Diplôme de Fin de Deuxième Cycle d’Etudes Ostéopathiques, por la Ecole Superieure d’Osteopathie de París, 2008, tras la defensa de su mémoire “Influencia inmediata y a las 48 horas de la técnica rodamiento alternativo de temporales con amplitud descendente sobre parámetros cardiovasculares” en París.<br /> Docente en el Máster Oficial de Osteopatía (Universidad de Murcia) <br /> Actualmente realiza la tesis doctoral en el Dpto de Anatomía Humana y Psicobiología de la Universidad de Murcia, con el título: Influencia de la técnica osteopática “rodamiento alternativo de temporales” sobre la presión arterial y frecuencia cardiaca. Cuantificación del estímulo y elección del protocolo más eficaz.</p> <hr /> <h4><strong>Dra. MARIE-JOSÈPHE DESHAYES</strong></h4> <p><strong>Currículum: </strong>Médica Antropóloga. Miembro de la Sociedad Francesa de Ortopedia Dento-Facial. Miembro del Club Internacional de Morfología Facial. Miembro fundador del Club Telecrane Internacional. Miembro de la Sociedad Antropológica de París. Autora de numerosos cursos, artículos y conferencias. Autora de libros como “Repérages Crâniens” “L\'art de traiter avant 6 ans”&#160;y “Craniofacial Morphogénesis”.</p> <hr /> <h4>Dr. YVES CASTAING HAERÏNG<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Licenciado en Podología en Paris (1978). Graduado en Kinesioterapia y Rehabilitación Funcional en la Facultad de Medicina de Burdeos (Francia). Doctor en Osteopatía por la Universidad de Medicina&#160; de Montreal (1984) y la Facultad de Medicina de Lyón (Francia, 1986). Sus investigaciones y trabajos en ese ámbito, le han conducido a una verdadera especialización en Osteopatía Craneal Infantil. Posee el Diploma Universitario en Fukuoka (Japón) y el de Acupuntor por la Facultad de Medicina de Burdeos. Actualmente, además de ser miembro del Colegio de Osteópatas de Francia y España, trabaja en colaboración con centros de maternidad franceses (Perpignan, Bordeaux, Toulouse) y españoles (Madrid y Barcelona). Autor de diversos artículos en Francia, también es autor del Libro, en español, “Osteopatía Craneal usted y su bebe”. En la actualidad transmite el resultado de sus investigaciones y experiencias sobre la osteopatía a través de conferencias y seminarios internacionales.</p> <hr /> <h4>Dr. DAVID SUÁREZ QUINTANILLA<strong><strong><br /> </strong></strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina por la Universidad de Santiago de Compostela. Especialista en Estomatología (Universidad de Oviedo). Máster Europeo en Ortodoncia y Ortopedia Dentofacial (Universidad de Valencia). Catedrático de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Santiago de Compostela. Councillor&#160; y&#160; Elect President 2012 de la European Orthodontic Society <br /> Diplomado de la Sociedad Española de Ortodoncia. Miembro de la International Academy of Dentistry , SEDO, AESOR, WFO , AIO, AAO y otras sociedades científicas. Miembro fundador del European&#160; Orthodontic Teacher´s Forum&#160; (EOTF) y de la Sociedade Galega de Ortodoncia (SGO). Académico Corresponsal desde 1996 de la Real Academia de Medicina y Cirugía de Galicia. Premio de la Real Academia de Medicina y Cirugía de España. Responsable de varios proyectos de investigación financiados. Director de numerosas Tesis Doctorales y artículos publicados en revistas nacionales y extranjeras<br /> Autor de varios libros y capítulos de libros. Creador de la Técnica de Ortodoncia Straight Wire Low Friction (SWLF) en la RMO de Denver (EEUU). Ha impartido cursos en diversas&#160; Universidades y países.</p> <hr /> <h4>Dr. MICHAEL GORBONOS<strong><br /> </strong></h4> <p><strong>Currículum: </strong>1990 University of Timishoara (Romania). Doctor of Dental Medicine DMD (1995) Medical University of Southen Africa, Medunsa, Rep. of South&#160;&#160; Africa. Master of Dental Science MDS. 2008. Visiting Professor&#160; at the Department of&#160; Orthodontic, Universidad Autónoma del Estado De Mexico, Mexico.Teaching and Academic Experience.1991-1996 Senior Lecturer at the Department of Orthodontics and Pedodontics University of Medunsa South Africa. President of IFUNA International Functional Association (2007).&#160; Presisident of I International Congress of Ifuna November (Paris. France), (2008) President of II International Congress of Ifuna October (2008) University of Barcelona, Spain, (2009) President of III International Congress of Ifuna October&#160; 2009 University of Torin, Italy. 2010 Chief Editor - Electronic Journal of Ifuna- IFUNA VIEW. Lecturering worldwide Languages: English, Hebrew, Russian, Spanish and Romanian.</p> <hr /> <h4>Sra. SONIA MUÑOZ RICO<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Bachelor of Science with Honours in Logopedics. The University of Manchester, Inglaterra. Homologado en España como Licenciatura en Logopedia. Profesora Colaboradora Honoraria de la Universidad de Murcia. Logopeda de la ADFY (Asociación de Discapacitados Físicos de Yecla). Colaboradora en diferentes programas de divulgación logopédica. Directora del Centro de Logopedia, Estimulación y Reeducación Neuro-Sensorial C.L.E.R.N. de Yecla (Murcia).&#160;</p> <hr /> <h4>Dra. MARÍA&#160;EUGENIA&#160;CABAÑA&#160;MUÑOZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Odontóloga por la Universidad Nacional de Córdoba, Argentina.<br /> Licenciada en Odontología por la Universidad de Granada, España.<br /> Diploma Universitario de Ortodoncia y Ortopedia Dentofacial.<br /> Université Paul Sabatier. Faculté de Chirurgie Dentaire. Toulouse III. Francia.<br /> Proyecto de investigación sobre Microimplantes en Ortodoncia en la Universidad de Murcia.<br /> Ponente en Cursos y Conferencias Nacionales e Internacionales sobre Microimplantes y Ortodoncia.<br /> Profesora Colaboradora del Master de Ortodoncia y Ortopedia Dento-Facial de la Universidad de Murcia.<br /> Presidenta del 1º Congreso Europeo de Microimplantes, Murcia, España.<br /> Miembro de SEDO, SEDCYDO, SEOII, AESOR, AAO, EOS, WFO.</p> <hr /> <h4>Dra. CATALINA CANALDA ALFARA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Barcelona (1972). Médico Estomatólogo. Ortodoncista con práctica en niños y adultos de los trastornos de la Oclusión y Disfunción Cráneo Mandibular (D.C.M.). Colabora con el Profesor Pedro Planas desde 1979. Desde 1984 hasta 1994 ejercicio en asociación con el Profesor Pedro Planas. Desde 1994 ejerce en asociación y comparte la dirección de Dentoclinic&#160; con el Dr. Carlos de Salvador Planas. Miembro del&#160; C.I.R.N.O (Club Internacional de Rehabilitación Neuro Oclusal).Miembro de la Asociación Española Pedro Planas de R.N.O. (A.E.P.P.) Miembro de la S.F.O.D.F.(Sociedad de Ortopedia Dento Facial Francesa). Miembro fundador del C.E.R.N.O. (Club de Enseñanza de Rehabilitación Neuro Oclusal). Miembro de Honor de la Sociedad de Ortopedia Funcional de los Maxilares de Venezuela. Conferenciante invitada en varios países de Europa y América donde además ha impartido e imparte Cursos de divulgación y talleres de R.N.O. primero con el Dr. Pedro Planas y más tarde con el Dr. Carlos de Salvador Planas, (1987-2010).&#160;</p> <hr /> <h4>Dra. IVANNA CAMPS PEREPEREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía (1989) y Odontología (1992) por la Universidad de Valencia. Ortodoncista (Valencia1994). Profesora del Máster de Ortodoncia Facultad de Medicina y Odontología de la Universidad de Valencia (2005-2009). Profesora del Máster de Ortodoncia CEU Universidad Cardenal Herrera (Valencia) desde 2009.</p> <hr /> <h4>Dr. JUAN MADRID CONESA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en medicina y Cirugía. Especialista en Endocrinología y Nutrición. Endocrinólogo y Nutricionista en el Hospital Universitario Virgen de la Arrixaca desde hace más de 25 años, es autor de diversas comunicaciones y publicaciones científicas en Congresos y Revistas nacionales e internacionales. Autor de numerosos libros sobre la diabetes, el sobrepeso, la obesidad&#160; y otros problemas endocrinológicos y nutricionales en niños y adultos. Colaborador habitual en numerosas publicaciones y actividades de la Consejería de Sanidad de la Comunidad de Murcia. Asiduo participante en actividades sanitarias de divulgación en diversos medios de&#160; comunicación.</p> <hr /> <h4>Dra. CRISTINA CARDOSO SILVA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina Dentaria por el “Instituto Superior de Ciencias da Saúde – Norte” de Portugal. Máster en Odontopediatría (Facultad de Odontología. Universidad Complutense de Madrid). Máster en Ciencias Odontológicas de la Facultad de Odontología (Universidad Complutense de Madrid). Doctor en&#160; Odontología por la Facultad de Odontología de la Universidad Complutense de Madrid. Asistente invitada de Odontopediatria en la “Faculdade de Medicina Dentária” de la Universidade do Porto (Portugal). Miembro del equipo investigador del “Programa de Atención Odontológica Integral a pacientes en edad infantil” (Facultad de Odontología, Universidad Complutense de Madrid). Autora y coautora de diversas publicaciones en revistas nacionales e internacionales. Premio Revista “Dental Practice” al mejor artículo en español y Premio Revista “JADA – Edición Española” al mejor artículo en español (2007 /2008). Miembro de la “International Association of Paediatric Dentistry”e “International Association of Dental Traumatology”.</p> <hr /> <h4>Dr. LEOPOLDO BECERRA POSADA</h4> <p><strong>Currículum: </strong>Cirujano Dentista.&#160; Universidad Tecnológica de México, UNITEC. Certificado en Odontopediatría, Universidad de Los Ángeles, California. UCLA. Certificado en Niños con Retraso Mental y Discapacitados. Universidad de Los Ángeles, California. UCLA – Neuro Psychiatric Institute. Master en Ortodoncia. Universidad Intercontinental. UIC. México, D.F. Diplomado en Gestión, Dirección, Mercadotecnia y Administración Hospitalaria. Universidad La Salle – Hospital Médica Sur. México, D.F. Diplomado en Técnica Roth Williams. Universidad Nacional Autónoma de México. UNAM. Diplomado en Ortodoncia y Cirugía Ortognática. Universidad Nacional Autónoma de México. UNAM.</p> <hr /> <h4>Dra. CONCEPCIÓN LÓPEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Dra. en Psicología (1986). Responsable de la Consulta de Psicología Clínica en el Hospital Virgen de la Arrixaca desde 1988. Profesora Vinculada Clínica, en el Hospital U. V. Arrixaca desde julio 2006. Responsable de la Unidad Asistencial de Psicología Clínica en Hospital Morales Meseguer (1993- 1996). Profesora Asociada a tiempo completo de Psicología Medica en la Facultad de Medicina de la Universidad de Murcia (1982- 1986). Profesora Titular de Personalidad Evaluación y Tratamientos Psicológicos en la Facultad de Psicología. Especialista en Psicología Clínica (1998). Directora del Centro de Orientación y Estudios Psicológicos (COEP) de la Universidad de Murcia (1990- 1994). Directora del Curso Psicología Clínica I Escuela de Práctica Psicológica. Miembro de la Comisión Nacional de Psicología Clínica (Ministerio de Sanidad 1999- 2006). Presidenta de la Asociación para el Desarrollo de la Salud Mental en Infancia y juventud “Quiero Crecer” (desde 2008). Investigadora titular y participante en diversos proyectos, es autora de diversas publicaciones en Revistas Internacionales y coautora en varios libros sobre psicología infantil.</p> <hr /> <h4>Dra. ELENA BARBERIA LEACHE<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Universidad de Navarra. Doctor en Medicina y Cirugía UCM. Médico Estomatólogo UCM y Doctor en Odontología UCM. Especialización en Odontopediatría. Especialización en Ortodoncia UCM. Profesor en la U.C.M.<br /> Catedrático de Universidad desde 1989. Departamento de Profilaxis, Odontopediatría y Ortodoncia. <br /> Directora del Curso de Especialización en Odontopediatría: 1979-88.<br /> Directora del Máster de Odontopediatría: 1988- actualidad.<br /> Participación como investigadora Principal o Investigadora en 24 proyectos financiados. En la actualidad, actividad clínica en el “Programa de Atención Odontológica a Pacientes en Edad Infantil” de la Universidad Complutense de Madrid. Directora de más de veinte Tesis Doctorales, Tesinas y&#160; trabajos para Diploma de Estudios Avanzados. Con más de 150 publicaciones en revistas nacionales e internacionales, además, es autora de varios libros y atlas sobre Odontopediatría para Odonto-Estomatólogos y Pediatras. Socio de Honor de la Asociación Española De Pediatría. Director Asociado del Journal of the American Dental Association (JADA), edición española. Editor Asociado para España del European Journal of Pediatric Dentistry. Marzo 2006. Revisora científica del European Journal of Pediatric Dentistry. Enero 2006. Revisor científico del European Journal of Dentistry. Enero 2008. Dictante, de numerosos cursos, conferencias y comunicaciones Nacionales y Extranjeras.</p> <hr /> <h4>Dra. MARGARITA VARELA MORALES<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Médico, especialista en Medicina Interna, Estomatología y Ortodoncia.<br /> Jefe de la Unidad de Ortodoncia y Directora del Programa de Postgrado de Ortodoncia de la Fundación Jiménez Díaz. Autora de&#160; libros y capítulos de libros&#160; sobre problemas bucodentales en Pediatría, Ortodoncia interdisciplinar y otros textos pediátricos.<br /> Profesora Honoraria del Dpto. de Pediatría de la Facultad de Medicina de la Universidad Autónoma de Madrid. Numerosas&#160; publicaciones en revistas nacionales e internacionales y Dictante y Organizadora de Conferencias y Cursos de formación dirigidos a ortodoncistas y a pediatras.</p> <hr /> <h4>Dr. CARLOS GARCÍA BALLESTA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Profesor Titular de Odontopediatría en la Facultad Odontología de la Universidad de Murcia. Académico de Número de la Real Academia de Medicina y Cirugía de Murcia. Ex-Presidente de la Sociedad Española de Odontopediatría. Premio de la Sociedad Española de Odontopediatría (once ocasiones), Sociedad Española de Periodoncia, Sociedad Española de Odontología Preventiva y Comunitaria (siete ocasiones), Sociedad Española de Estomatología, Real Academia de Medicina y Cirugía de Murcia (tres concursos de premios) y Real&#160; Academia Nacional de Medicina (Premio Prof. Juan Pedro Moreno). Con 130 trabajos publicados, 183 comunicaciones en congresos nacionales e internacionales, es autor o coautor de once libros sobre Odontopediatría. En el campo de la investigación, es Director&#160; de varios proyectos sobre traumatología dental financiados por el Fondo de&#160; Investigación&#160; Sanitaria - Unión Europea&#160; (FIS- FEDER), siendo, además, Evaluador Internacional de Universidades.</p> <hr /> <h4>Dr. ARTURO SÁNCHEZ PÉREZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina y Cirugía por la Universidad de Murcia.<br /> Medico Diplomado en Medicina del Trabajo (Murcia 1985).<br /> Medico especialista en Medicina deportiva (Murcia 1986).<br /> Medico especialista en Estomatología por la Universidad de Murcia (1988). Master en implantología y periodoncia por la Universidad de París VII 1992. Profesor encargado de Periodoncia desde 1993.<br /> Profesor Asociado a tiempo completo desde 2005.<br /> Vocal por la Región de Murcia del Centro de Estudios de la III Región.<br /> Presidente del Grupo de Estudios Murciano Odontoestomatológicos.<br /> Vicedecano de Odontología desde 2006.<br /> Autor o colaborador de 10 Libros de la especialidad.<br /> Autor de 44 publicaciones de la especialidad en revistas Nacionales e Internacionales. Dictante de&#160; 112 comunicaciones a Congresos. Dictante de 61 cursos. Director de 4 tesis doctorales todas con premio otorgado.</p> <hr /> <h4>Dr. ANTONIO MATOS DA FONSECA<strong><br /> </strong></h4> <p><strong>Currículum:</strong> Médico egresado de la&#160; Facultad de Medicina de Lisboa (1977). <br /> Especialista en Cirugía Maxilofacial. Hospital de S. José. Lisboa.<br /> Director de la “Clínica da Face”. Lisboa. Fellow of the European Board of Maxillofacial Surgery. Consultor del Hospital Pediátrico de D. Estefanía. Lisboa. (1998-2002). Consultor del Hospital Fernando da Fonseca. Amadora – Sintra. Miembro de la Sociedad de las Ciencias Médicas de Lisboa. Miembro de la Sociedad Portuguesa de Cirugía Cráneo-Maxilo-Facial. Miembro de la Sociedad Española de Cirugía Oral y Maxilofacial. Miembro de la Sociedad Portuguesa de Cirugía Plástica Reconstructiva y Estética. Miembro de la “International Association of Oral and Maxillofacial Surgeons”. Miembro de la Federación Ibero-Latino-Americana de Cirugía Plástica. Fellow of the International College of Surgeons. Profesor Titular de Terapéutica Especial del “Instituto Superior de Ciências da Saúde”.&#160; Portugal. (2003-2007). Profesor Honorario de la&#160; Universidad Alfonso X El Sabio - Madrid. Profesor del Posgrado de Cirugía Oral de la Universidad Lusófona - Lisboa. Profesor del Posgrado de Cirugía del CETAO – São Paulo – Brasil. Su actividad se desenvuelve en el campo de las dismorfologías cráneo-faciales. Co-autor del libro “Ortodoncia y Cirugía Ortognática” Diagnóstico y Planificación. Editado en Español, Portugués, Italiano e Inglés.</p> <hr /> <h4>Dr. VICENTE HERNÁNDEZ SOLER<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Doctor en Medicina. Estomatólogo. <br /> Certificate in Orthodontics and Master in Medical Sciences (Harvard U, Boston, USA). Miembro diplomado de la SEDO.<br /> Diplomate of the American and European Board of Orthodontics. <br /> Active member of the Edward Angle Society. Profesor asociado de la Universidad de Valencia.</p> <hr /> <h4>Dr. LUIS&#160; ALBERTO BRAVO GONZÁLEZ<strong><br /> </strong></h4> <p><strong>Currículum:&#160; </strong>Doctor en Medicina y Cirugía. Especialista en Estomatología. Profesor Titular de Ortodoncia de la Universidad de Murcia. Director del Máster de Ortodoncia y Ortopedia Dentofacial de la Universidad de Murcia.<br /> Miembro Diplomado de la SEDO. Miembro Diplomado del European Board of Orthodontists. Miembro Activo de la Sociedad Europea de Angle</p> <hr /> <h4>Dr. JOAQUÍN DE NOVA GARCÍA<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Prof. Titular de Odontopediatría de la Universidad Complutense de Madrid (UCM).<br /> Director del Título Propio (UCM): Especialista en Atención Odontológica Integrada en el niño con necesidades especiales.<br /> Vocal de la SEOII.</p> <hr /> <h4>Dra. YOLANDA CEREZO DEL OLMO<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciada en Medicina y Cirugía por la Universidad de Murcia. Especialista en pediatría. Formación en el H. San Juan. Con diversas comunicaciones en Congresos de Pediatría, ejerce la especialidad en el Servicio de Salud de la Comunidad de Murcia.</p> <hr /> <h4>Dra. CONCEPCIÓN MAEZTU SARDIÑA</h4> <p><strong>Currículum:</strong> Licenciada en Medicina Y Cirugía. Facultad de Medicina de la Universidad de Navarra 1975-1981. Especialista en Neurofisiología Clínica vía MIR. C. S. Virgen de la Arrixaca de Murcia, 1982-1986.<br /> Doctora en Medicina Y Cirugía por la Universidad de Murcia.<br /> Master en Medicina Humanitaria (Universidad Miguel Hernández).&#160; Facultativo Especialista en Neurofisiología Clínica (NFLC) del Servicio Murciano de Salud. Médico Jefe de Sección de NFLC, del Servicio Murciano de Salud. Diferentes Comunicaciones y Ponencias en Mesas Redondas en Congresos y Reuniones Científicas. Coordinadora y Participante como docente en diversos cursos. Miembro de diferentes Comisiones del Hospital General Universitario de Murcia. Premio de la Comisión Central de Garantía de Calidad del Hospital Morales meseguer a la Comisión de Historias Clínicas y Documentación y a la Calidad Asistencial 2001. Evaluadora de Actividades Formativas Médicas Especializadas. Evaluadora externa de actividades formativas de SEAFORMEC (Sistema Español de Acreditación de la Formación Médica Especializada) por designación del Colegio Oficial de Médicos de la Región de Murcia, desde 2004.<br /> Evaluadora externa de actividades de formación médica especializada del Servicio Murciano de Salud.</p> <hr /> <h4>Dr. CARLOS ESCOBAR SÁNCHEZ<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado y Doctor en Medicina y Cirugía por la Universidad de Murcia. Especialista en Otorrinolaringología. Diploma Universitario en Perturbaciones de la Audición y del Lenguaje (Logopedia) y Apto en requerimientos médicos-científicos en el Foreing Medical Graduate Examination Of The United States Of America. Facultativo Especialista de Área del Servicio de Otorrinolaringología del Hospital Universitario \"Morales Meseguer\" de Murcia, ha realizado numerosas estancias en el Extranjero, artículos en revistas científicas nacionales e internacionales y capítulos de libros. Editor de libros como “Orl sin recurrir a pruebas complementarias”, “Hipoacusias Infantiles”, “Sinusitis Crónica Y Poliposis” y “Rinología Básica”. Miembro de la Sociedad de Otorrinolaringología y Patología Cérvico- Facial de la Región de Murcia con el cargo de Secretario General entre 1996-2004.&#160; Sociedad Española de Otorrinolaringología y Patología Cervico- Facial. Cargo de Vocal de la Comisión de protocolos y Estándar durante un mandato. Socio Fundador y Tesorero Español de la Asociación Hispano-Alemana de ORL y Cirugía Cérvico-Facial desde 1998 hasta la fecha. Socio Fundador y Presidente de la Asociación de Médicos ORL DEB.</p> <hr /> <h4>Dr. JUAN COBO PLANAS<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado en Medicina y Cirugía por la Facultad de Medicina de la Universidad de Zaragoza. Especialista en Estomatología por la Escuela de Estomatología de la Universidad de Oviedo. Doctor en Medicina y Cirugía (Universidad de Oviedo). Diplomado en Periodoncia Social (University of Illinois). Especialista Universitario en Ortodoncia. Especialista Universitario en Valoración del Daño Buco Dental. Master Universitario en Metodología y Técnicas de Investigación Oral Master Universitario en Metodología y Técnicas de Investigación en Ciencias de la Salud. Catedrático de Ortodoncia de la Facultad de Odontología de la Universidad de Oviedo. Miembro de la American Association of Orthodontists. Director del Programa Máster de Ortodoncia y Ortopedia Dento-Facial.<br /> Director del Programa de Especialistas Universitarios en Ortodoncia, Universidad de Oviedo. Instructor acreditado para la enseñanza de la técnica de Arco Recto,Lawrence F. Andrews Foundation. San Diego (E.E.U.U.). Director de la Escuela de Estomatología, Universidad de Oviedo.&#160; Profesor Colaborador del Programa de Especialización en Ortodoncia de la Facultad de Medicina y Odontología de la Universidad de Valencia. Coordinador del Proyecto E 5017.&#160; Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996) Coordinador del Proyecto D 5004. Erasmus/Lingua Aktion II. Universidad de Oviedo. (1995-1996). Director del Máster de Ortodoncia y Ortopedia Dento Facial. Universidad de Oviedo. (2002-2005). Director del Título de Especialista Universitario en Ortodoncia. (Actualidad). Director del Máster Oficial de Ortodoncia y Ortopedia Dentofacial. Director y autor de numerosas Tesis Doctorales, comunicaciones y ponencias.</p> <hr /> <h4>Dr. RICARDO E. OÑATE SÁNCHEZ</h4> <p><strong>Currículum: </strong>Especialista en Estomatología.<br /> Licenciado en Medicina y Cirugía.<br /> Profesor Titular de la Universidad de Murcia.<br /> Responsable de la Unidad Docente de Pacientes Especiales en la Licenciatura de Odontología.<br /> Secretario del Departamento de Dermatología, Estomatología,<br /> Radiología y Medicina Física de la Facultad de Medicina y Odontología de la Universidad de Murcia.</p> <hr /> <h4>Dr. JOSÉ Mª USTRELL<strong><br /> </strong></h4> <p><strong>Currículum: </strong>Licenciado, Doctor en Medicina y Cirugía y especialista en Estomatología, por la Universidad de Barcelona (UB). Profesor Titular de Ortodoncia en la Facultad de Odontología de la Universidad de Barcelona. Coordinador del \"Mestrado na especialidade de Ortodontia\" en el Instituto Superior de Ciências da Saúde-Norte de Gandra y Miembro del Comité Técnico del \"Mestrado de Ortodontia e Cirurgia Ortognática\" en la Universidade de Porto (Portugal) (2005). Miembro correspondiente de la Reial Acadèmia de Medicina de Catalunya (RAMC). Vocal de la Acadèmia de Ciències Mèdiques de Catalunya i Balears. Presidente de la Comisión de Salud Bucodental de la Generalitat de Catalunya. Tesorero del Groupement International pour la Recherche Scientifique en Stomatologie et Odontologie. Miembro fundador y vicepresidente de la Sociedad Española de Odontologia Infantil Integrada. Autor de varios libros sobre Ortodoncia e historia de la Odontología. Director de numerosas y autor de publicaciones es dictante de varios Cursos y responsable de varias líneas de investigación. Ostenta el premio Lauréat du prix (1995), Mention spécial (1997) del GIRSO y legado Prof. Lluís Sayé (1999) de la RAMC.</p> <p>&#160;</p>','Murcia 2011 COPIA COMPLETA CON CONCLUSIONES','','publish','open','open','','murcia-2011-copia-completa-con-conclusiones','','','2016-03-14 16:48:38','2016-03-14 15:48:38','',0,'http://seoii.davidsantiago.net/events/murcia-2011-copia-completa-con-conclusiones/',0,'event','',0),(488,1,'2012-06-26 19:49:18','2012-06-26 17:49:18','<p><a href=\"http://seoii.es/resources/upload/link/57-vii-encuentro/Cartel-IX-Encuentro.pdf\" title=\"Descargar cartel PDF\"><img width=\"200\" height=\"283\" src=\"http://seoii.es/resources/304\" class=\"right bordered\" alt=\"\" /></a>El día <strong>6 de octubre de 2012</strong> se celebró el <strong>IX Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria, </strong>que se desarrolla en el contexto del<strong> XXVI Congreso Nacional de la SEPEAP y el III Congreso Internacional Hispano - Luso de Pediatría Extrahospitalaria.<br /> </strong></p> <p>&#160;</p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos 0,95 Créditos de Formación Continuada y de Libre Configuración.</strong></li>   <li><strong>Se entregará certificado de asistencia con créditos.</strong></li> </ul> <h3>Conclusiones</h3> <p>El pasado 6 de octubre en las nuevas instalaciones del Palacio de Exposiciones y Congresos de Sevilla (FIBES) tuvo lugar el IX Encuentro&#160; Multidisciplinar de Odontología Infantil Integrada (SEOII) Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX). En esta ocasión el encuentro tuvo como tema monográfico “Caries de la niñez temprana: Abordaje y perspectiva multidisciplinar”&#160; y se desarrolló dentro del XXVI Congreso Nacional de la SEPEAP y III Congreso Internacional Hispano Luso de Pediatría Extra-Hospitalaria.</p> <p>Como en anteriores eventos, este Encuentro tuvo el reconocimiento de la Agencia Nacional de Acreditación con 0,95 créditos de Formación Continuada y de la Universidad Hispalense de Sevilla con 1 crédito de Libre Configuración para los alumnos de pregrado.</p> <p>Con una amplia asistencia de 152 profesionales, comunicaciones y numerosos alumnos, la mesa inaugural estuvo presidida por el Dr. D. José Luís Bonal (Presidente de la SEPEAP), el Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), el Dr. D. José del Pozo Machuca (Vicepresidente de la SAOYEX), el Dr Cristobal Coronel (Pediatra y Presidente del XXVI Congreso de la SEPEAP) y la Dra. Dª Antonia Domínguez Reyes, (Presidenta de la SEOII Ampliamente desarrollado por diferentes profesionales de las Ciencias de la Salud, odontólogos, estomatólogos, psicólogos y pediatras, todos coincidieron en señalar que el hecho de que hoy, en nuestro medio, sigan viéndose niños con caries en más de dos o tres superficies en dientes temporales recién erupcionados, es clara indicación de la importante y alarmante actualidad de este tema. Alarmante actualidad sobre todo si tenemos en cuenta que pese a los avances y promociones en pos de la educación sanitaria, la caries en la niñez temprana sigue mostrando una alta frecuencia.</p> <p>Fueron ponentes en la Mesa Redonda las Dras. Isabel Colomer&#160; Ureña, Montserrat Gómez de Terreros Guardiola, Rosario Gómez Cuadrado y Patricia Gatón quienes, ante este panorama, analizaron&#160; la situación, los&#160; factores contribuyentes a la misma, la genética, los estilos de vida, dieta y hábitos, algo para lo que es indispensable aplicar metodologías y protocolos de actuación conjunta antes de los tres años de edad, incluso desde antes del nacimiento con educación a las embarazadas y entorno familiar.</p> <p>Tras las distintas exposiciones, todos los asistentes constituyeron un interesante foro con importante participación activa. Un foro de preguntas, respuestas y discusiones donde se pudo aprender, debatir y consensuar los distintos aspectos y visiones multidisciplinares de este actual y acuciante problema que demanda la implicación de todos.</p> <p>El que participaran numerosos alumnos de pre y post-grado de las distintas Facultades de nuestro país puso de relieve el cada vez mayor interés que suscita dentro y fuera de nuestras fronteras la tendencia a ver al niño como un todo bajos todos sus aspectos: biológicos, psíquicos y sociales; conceptos que la SEOII viene desarrollando desde su fundación.</p> <p>La conferencia de clausura estuvo a cargo Dr. D. Ignacio Gómez de Terreros Sánchez el cual centró su intervención en <strong>“La Familia ante&#160; el Reto Del Siglo XXI</strong>”</p> <p>La Dra. Domínguez Reyes, tras señalar que el próximo Congreso Nacional de la SEOII tendrá lugar en Madrid en&#160; marzo de 2013 (presidido por&#160; la Dra. Mourelle) agradeció a todos, ponentes, Universidades, Agencia de Acreditación y asistentes, su activa participación; a la empresa Jonson &amp; Johnson su&#160; patrocinio y a GC- Ibérica Dental Product y&#160; Ripano su colaboración. Palabras tras las cuales, el Drs. Del Pozo Machuca, Ortiz Tardío y&#160; Gómez de Terreros dieron por clausurado el IX Encuentro Multidisciplinar de la SEOII /SEPEAP/SPAOYEX.</p> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Palacio de Exposiciones y Congresos de Sevilla (FIBES) </strong><br /> Avda. Alcalde Luis Uruñuela, 1<br /> 41020&#160; Sevilla</p> <p><strong>&#160;&#160; </strong></p> <h3>Programa del congreso para el día sábado, 6 de Octubre de 2012</h3> <ul>   <li>08:30 - 9:30: <strong>Entrega de documentación.</strong></li>   <li>09:30: <strong>Inauguración de la Jornada</strong><br />   Dr. D. José del Pozo Machuca<br />   Dr. D. Joaquín Ortiz Tardío<br />   Dr. D. José Luis Bonal Villanueva<br />   Dr. D. CristóbalCoronelRodríguez<br />   Dra. Dª Antonia Domínguez Reyes<br />   &#160;<br />   <strong>Mesa redonda: Caries de la niñez temprana. Abordaje y Perspectiva Multidisciplinar. <br />   </strong>Moderadores:&#160; Dr. D. José del Pozo Machuca y Dra. Dª Antonia Domínguez Reyes<br />   &#160;</li>   <li>10:00 – 10:45: <strong>¿Como debe ser&#160; la alimentación desde la lactancia hasta la niñez temprana? Tipos, modelos e influencias. <br />   </strong>Dra. Dª.&#160; Isabel Colomer Ureña</li>   <li>10:45 – 11:15: <strong>Aspectos Psicológicos de la alimentación la niñez temprana.&#160; <br />   </strong>Dra. Dª Montserrat Gómez de Terreros Guardiola.</li>   <li>11:15 – 11:45: <strong>Café</strong></li>   <li>11:45 - 12:30: <strong>Abordaje precoz de la caries de la Primera Infancia.&#160; <br />   </strong>Dra. Dª&#160; Rosario Gómez Cuadrado</li>   <li>12:30 – 13:15: <strong>Protocolos de Prevención&#160; en niños afectos de caries&#160; de la Primera Infancia.</strong><br />   Dra. Dª Patricia Gatón Hernández</li>   <li>13:15 – 14:30: <strong>Coloquio Mesa Redonda.</strong></li>   <li>16:00 – 17:00: <strong>Moderadores:&#160; </strong>Dr. D. José González Hachero y Dr. D. Joaquín de Nova</li>   <li>17:00 – 18:00: <strong>Moderadores:&#160; </strong>Dr. D. Joaquín Ortiz&#160; Tardío y Dr. D. Antonio F. Galán González</li>   <li>18:00 – 19:00: <strong>Moderadores:&#160; </strong>Dra. Dª .Inés Mª Marín Castro y Dr. D. Cristóbal Coronel Rodríguez</li>   <li>19:00 – 19:30: <strong>Mesa Coloquio de la Comunicaciones Libres</strong></li>   <li>19:30: <strong>Conferencia de clausura: La Familia ante&#160; el Reto Del Siglo XXI</strong><br />   Dr. D. Ignacio Gómez de Terreros</li>   <li>08:30:&#160; <strong>Clausura</strong></li> </ul> <p>Descargar el programa:<b> <a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Programa-IX-Encuentro.pdf\">Archivo PDF</a></b></p> <p>&#160;</p> <h3>Colaboran:</h3> <ul>   <li>Sociedad de Pediatría de Andalucía Occidental y Extremadura, Pediatría Extrahospitalaria de Sevilla</li> </ul> <p>&#160;</p> <h3 class=\"slideToggle\">Comité científico:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>Antonio F. Galán González</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del&#160; Pozo Machuca</li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Comité Organizador:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Inscripciones:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Gratuita, para los Miembros de las distintas Asociaciones.</li>   <li>Estudiantes de pregrado: 15 €</li>   <li>Estudiantes de postgrado: 25 €</li>   <li>Profesionales: 40 €</li>   <li>Dado el aforo limitado se ruega comunicar asistencia a la Secretaria Técnica.</li>   <li>Descargar el formulario de inscripción: <a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Hoja_inscripcion_IX_Encuentro.pdf\"><strong>Archivo PDF</strong></a></li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\">Comunicaciones:</h3> <div class=\"hide\" style=\"display: none;\"> <ul>   <li>Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.&#160;</li>   <li>Descargar Normas de Comunicaciones: <strong><a href=\"http://seoii.es/resources/upload/link/110-ix-encuentro-multidisciplinar/SEOII_Normas-de-comunicaciones.pdf\">Archivo PDF</a><br />   </strong></li> </ul> <p>&#160;</p> </div> <h3 class=\"slideToggle\