   <li><strong>Joaquín de Nova García:</strong> Profesor Titular de Odontoprdiatría. U. C. de Madrid.</li>   <li><strong>Joaquín Ortiz Tardío: </strong>Pediatra. Jefe de Servicio de Pediatría del Hospital de Jerez de la Frontera Presidente de la SPAOYEX</li>   <li><strong>José del Pozo Machuca:</strong> Pediatra Extrahospitalario. Sevilla. Director de Vox Pædiatrica. Vicepresidente de la SPAOYEX</li> </ul> <p></p> </div> <h3>Galería de fotos del congreso</h3> <ul>   <li><strong><strong>1º Foto: </strong>Mesa inaugural: </strong>(De izquierda a derecha) Dr. D. José del Pozo Machuca (Vicepresidente de la SAOYEX), Dr. D. Joaquín Ortiz Tardío (Presidente de la SPAOYEX), Dra. Dª Antonia Domínguez Reyes, (Presidenta de la SEOII, Dr. D. José Luís Bonal (Presidente de la SEPEAP), y el Dr Cristobal Coronel (Pediatra y Presidente del XXVI Congreso de la SEPEAP) .</li>   <li><strong><strong>2º Foto: </strong>Coloquio mesa redonda:</strong> (De izquierda a derecha) Ponentes: Dra. Dª Montserrat Gómez de Terreros&#160; Guardiola (Profesora Titular&#160; de Psicología, Facultad de Psicología, Universidad de Sevilla. Especialista en Psicología Clínica), Dra. Dª Isabel Colomer&#160; Ureña (,Médico Especialista en Medicina Intensiva y Pediatría. Asociado en Pediatría. Universidad de Sevilla), Dra. Dª Rosario Gómez Cuadrado (Profesora Asociada de Odontología Infantil Integrada. Universidad de Sevilla. Dra. Dª Patricia Gatón Hernández (Profesora Asociada. Universidad de Barcelona).<br />   Moderadores: Dr. D. Joaquín Ortiz Tardío (Pediatra. (Jefe de Servicio de Pediatría del Hospital de Jerez de la Frontera, Dra. Dª Antonia Domínguez Reyes (Profesora Titular de Odontología Infantil Integrada. Universidad de Sevilla).</li>   <li><strong>3º Foto:&#160;</strong> Dr. Galán,&#160; Mª Jose Clavijo, delegada de Johnson &amp; Johnson y Dra. Cabrera</li> </ul>','Sevilla 2012: IX Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','ix-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:39','2016-03-14 15:48:39','',0,'http://seoii.davidsantiago.net/events/ix-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(489,1,'2012-12-03 11:48:29','2012-12-03 10:48:29','<p>Los días <strong>14 al 16 de marzo de 2013</strong> se celebró en Madrid el <strong>III Congreso&#160; Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada.</strong><strong><br /> </strong></p> <p>Más información en la web del congreso: <a href=\"http://www.seoii2013madrid.com\"><strong>seoii2013madrid.com</strong></a></p> <p>&#160;</p> <h3>Presentación</h3> <p align=\"justify\">Queridos y estimados compañeros,</p> <p align=\"justify\">Como Presidenta del Comité Organizador, me gustaría invitaros a  participar en el <strong>3er  Congreso&#160; Internacional&#160; y&#160; 8º  Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada</strong> que  tendrá lugar del 14 al 16 de Marzo de 2013, en la Facultad de Odontología de la  Universidad Complutense de Madrid.</p> <p align=\"justify\">En esta ocasión, trataremos temas de relevante  actualidad e impacto  que nos serán útiles en nuestro día a día, por  esta razón nos centraremos en  aquellos aspectos más novedosos en la  atención odontológica infantil a través  de mesas redondas, talleres y  cursos intracongreso.</p> <p align=\"justify\">Contaremos para ello con la colaboración de  diversos profesionales de  reconocido prestigio, tanto nacional como  internacional, pertenecientes a  distintos&#160; ámbitos de las Ciencias de  la  Salud.</p> <p align=\"justify\">Todo esto conforma un Congreso de carácter  multidisciplinar e  interprofesional, característica distintiva de  nuestra Sociedad (SEOII) que  esta comprometida con la innovación y la  mejora continuada, enriquecido por las  aportaciones de los  participantes realizadas mediante comunicaciones  presenciales y/o  pósters virtuales.</p> <p align=\"justify\">Nos gustaría contar con vuestra asistencia y a la  vez animaros a  recorrer Madrid,&#160; a disfrutar&#160; de una ciudad donde os  encontraréis en  vuestra casa. Madrid ofrece una gran diversidad  cultural, gastronómica y de  ocio, todo esto unido, a su vida en la  calle y a la forma  en que sus habitantes acogen al visitante.</p> <p align=\"justify\">En el convencimiento de que estos días que vamos a  disfrutar van a ser  inolvidables, os animo a compartir conocimientos y  amistades, lo que nos  ayudará a ser mejores profesionales y sobre todo  mejores personas.</p> <p align=\"left\">Esperando  contar con tu  presencia, recibe un&#160; fuerte abrazo</p> <p><strong>Dra. Mª Rosa Mourelle Martínez<br /> Presidenta Comité Organizador del 3er Congreso Internacional  y <br /> 8º Congreso  Nacional de la <br /> Sociedad Española de Odontología Infantil Integrada.</strong></p> <p>&#160;</p> <h3>Lugar de celebración</h3> <p><strong>Facultad de Odontología</strong><br /> Universidad Complutense de Madrid - Ciudad Universitaria<br /> 28040 Madrid - Tel.+ 34 914520400</p> <p>&#160;</p> <h3>Página web del congreso</h3> <p>Para encontrar más información puedes visitar la web del congreso: <a href=\"http://www.seoii2013madrid.com\">seoii2013madrid.com</a></p>','Madrid 2013: III Congreso Internacional y VIII Congreso Nacional de la Sociedad Española de Odontología Infantil Integrada','','publish','open','open','','madrid-2013-iii-congreso-internacional-viii-congreso-nacional','','','2016-03-14 16:48:39','2016-03-14 15:48:39','',0,'http://seoii.davidsantiago.net/events/madrid-2013-iii-congreso-internacional-viii-congreso-nacional/',0,'event','',0),(490,1,'2013-09-16 23:07:01','2013-09-16 21:07:01','<p><img width=\"220\" src=\"http://seoii.es/resources/328\" class=\"right bordered\" alt=\"Sevilla 2013: X Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria\" />El día <strong>16 de noviembre de 2013</strong> se celebró el <strong>X Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria. </strong></p> <h3>Acreditación de las Actividades Científicas</h3> <ul>   <li><strong>Concedidos </strong><strong>1 crédito de Libre Configuración por la Universidad de Sevilla.</strong></li>   <li><strong>Concedido 0.88 créditos de Formación Continuada por la Agencia de Calidad Sanitaria de ndalucía. Consejería de Salud y Bienestar Social.</strong></li>   <li><strong>Se entregó certificado de asistencia con créditos.</strong></li> </ul> <h3>Conclusiones del congreso</h3> <p>Una vez más en el Centro Cultural Cajasol de Sevilla, el 16 de Noviembre, tuvo lugar el X Encuentro  Multidisciplinar de Odontología Infantil Integrada (SEOII). Encuentro que, conjuntamente con la Sociedad de Pediatría Extrahospitalaria y Atención Primaria (SEPEAP) y la Sociedad de Pediatría de Andalucía Occidental y Extremadura (SPAOYEX), Otorrinolaringología y otras Ciencias de la Salud, constituye uno de esos clásicos eventos científicos anuales de Sevilla. En esta ocasión dicho encuentro tuvo como tema monográfico<i> </i>el problema de l<i>a </i>respiración en el niño, sus alteraciones y consecuencias sobre el Sistema Estomatognático. Consecuencias que muchas veces requieren un tratamiento multidisciplinar.</p> <p>Como en ocasiones anteriores este encuentro tuvo el reconocimiento de la Agencia Nacional de Acreditación y  la Universidad Hispalense de Sevilla que concedieron créditos de formación continuada y libre configuración para profesionales y alumnos.</p> <p>La Inauguración de la Jornada estuvo presidida por el Dr. del Pozo Machuca Presidente de Honor SEPEAP y Director de la Revista Vox Paediatrica,  Dra. Domínguez Reyes, Presidenta de la SEOII, Dr. Coronel, Vicepresidente la SPAOYEX y el Dr. Cabrera, Asesor de la SEOII.</p> <p>Ante amplia asistencia de más de un centenar de profesionales y alumnos, intervinieron la Dra. Dª Antonia Domínguez Reyes, Profa. Titular de Odontología Infantil y Ortodoncia Integrada de la Facultad de Odontología de Sevilla y Presidenta de la Sociedad Española de Odontología infantil Integrada; el Dr. D. Anselmo Andrés Martín, Prof. Contratado Doctor con vinculación clínica al SSPA del Servicio de Pediatría del Hospital V. Macarena de Sevilla y Neumólogo Infantil, el Dr. D. Carlos O`Connor, especialista en Otorrinolaringología, autor del primer implante de paladar que se desarrolló en España para el tratamiento de la apnea de sueño y del primer estudio científico internacional publicado sobre el tratamiento de la rinitis alérgica infantil con radiofrecuencia; la Dra. Dª Paola &gt;Díaz Borrego, especialista en Foniatría que ha trabajado sobre los protocolos de actuación para trastornos de la deglución oro-farínfea y la Dra. Dª Mercedes Gálvez, odontólogo especialista en Ortopedia Funcional de los Maxilares por la Universidad de UNICSUL de Brasil, varias veces invitada como Profesora por la Universidad de Texas (Health Science Center at Houston,USA) y por la Profa. Wilma Simoes en su Centro Docencia de Sao Paulo en Brasil y actualmente Profa. del Master Propio en Odontología Infantil Integrada de la Universidad de Sevilla.</p> <p>Tras las distintas exposiciones tanto los miembros de la mesa como los  asistentes constituyeron un interesante coloquio abierto en el que las preguntas, respuestas y discusiones establecieron la importancia que, por sus repercusiones tanto a nivel Sistémico como Estomatognático, tiene el conocimiento y reconocimiento por parte de los pediatras, odontólogos y foniatras de las afecciones respiratorias en el niño. Problemas como el asma, la apnea de sueño, las rinitis alérgicas y otras afecciones que muchas veces requieren tratamientos multidisciplinares. En el coloquio establecido se pudo debatir y consensuar los distintos aspectos y visiones multidisciplinares de este actual y grave problema de las alteraciones respiratorias en el niño y su influencia en el desarrollo buco-dento-facial.</p> <p>La conferencia de clausura estuvo a cargo del Prof. D. Enrique Valdivieso González, Catedrático de Historia del Arte en la Universidad Hispalense, autor de varios libros sobre el tema de la Pintura quien, desarrolló una magnífica conferencia sobre el niño en la pintura romántica sevillana.</p> <p>La Dra. Domínguez Reyes, tras invitar al próximo Encuentro de Sevilla,  señala que el próximo Congreso Nacional de la SEOII tendrá lugar en Salamanca, presidido por la Dra Pilar Moreno los días 12 a 14 de Marzo de 2015. Agradece a todos los asistentes y ponentes su activa participación; a la Universidad y  Agencia de Acreditación, su reconocimiento; al Centro Cultural Cajasol su acogida y a Jonson &amp; Johnson su patrocinio, clausuró este X Encuentro que una vez más constituyó un importante foro de participación interprofesional e interdisciplinar.</p> <p>&#160;</p> <h3 class=\"slideToggle\" id=\"programa_congreso\">Programa del congreso para el día sábado, 6 de Octubre de 2012</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li><strong>8:30 - 9:30: Entrega de documentación.</strong></li>   <li><strong>9:30: Inauguración de la Jornada. </strong><br />   Dr. D. José del Pozo Machuca<br />   Dr. D. Joaquín Ortiz Tardío<br />   Dr. D. José Luis Bonal Villanueva<br />   Dr. D. Cristóbal Coronel Rodríguez<br />   Dra. Dª Antonia Domínguez Reyes<br />   <br />   <strong>Mesa redonda: Respiración en el niño. Un abordaje multidisciplinar. </strong><br />   Moderadores:&#160; Dr. D. José del Pozo Machuca<br />   &#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160; Dra. Dª Antonia Domínguez Reyes</li>   <li><strong>10:00 – 10:45. Problemas respiratorios en la infancia. ¿cómo reconocerlos?</strong><br />   Dr. D Anselmo Andrés Martín</li>   <li><strong>10:45 – 11:30: ¿Que nos aporta la ORL a los problemas odontológicos derivados de un mala respiración?.</strong><br />   &#160;Dr. D.&#160; Carlos O’Connor Reina</li>   <li><strong>11:30 – 11:45: Café</strong></li>   <li><strong>11:45- 12:30. ¿Cómo contribuye la Foniatría a mejorar los problemas respiratorios y sus repercusiones? </strong><br />   Dra. Dª&#160; Laura García Rodríguez</li>   <li><strong>12:30 – 13:15 ¿Cómo debe actuar el odontólogo ante problemas respiratorios en el niño?</strong><br />   Dra. Dª Mercedes Gálvez Jiménez</li>   <li><strong>13:15 – 14:30: Coloquio Mesa Redonda.</strong></li>   <li><strong>19:30: Conferencia de clausura: El niño en la pintura barroca europea .Siglo XVII.</strong><br />   Prof. D. Enrique Valdivieso González</li>   <li><strong>20:30&#160; Clausura del X Encuentro</strong></li> </ul> <p>Descargar el programa:<b> <a target=\"_blank\" href=\"http://seoii.es/resources/upload/link/113-x-encuentro-multidisciplinar/SEOII_Programa-X-Encuentro.pdf\" rel=\"external\">Archivo PDF</a></b></p> </div> <h3 class=\"slideToggle\" id=\"comunicaciones_congreso\">Comunicaciones:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li>Aportaciones en formato comunicación oral con visión multidisciplinar de los Residentes y Alumnos de Postgrado de Pediatría, Odontología, Fisioterapia, Psicología y otras en Ciencias de la Salud.&#160;</li>   <li>Mesa Coloquio de las Comunicaciones Libres</li>   <li>Descargar Normas de Comunicaciones: <strong><a href=\"http://seoii.es/resources/upload/link/113-x-encuentro-multidisciplinar/SEOII_Normas-de-comunicaciones.pdf\" target=\"_blank\" rel=\"external\">Archivo PDF</a><br />   </strong></li>   <li><strong>16:30 – 17:30  Moderadores:</strong><br />   Dra. Dª. Rosa Mourelle Martínez<br />   Dr. D. Cristóbal Coronel Rodríguez</li>   <li><strong>17:30 – 18:30  Moderadores:</strong><br />   Dra. Dª. Nuria Esther Gallardo López<br />   Dr. D. Joaquín Ortiz Tardío</li>   <li><strong>18:30 – 19:30  Moderadores:</strong><br />   Dr. D Josep Mª Ustrell Torrent<br />   Dr. D. Joaquín de Nova García</li> </ul> </div> <h3 class=\"slideToggle\" id=\"formulario_inscripcion_congreso\">Inscripciones:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li>Gratuita, para los Miembros de las distintas Asociaciones.</li>   <li>Estudiantes de pregrado: 20 €</li>   <li>Estudiantes de postgrado: 30 €</li>   <li>Profesionales: 50 €</li>   <li>Dado el aforo limitado se ruega comunicar asistencia a la Secretaria Técnica.</li>   <li>Descargar el formulario de inscripción: <a href=\"http://seoii.es/resources/upload/link/113-x-encuentro-multidisciplinar/SEOII_Inscripcion-X-Encuentro.pdf\" target=\"_blank\" rel=\"external\"><strong>Archivo PDF</strong></a></li> </ul> </div> <h3 class=\"slideToggle\">Colaboran:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li>Sociedad de Pediatría de Andalucía Occidental y Extremadura, Pediatría Extrahospitalaria de Sevilla</li>   <li>Sepeap:&#160;Sociedad Española de Pediatría Extrahospitalaria y Atencion Primaria</li>   <li>Johnson&amp;Johnson</li>   <li>Universidad de Sevilla</li>   <li>Facultad de odontología</li>   <li>SEOII: Sociedad Española de Odontología Infantil Integrada</li> </ul> </div> <h3 class=\"slideToggle\">Ponentes y participantes:</h3> <div class=\"hide\" style=\"display:none;\"> <ul>   <li><strong>Anselmo Andrés Martín</strong><br />   Profesor Asociado de Pediatría. <br />   Universidad de Sevilla.</li>   <li><strong>Elena Barbería Leache. </strong><br />   Catedrático de Odontopediatría.<br />   Universidad de Madrid. Asesor de la SEOII.</li>   <li><strong>José Luis Bonal Villanueva</strong><br />   Pediatra extrahospitalario. Presidente de la SEPEAP</li>   <li><strong>Eugenio P. Cabrera Suárez.</strong><br />   Medicina Familiar&#160; y Comunitaria.<br />   Centro de Salud. Sevilla. Asesor de la SEOII.</li>   <li><strong>Cristóbal Coronel Rodríguez</strong><br />   Asis