/>   Profesor Titular de la Universidad de Sevilla.<br />   Académico de Numero de la RAMSE; Miembro del CEAS del Área Sevilla<br />   Norte y del Comité Deontológico de RICOMS.</li>   <li><strong>Meritxell Sánchez Molins</strong><br />   Profesora de Ortodoncia.<br />   Universidad de Barcelona</li>   <li><strong>Josep Mª Ustrell Torrent</strong><br />   Profesor Titular de Ortodoncia.<br />   Universidad de Barcelona.</li> </ul> </div> <h3 class=\"XslideToggle\">Lugar de celebración</h3> <div style=\"Xdisplay: none;\" class=\"Xhide\"> <p><strong>Centro Cultural CAJASOL</strong><br /> C/ Laraña nº 4 (Sevilla)</p> <p><strong>Secretaría técnica:</strong><br /> &#160;Facultad de Odontología. <br /> Despacho O. Integrada Infantil. 2º planta<br /> C/ Avicena, s/n<br /> 41009 Sevilla<br /> Tlfo: 651 953 446 - 954 481 123</p> </div> <h3 class=\"XslideToggle\">Comité Organizador:</h3> <div style=\"Xdisplay:none;\" class=\"Xhide\"> <ul>   <li>Teresa Aznar Martín</li>   <li>Elena Barbería Leache</li>   <li>José Luis Bonal Villanueva</li>   <li>Mª Eugenia Cabrera Domínguez</li>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>Antonio F. Galán González</li>   <li>Rosario Gómez Cuadrado</li>   <li>Inés M. Marín Castro</li>   <li>Lourdes Muñoz Muñoz</li>   <li>Joaquín Ortiz Tardío</li>   <li>José del Pozo Machuca</li> </ul> </div> <h3 class=\"XslideToggle\">Comité Científico:</h3> <div style=\"Xdisplay:none;\" class=\"Xhide\"> <ul>   <li>Eugenio P. Cabrera Suárez</li>   <li>Cristobal Coronel Rodrígez</li>   <li>Antonia Domínguez Reyes</li>   <li>José del Pozo Machuca</li> </ul> </div>','Sevilla 2014: XI Encuentro Multidisciplinar de Odontología Infantil Integrada y Pediatría Extrahospitalaria y Atención Primaria','','publish','open','open','','sevilla-2014-xi-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria','','','2016-03-14 16:48:41','2016-03-14 15:48:41','',0,'http://seoii.davidsantiago.net/events/sevilla-2014-xi-encuentro-multidisciplinar-de-odontologia-infantil-integrada-y-pediatria-extrahospitalaria-y-atencion-primaria/',0,'event','',0),(492,1,'2014-11-06 12:59:04','2014-11-06 11:59:04','<p><img alt=\"Salamanca 2015\" src=\"http://seoii.es/resources/340\" /></p> <p>Durante los días<strong> 12, 13 y 14 de Marzo de 2015</strong> se celebrará el <strong>Salamanca 2015: IX Congreso nacional de la Sociedad Española de  Odontología Integrada Infantil (SEOII), LIII congreso nacional del Club  Internacional de Rehabilitación Neuro Oclusal – Asociación Española  Pedro Planas, I Congreso Nacional SEOII / CIRNO-AEPP.</strong></p> <p>El tema central del congreso será: <strong>“Crecimiento y desarrollo oro-facial del niño desde la más temprana infancia”</strong>, abordándolo desde diferentes puntos de vista y contando, para ello, con profesionales de reconocido prestigio pertenecientes a diferentes ámbitos de las Ciencias de la Salud.</p> <p>&#160;</p> <p><a href=\"https://www.youtube.com/watch?v=bavWwUt0tLk\" class=\"media\">https://www.youtube.com/watch?v=bavWwUt0tLk</a></p> <p>&#160;</p> <h3>Presentación:</h3> <p>Queridos y apreciados compañeros.</p> <p>Como presidenta del comité organizador, supone un honor y una gran alegría invitaros a asistir y participar en el&#160;&#160; 9º Congreso Nacional de la Sociedad Española de Odontología Integrada Infantil, 53º Congreso del CIRNO - Asociación Española Pedro Planas y 1er Congreso nacional SEOII - CIRNO – AEPP, que tendrá lugar del 12 al 14 de marzo de 2015 en la ciudad de Salamanca.</p> <p>El tema central del Congreso será el “crecimiento y desarrollo oro-facial del niño desde la más temprana infancia”, abordándolo desde diferentes puntos de vista y contando, para ello, con profesionales de reconocido prestigio pertenecientes a diferentes ámbitos de las Ciencias de la Salud.</p> <p><img width=\"250\" alt=\"Cartel Salamanca 2015\" src=\"http://seoii.es/resources/341\" class=\"right bordered\" />El Congreso tendrá un enfoque multidisciplinar, característica distintiva de los congresos y reuniones de nuestra sociedad (SEOII). Se hablará y debatirá sobre todos los factores que pueden influir en el crecimiento oro-facial del paciente infantil y los diferentes puntos de vista de los profesionales sobre dicho proceso. Las sesiones específicas adoptarán diferentes formatos, como mesas redondas, conferencias o talleres formativos, completándose el programa científico con las aportaciones de los participantes mediante comunicaciones presenciales y/o posters.</p> <p>La sede del Congreso será la hospedería del Colegio Arzobispo de Fonseca, edificio singular que aglutina las características de la ciudad de Salamanca: cuidad de historia, arte, cultura y saber, cuyo casco histórico está declarado Patrimonio de la Humanidad por la UNESCO. La oferta cultural de Salamanca y el programa social del Congreso, que daremos a conocer más adelante, son un motivo más para acudir a esta, ya de por sí, interesante cita.</p> <p>Invitamos a la participación a todos los profesionales y estudiantes de ciencias de la salud, desando compartir con todos unos días de ciencia, intercambio de conocimientos, camaradería y entreteniendo.</p> <p>Esperando contar con vuestra presencia, ¡Nos vemos en Salamanca!</p> <p>Mª Pilar Moreno Andrés.<br /> Presidenta comité organizador.</p> <h3>Más información en la web del congreso:</h3> <ul>   <li><a target=\"_blank\" href=\"http://wmorenow.wix.com/congreso-coidental#!programa-cientfico-y-ponentes/c1fq5\">Programa del congreso</a></li>   <li><a target=\"_blank\" href=\"http://wmorenow.wix.com/congreso-coidental#!inscripciones/c1viy\">Inscripciones</a></li>   <li><a target=\"_blank\" href=\"http://wmorenow.wix.com/congreso-coidental#!contact/con8\">Comunicaciones</a></li>   <li><a target=\"_blank\" href=\"http://wmorenow.wix.com/congreso-coidental#!sede-y-alojamientos/c218q\">Sede y alojamientos</a></li> </ul> <p>Toda la información del congreso en: <a href=\"http://wmorenow.wix.com/congreso-coidental\" target=\"_blank\"><strong>congreso.seoii.es</strong></a></p>','Salamanca 2015: IX Congreso nacional de la Sociedad Española de Odontología Integrada Infantil','','publish','open','open','','salamanca-2015-ix-congreso-nacional-de-la-sociedad-espanola-de-odontologia-integrada-infantil-seoii','','','2016-03-14 16:48:41','2016-03-14 15:48:41','',0,'http://seoii.davidsantiago.net/events/salamanca-2015-ix-congreso-nacional-de-la-sociedad-espanola-de-odontologia-integrada-infantil-seoii/',0,'event','',0),(494,1,'2016-03-14 16:58:21','2016-03-14 15:58:21','','Agenda de Eventos','','publish','closed','closed','','agenda-de-eventos','','','2016-03-14 16:58:21','2016-03-14 15:58:21','',0,'http://seoii.davidsantiago.net/?p=494',2,'nav_menu_item','',0),(510,1,'2016-03-14 22:22:19','2016-03-14 21:22:19','','favicon','','inherit','open','closed','','favicon','','','2016-03-14 22:22:19','2016-03-14 21:22:19','',0,'http://seoii.davidsantiago.net/wp-content/uploads/2016/03/favicon.ico',0,'attachment','image/x-icon',0),(511,1,'2016-03-15 22:39:35','2016-03-15 21:39:35','','medical-cross-symbols-against-blue-background','','inherit','open','closed','','medical-cross-symbols-against-blue-background','','','2016-03-15 22:39:35','2016-03-15 21:39:35','',396,'http://seoii.davidsantiago.net/wp-content/uploads/2016/03/medical-cross-symbols-against-blue-background.jpg',0,'attachment','image/jpeg',0),(513,1,'2016-03-15 23:01:39','2016-03-15 22:01:39','','bg-dentist','','inherit','open','closed','','bg-dentist','','','2016-03-15 23:01:39','2016-03-15 22:01:39','',396,'http://seoii.davidsantiago.net/wp-content/uploads/2016/03/bg-dentist.gif',0,'attachment','image/gif',0),(514,1,'2016-03-15 23:12:26','2016-03-15 22:12:26','','Dentist tools on blue background','Dentist tools on blue background','inherit','open','closed','','dentist-tools-on-blue-background','','','2016-03-15 23:12:26','2016-03-15 22:12:26','',367,'http://se